INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.221838 +00:00', '2021-06-16 20:14:09.221855 +00:00', '3d825f60-9fff-4dfe-b294-1a45fa1e115d', 'Star Wars: Episode IV - A New Hope', 'The Imperial Forces, under orders from cruel Darth Vader, hold Princess Leia hostage in their efforts to quell the rebellion against the Galactic Empire. Luke Skywalker and Han Solo, captain of the Millennium Falcon, work together with the companionable droid duo R2-D2 and C-3PO to rescue the beautiful princess, help the Rebel Alliance and restore freedom and justice to the Galaxy.', null, 8.6, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.221939 +00:00', '2021-06-16 20:14:09.221958 +00:00', '0312ed51-8833-413f-bff5-0e139c11264a', 'Star Wars: Episode V - The Empire Strikes Back', 'Luke Skywalker, Han Solo, Princess Leia and Chewbacca face attack by the Imperial forces and its AT-AT walkers on the ice planet Hoth. While Han and Leia escape in the Millennium Falcon, Luke travels to Dagobah in search of Yoda. Only with the Jedi master''s help will Luke survive when the dark side of the Force beckons him into the ultimate duel with Darth Vader.', null, 8.7, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.221999 +00:00', '2021-06-16 20:14:09.222016 +00:00', '025c58cd-1b7e-43be-9ffb-8571a613579b', 'Star Wars: Episode VI - Return of the Jedi', 'Luke Skywalker battles horrible Jabba the Hut and cruel Darth Vader to save his comrades in the Rebel Alliance and triumph over the Galactic Empire. Han Solo and Princess Leia reaffirm their love and team with Chewbacca, Lando Calrissian, the Ewoks and the androids C-3PO and R2-D2 to aid in the disruption of the Dark Side and the defeat of the evil emperor.', null, 8.3, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.222053 +00:00', '2021-06-16 20:14:09.222069 +00:00', 'cddf9b8f-27f9-4fe9-97cb-9e27d4fe3394', 'Star Wars: Episode VII - The Force Awakens', '30 years after the defeat of Darth Vader and the Empire, Rey, a scavenger from the planet Jakku, finds a BB-8 droid that knows the whereabouts of the long lost Luke Skywalker. Rey, as well as a rogue stormtrooper and two smugglers, are thrown into the middle of a battle between the Resistance and the daunting legions of the First Order.', null, 7.9, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.222105 +00:00', '2021-06-16 20:14:09.222122 +00:00', '3b914679-1f5e-4cbd-8044-d13d35d5236c', 'Star Wars: Episode I - The Phantom Menace', 'The evil Trade Federation, led by Nute Gunray is planning to take over the peaceful world of Naboo. Jedi Knights Qui-Gon Jinn and Obi-Wan Kenobi are sent to confront the leaders. But not everything goes to plan. The two Jedi escape, and along with their new Gungan friend, Jar Jar Binks head to Naboo to warn Queen Amidala, but droids have already started to capture Naboo and the Queen is not safe there. Eventually, they land on Tatooine, where they become friends with a young boy known as Anakin Skywalker. Qui-Gon is curious about the boy, and sees a bright future for him. The group must now find a way of getting to Coruscant and to finally solve this trade dispute, but there is someone else hiding in the shadows. Are the Sith really extinct? Is the Queen really who she says she is? And what''s so special about this young boy?', null, 6.5, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.222163 +00:00', '2021-06-16 20:14:09.222180 +00:00', '516f91da-bd70-4351-ba6d-25e16b7713b7', 'Star Wars: Episode III - Revenge of the Sith', 'Near the end of the Clone Wars, Darth Sidious has revealed himself and is ready to execute the last part of his plan to rule the galaxy. Sidious is ready for his new apprentice, Darth Vader, to step into action and kill the remaining Jedi. Vader, however, struggles to choose the dark side and save his wife or remain loyal to the Jedi order.', null, 7.5, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.222216 +00:00', '2021-06-16 20:14:09.222232 +00:00', 'c4c5e3de-c0c9-4091-b242-ceb331004dfd', 'Star Wars: Episode II - Attack of the Clones', 'Ten years after the invasion of Naboo, the Galactic Republic is facing a Separatist movement and the former queen and now Senator Padm√© Amidala travels to Coruscant to vote on a project to create an army to help the Jedi to protect the Republic. Upon arrival, she escapes from an attempt to kill her, and Obi-Wan Kenobi and his Padawan Anakin Skywalker are assigned to protect her. They chase the shape-shifter Zam Wessell but she is killed by a poisoned dart before revealing who hired her. The Jedi Council assigns Obi-Wan Kenobi to discover who has tried to kill Amidala and Anakin to protect her in Naboo. Obi-Wan discovers that the dart is from the planet Kamino, and he heads to the remote planet. He finds an army of clones that has been under production for years for the Republic and that the bounty hunter Jango Fett was the matrix for the clones. Meanwhile Anakin and Amidala fall in love with each other, and he has nightmarish visions of his mother. They travel to his home planet, Tatooine, to see his mother, and he discovers that she has been abducted by Tusken Raiders. Anakin finds his mother dying, and he kills all the Tusken tribe, including the women and children. Obi-Wan follows Jango Fett to the planet Geonosis where he discovers who is behind the Separatist movement. He transmits his discoveries to Anakin since he cannot reach the Jedi Council. Who is the leader of the Separatist movement? Will Anakin receive Obi-Wan''s message? And will the secret love between Anakin and Amidala succeed?', null, 6.5, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.222275 +00:00', '2021-06-16 20:14:09.222292 +00:00', '4af6c9c9-0be0-4864-b1e9-7f87dd59ee1f', 'Star Trek', 'On the day of James Kirk''s birth, his father dies on his damaged starship in a last stand against a Romulan mining vessel looking for Ambassador Spock, who in this time, has grown on Vulcan disdained by his neighbors for his half-human heritage. 25 years later, James T. Kirk has grown into a young rebellious troublemaker. Challenged by Captain Christopher Pike to realize his potential in Starfleet, he comes to annoy academy instructors like Commander Spock. Suddenly, there is an emergency on Vulcan and the newly-commissioned USS Enterprise is crewed with promising cadets like Nyota Uhura, Hikaru Sulu, Pavel Chekov and even Kirk himself, thanks to Leonard McCoy''s medical trickery. Together, this crew will have an adventure in the final frontier where the old legend is altered forever as a new version of the legend begins.', null, 7.9, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.222329 +00:00', '2021-06-16 20:14:09.222346 +00:00', '12a8279d-d851-4eb9-9d64-d690455277cc', 'Star Wars: Episode VIII - The Last Jedi', 'Rey develops her newly discovered abilities with the guidance of Luke Skywalker, who is unsettled by the strength of her powers. Meanwhile, the Resistance prepares for battle with the First Order.', null, 777, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.222380 +00:00', '2021-06-16 20:14:09.222397 +00:00', '118fd71b-93cd-4de5-95a4-e1485edad30e', 'Rogue One: A Star Wars Story', 'All looks lost for the Rebellion against the Empire as they learn of the existence of a new super weapon, the Death Star. Once a possible weakness in its construction is uncovered, the Rebel Alliance must set out on a desperate mission to steal the plans for the Death Star. The future of the entire galaxy now rests upon its success.', null, 7.8, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.222433 +00:00', '2021-06-16 20:14:09.222449 +00:00', '6ecc7a32-14a1-4da8-9881-bf81f0f09897', 'Star Trek Into Darkness', 'When the USS Enterprise crew is called back home, they find an unstoppable force of terror from within their own organization has detonated the fleet and everything it stands for, leaving our world in a state of crisis. With a personal score to settle, Captain Kirk leads a manhunt to a war-zone world to capture a one-man weapon of mass destruction. As our space heroes are propelled into an epic chess game of life and death, love will be challenged, friendships will be torn apart, and sacrifices must be made for the only family Kirk has left: his crew.', null, 7.7, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.222485 +00:00', '2021-06-16 20:14:09.222501 +00:00', '46f15353-2add-415d-9782-fa9c5b8083d5', 'Star Wars: Episode IX - The Rise of Skywalker', 'The surviving members of the resistance face the First Order once again, and the legendary conflict between the Jedi and the Sith reaches its peak bringing the Skywalker saga to its end.', null, 6.7, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.225052 +00:00', '2021-06-16 20:14:09.225069 +00:00', 'db5dcded-29da-4c96-91a2-df1407f0a80a', 'Star Trek: The Animated Series', 'This animated series continues the adventures of the USS Enterprise, taking advantage of the visual freedom of animation to present stories with more alien elements.', null, 7.5, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.260697 +00:00', '2021-06-16 20:14:09.260712 +00:00', '5d82d091-154e-4415-8e4f-5c3f4d59bf2d', 'A Star Is Falling Upwards', null, null, 3.3, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.222546 +00:00', '2021-06-16 20:14:09.222562 +00:00', 'fda827f8-d261-4c23-9e9c-e42787580c4d', 'A Star Is Born', 'Jackson Maine (Cooper), a country music star on the brink of decline, discovers a talented unknown named Ally (Germanotta). As the two begin a passionate love affair, Jackson coaxes Ally into the spotlight, catapulting her to stardom. But as Ally''s career quickly eclipses his own, Jack finds it increasingly hard to handle his fading glory.', null, 7.7, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.222606 +00:00', '2021-06-16 20:14:09.222623 +00:00', '57beb3fd-b1c9-4f8a-9c06-2da13f95251c', 'Solo: A Star Wars Story', 'During an adventure into the criminal underworld, Han Solo meets his future co-pilot Chewbacca and encounters Lando Calrissian years before joining the Rebellion.', null, 6.9, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.222657 +00:00', '2021-06-16 20:14:09.222674 +00:00', 'b1f1e8a6-e310-47d9-a93c-6a7b192bac0e', 'Star Trek Beyond', 'After stopping off at Starbase Yorktown, a remote outpost on the fringes of Federation space, the USS Enterprise, halfway into their five-year mission, is destroyed by an unstoppable wave of unknown aliens. With the crew stranded on an unknown planet and with no apparent means of rescue, they find themselves fighting against a ruthless enemy with a well-earned hatred of the Federation and everything it stands for. Only a rebellious alien warrior can help them reunite and leave the planet to stop this deadly menace from beginning a possible galactic war.', null, 7.1, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.222710 +00:00', '2021-06-16 20:14:09.222726 +00:00', '50fb4de9-e4b3-4aca-9f2f-00a48f12f9b3', 'Star Trek: First Contact', 'In the 24th century, the crew of the Enterprise-E has been ordered to patrol the Romulan Neutral Zone by the Federation to avoid interference with their battle against the insidious Borg. Witnessing the loss of the battle, Captain Jean-Luc Picard ignores orders and takes command of the fleet engaging the Borg. But the Borg plan to travel back into the 21st century through a vortex with the intention to stop Earth''s first contact with an alien race (the Vulcans). Following the Borg sphere, Picard and his crew realize that they have taken over the Enterprise in order to carry out their mission. Their only chance to do away with the Borg and their seductive queen is to make sure that Zefram Cochrane makes his famous faster-than-light travel to the stars.', null, 7.6, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.222762 +00:00', '2021-06-16 20:14:09.222779 +00:00', '6e5cd268-8ce4-45f9-87d2-52f0f26edc9e', 'Star Trek II: The Wrath of Khan', 'It is the 23rd century. Admiral James T. Kirk is an instructor at Starfleet Academy and feeling old; the prospect of attending his ship, the USS Enterprise--now a training ship--on a two-week cadet cruise does not make him feel any younger. But the training cruise becomes a deadly serious mission when his nemesis Khan Noonien Singh--infamous conqueror from late 20th century Earth--appears after years of exile. Khan later revealed that the planet Ceti Alpha VI exploded, and shifted the orbit of the fifth planet as a Mars-like haven. He begins capturing Project Genesis, a top secret device holding the power of creation itself, and schemes the utter destruction of Kirk.', null, 7.7, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.222818 +00:00', '2021-06-16 20:14:09.222835 +00:00', 'b1384a92-f7fe-476b-b90b-6cec2b7a0dce', 'Star Trek: The Next Generation', 'Set in the 24th century and decades after the adventures of the original crew of the starship Enterprise, this new series is the long-awaited successor to the original Star Trek (1966). Under the command of Captain Jean-Luc Picard, the all new Enterprise NCC 1701-D travels out to distant planets to seek out new life and to boldly go where no one has gone before.', null, 8.6, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.222870 +00:00', '2021-06-16 20:14:09.222887 +00:00', 'c9e1f6f0-4f1e-4a76-92ee-76c1942faa97', 'Star Trek: Discovery', 'Ten years before Kirk, Spock, and the Enterprise, the USS Discovery discovers new worlds and lifeforms as one Starfleet officer learns to understand all things alien.', null, 7.3, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.222921 +00:00', '2021-06-16 20:14:09.222937 +00:00', 'a7b11817-205f-4e1a-98b5-e3c48b824bc3', 'Star Trek', 'A massive alien spacecraft of enormous power destroys three powerful Klingon cruisers, entering Federation space. Admiral James T. Kirk is ordered to take command of the USS Enterprise for the first time since her historic five-year mission. The Epsilon IX space station alerts the Federation, but they are also destroyed by the alien spacecraft. The only starship in range is the Enterprise--after undergoing a major overhaul at Spacedock on Earth. Kirk rounds up the rest of his crew, and acquires some new members, and sets off to intercept the alien spacecraft. However, it has been there years since Kirk last commanded the Enterprise... is he up to the task of saving Earth?', null, 6.4, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.222973 +00:00', '2021-06-16 20:14:09.222989 +00:00', '1b7d7c64-8be8-47db-8924-23029a9878a9', 'Star Trek IV: The Voyage Home', 'The most acclaimed Star Trek adventure of all time with an important message. It is the 23rd century, and a mysterious alien probe is threatening Earth by evaporating the oceans and destroying the atmosphere. In their frantic attempt to save mankind, Admiral Kirk and his crew must time travel back to 1986 San Francisco where they find a world of punk, pizza and exact-change buses that are as alien to them as anything they have ever encountered in the far-off reaches of the galaxy. William Shatner and Leonard Nimoy return as Kirk and Spock, along with the entire Star Trek crew.', null, 7.3, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.223028 +00:00', '2021-06-16 20:14:09.223044 +00:00', '98167b6e-8d41-4378-9fc3-ee998677e6cb', 'Star Trek: Generations', 'In the late 23rd century, the gala maiden voyage of the newly-christened Enterprise-B boasts such luminaries as Pavel Chekov, Montgomery Scott and the legendary Captain James T. Kirk as guests. But her maiden voyage turns into a disaster as the unprepared starship is forced to rescue two transport ships from a mysterious energy ribbon. The Enterprise manages to save a handful of the ships'' passengers and barely succeeds out intact... but at the cost of Captain Kirk''s life. 78 years later, Captain Jean-Luc Picard and the Enterprise-D crew find themselves at odds with renegade scientist Dr. Tolian Soran... who is destroying entire star systems. Only one man can help Picard stop Soran''s scheme... and he has been dead for 78 years.', null, 6.6, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.223080 +00:00', '2021-06-16 20:14:09.223097 +00:00', '37c6cd37-1222-4470-9221-3170367d134b', 'Star Trek III: The Search for Spock', 'In the wake of Spock''s ultimate deed of sacrifice, Admiral Kirk and the Enterprise crew return to Earth for some essential repairs to their ship. When they arrive at Spacedock, they are shocked to discover that the Enterprise is to be decommissioned. Even worse, Dr. McCoy begins acting strangely and Scotty has been reassigned to another ship. Kirk is forced to steal back the Enterprise and head across space to the Genesis Planet to save Spock and bring him to Vulcan. Unknown to them, the Klingons are planning to steal the secrets of the Genesis Device for their own deadly purpose.', null, 6.7, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.223132 +00:00', '2021-06-16 20:14:09.223149 +00:00', '50d842be-bcda-401e-90de-b06929611ce0', 'Star Trek: Nemesis', 'After a joyous wedding between William Riker and Deanna Troi, Captain Picard and the Enterprise crew stumble upon a mysterious signal which results in it being a prototype android who is the twin to Data. Then the Enterprise is invited to Romulus to negotiate peace with the Romulans by their new Praetor named Shinzon. However, Shinzon is revealed to be a clone of Picard who was raised on Remus, a slave planet to the Romulans. Later on, Picard discovers that this peace treaty was nothing more than a set-up due to the fact that Shinzon needs Picard in order to survive. But little do the Enterprise crew know that Shinzon also plans to do away with the Federation by unleashing a weapon that could destroy a whole planet.', null, 6.4, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.229259 +00:00', '2021-06-16 20:14:09.229275 +00:00', '4b6977e2-b3db-4f04-b83e-f091c6fcd49c', 'Brightest Star', 'After the heartbreaking end of his first love, a recent college graduate sets out to win back the girl of his dreams only to discover a greater journey awaits him.', null, 5.1, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.256487 +00:00', '2021-06-16 20:14:09.256503 +00:00', '31231ab7-f5ab-4d7c-a10c-1448371380ea', 'Rhinoskin: The Making of a Movie Star', null, null, 8.2, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.223185 +00:00', '2021-06-16 20:14:09.223201 +00:00', '2bfc0f50-7a88-4d4c-bbf8-f839c6150e7e', 'Star Trek: The Original Series', 'The adventures of the USS Enterprise, representing the United Federation of Planets on a five-year mission in outer space to explore new worlds, seek new life and new civilizations, and to boldly go where no one has gone before. The Enterprise is commanded by handsome and brash Captain James T. Kirk. His First Officer and best friend is Mr. Spock from the planet Vulcan, and Kirk''s Medical Officer is Dr. Leonard "Bones" McCoy. With a crew of approximately 430, the Enterprise battles aliens, megalomaniacal computers, time paradoxes, psychotic murderers, and even Khan!', null, 8.3, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.223239 +00:00', '2021-06-16 20:14:09.223256 +00:00', '9d284e83-21f0-4073-aac0-4abee51193d8', 'Star Trek: Insurrection', 'While on a mission to observe the peaceful Ba''ku race, Lt. Commander Data suddenly behaves as if having to fear for his existence. The immortal Ba''ku, whose planet offers regenerative radiation and therefore incredible lifespans, live in harmony with nature and reject advanced technology. Their planet and their culture is secretly researched by the Federation associated with an alien race called the Son''a. But the Son''a intend to abduct the Ba''ku in order to take the planet for themselves and for the Starfleet officials who all would like to regenerate their bodies. But they did not think of the loyalty of Captain Jean-Luc Picard and the crew of the Enterprise-E to the Prime Directive.', null, 6.4, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.223292 +00:00', '2021-06-16 20:14:09.223308 +00:00', '511b8ae8-f59d-450e-b9a2-22aabba2693b', 'Star Trek VI: The Undiscovered Country', 'After an explosion on their moon, the Klingons have an estimated 50 years before their ozone layer is completely depleted, and they all die. They have only one choice - to make peace with the Federation, which will mean an end to 70 years of conflict. Captain James T. Kirk and crew are called upon to help in the negotiations because of their experience with the Klingons. Peace talks don''t quite proceed, and Kirk and McCoy are convicted of assassinating the Klingon High Chancellor, and imprisoned on Rura Penthe, a snowy hard-labor prison camp. Will they manage to escape? And will there ever be peace with the Klingons?', null, 7.2, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.223343 +00:00', '2021-06-16 20:14:09.223360 +00:00', 'de5347cf-a70d-430f-8005-786326e28794', 'Star Trek: Voyager', 'The Federation starship USS Voyager, chasing a band of Maquis rebels, enters the dangerous space nebula known as the Badlands. Both ships are transported by a distant space probe to the Delta Quadrant, 75,000 light-years from Federation space. Voyager''s crew and the Maquis form an uneasy truce to rescue crewmen of both ships, kidnapped by the probe''s builder, the powerful, dying Caretaker. The Maquis ship is destroyed in a battle with the warlike Kazons. To prevent a Kazon aggression against a helpless world, Voyager destroys the space probe. Without the probe, it will take 75 years for Voyager to travel back to Federation space. With the differences between them rendered meaningless by time and distance, The Federation and Maquis crews unite aboard Voyager. Together, they embark on their new mission: to boldly go - home.', null, 7.8, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.223396 +00:00', '2021-06-16 20:14:09.223412 +00:00', '82297925-80cc-4c47-b6cf-6b5e06e23b70', 'Star Trek V: The Final Frontier', 'When the newly-christened starship Enterprise''s shakedown cruise goes poorly, Captain Kirk and crew put her into Spacedock for repairs. But an urgent mission interrupts their Earth-bound shore leave. A renegade Vulcan named Sybok has taken three ambassadors hostage on Nimbus III, the Planet of Galactic Peace. This event also attracts the attention of a Klingon captain who wants to make a name for himself and sets out to pursue the Enterprise. Sybok''s ragtag army captures the Enterprise and takes her on a journey to the center of the galaxy in search of the Supreme Being.', null, 5.5, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.223448 +00:00', '2021-06-16 20:14:09.223464 +00:00', '8cc3c3aa-e531-4eeb-a707-08119024b3ea', 'Star Wars: The Clone Wars', 'As the Clone Wars sweep through the galaxy, the heroic Jedi Knights struggle to maintain order and restore peace. More and more systems are falling prey to the forces of the dark side as the Galactic Republic slips further and further under the sway of the Separatists and their never-ending droid army. Anakin Skywalker and his Padawan learner Ahsoka Tano find themselves on a mission with far-reaching consequences, one that brings them face-to-face with crime lord Jabba the Hutt. But Count Dooku and his sinister agents, including the nefarious Asajj Ventress, will stop at nothing to ensure that Anakin and Ahsoka fail at their quest. Meanwhile, on the front lines of the Clone Wars, Obi-Wan Kenobi and Master Yoda lead the massive clone army in a valiant effort to resist the forces of the dark side ...', null, 5.9, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.223504 +00:00', '2021-06-16 20:14:09.223520 +00:00', 'b503ced6-fff1-493a-ad41-73449b55ffee', 'Star Wars: The Clone Wars', 'Jedi Knights lead the Grand Army of the Republic against the droid army of the Separatists.', null, 8.2, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.223554 +00:00', '2021-06-16 20:14:09.223571 +00:00', 'a144d250-6667-47e4-94bd-0ee59c0dc05f', 'Star Trek: Deep Space Nine', 'The stable wormhole discovered by the Deep Space Nine crew is known to the Bajoran people as the Celestial Temple of their Prophets. Sisko, as discoverer of the wormhole and its inhabitants, is therefore the Emissary of Bajoran prophesy. The wormhole''s other end is in the Gamma Quadrant, halfway around the galaxy from Bajor. That section of space is dominated by the malevolent Dominion. The Dominion is led by the Changelings, the race of shapeshifters to which Odo belongs. As of the beginning of the sixth season, Cardassia has joined the Dominion, and together they are waging war on the Federation and their Klingon allies. The war is quickly becoming the most costly war ever for the Federation, and the Deep Space Nine crew must fight to protect their way of life.', null, 7.9, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.223606 +00:00', '2021-06-16 20:14:09.223623 +00:00', '47050db6-580f-493c-a007-a11c8768ce1b', 'Star Trek: Enterprise', 'The year is 2151. Earth has spent the last 88 years since learning how to travel faster than the speed of light studying under the wisdom of their alien ally called the ''Vulcans''. Now, the first crew of human explorers sets out into deep space on a ship called the ''Enterprise'' to see what is beyond our solar system.', null, 7.5, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.223658 +00:00', '2021-06-16 20:14:09.223674 +00:00', '496f504e-20fa-4dfd-b4cb-c7c4ef636e07', 'Rock Star', 'Chris Cole was born to rock. His longtime girlfriend Emily believes his talent could take him all the way - but Chris worships at the altar of Bobby Beers, the fiery frontman for heavy metal legends Steel Dragon. By day, Chris still lives at home with his parents and spends his days repairing copy machines. But when Chris takes the stage, fronting Pennsylvania''s premiere Steel Dragon tribute band, all of that disappears. Chris Cole is Bobby Beers - mesmerizing audiences with his perfect imitation of Beers'' electrifying vocals. The night his bandmates boot him out of the group, Chris is devastated - until an unexpected phone call changes his life forever: He, Chris Cole, has been tapped to replace Bobby Beers as the lead singer of Steel Dragon. In an instant, Chris rockets to the dizzying heights of sudden stardom, rising from devotee to icon, from rock fan to rock god - the wanna-be who got to be. So what happens when an average guy gets everything he wants - and discovers it''s not enough?', null, 6.3, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.223710 +00:00', '2021-06-16 20:14:09.223726 +00:00', 'cc397479-a5f8-488f-bd7f-7fbb94ec6e18', 'Star Trek: Picard', 'Follow-up series to Star Trek: The Next Generation (1987) and Star Trek: Nemesis (2002) that centers on Jean-Luc Picard (Sir Patrick Stewart) in the next chapter of his life.', null, 7.7, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.231669 +00:00', '2021-06-16 20:14:09.231686 +00:00', '991d143e-1342-4f7c-abf0-a9ede3abba20', 'Star Wars: The Force Unleashed - Ultimate Sith Edition', 'Casts players as Darth Vader''s "Secret Apprentice," unveiling new revelations about the Star Wars galaxy seen through the eyes of a mysterious new character armed with unprecedented powers.', null, 8.1, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.223760 +00:00', '2021-06-16 20:14:09.223776 +00:00', 'bfe61bd9-5dfd-41ca-80ae-8eca998bc29d', 'Lone Star', 'John Sayles'' murder-mystery explores interpersonal and interracial tensions in Rio County, Texas. Sam Deeds is the local sheriff who is called to investigate a 40-year-old skeleton found in the desert....As Sam delves deeper into the town''s dark secrets, he begins to learn more about his father, the legendary former sheriff Buddy Deeds, who replaced the corrupt Charlie Wade. While Sam puzzles out the long-past events surrounding the mystery corpse, he also longs to rekindle a romance with his old high-school flame. Sayles'' complex characters are brought together as the tightly woven plot finally draws to its dramatic close.', null, 7.4, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.223819 +00:00', '2021-06-16 20:14:09.223835 +00:00', 'a9d52337-3249-49ae-92b8-65ee9ebaf359', 'Star Wars Rebels', 'An animated TV series set between the events of Episode III and IV, Star Wars Rebels takes place in a time where the Empire is securing its grip on the galaxy and hunting down the last of the Jedi Knights as a fledgling rebellion against the Empire is taking shape.', null, 8, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.223869 +00:00', '2021-06-16 20:14:09.223885 +00:00', '319df05f-c5d9-4389-a84a-a43e695bf048', 'Bright Star', 'It''s 1818 in Hampstead Village on the outskirts of London. Poet Charles Brown lives in one half of a house, the Dilkes family who live in the other half. Through their association with the Dilkes, the fatherless Brawne family know Mr. Brown. The Brawne''s eldest daughter, Fanny Brawne, and Mr. Brown don''t like each other. She thinks he''s arrogant and rude, and he feels that she is pretentious, knowing only how to sew (admittedly well as she makes all her own fashionable clothes), flirt and give opinions on subjects about which she knows nothing. Insecure struggling poet John Keats comes to live with his friend, Mr. Brown. Miss Brawne and Mr. Keats have a mutual attraction to each other, a relationship which however is slow to develop in part since Mr. Brown does whatever he can to keep the two apart. But other obstacles face the couple, including their eventual overwhelming passion for each other clouding their view of what the other does, Mr. Keats'' struggling career which offers him little in the way of monetary security (which will lead to Mrs. Brawne not giving consent for them to marry), and health issues which had earlier taken the life of Mr. Keats'' brother, Tom.', null, 6.9, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.223921 +00:00', '2021-06-16 20:14:09.223938 +00:00', 'fdfc8266-5ece-4d85-b614-3cfe9be97b71', 'Star Wars: Clone Wars', 'Immediately after the events of Star Wars: Episode II - Attack of the Clones (2002), the Clone Wars continue. The Separatists launch masses of Battle Droids while the Republic has an entire arsenal of Clone Troopers to blow them away. Obi-Wan Kenobi and his apprentice Anakin Skywalker are also participating in the fights against Count Dooku and his defiant separatists. Jedi Masters Yoda and Mace Windu, take part in the battle as well. While down on Coruscant, Padm√© Amidala, Chancellor Palpatine, C-3PO and R2-D2 hope nothing but good for our heroes. Will the Republic emerge triumphant? Will Dooku and his separatists be brought to their knees? And will Anakin truly bring balance to the Force, or will he bring absolutely tyranny?', null, 7.8, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.223975 +00:00', '2021-06-16 20:14:09.223991 +00:00', '856bc547-0bae-4de5-8bcc-6d3f9e92d3eb', 'Dark Star', 'Low-budget story of four astronauts in deep space, whose mission is to destroy unstable planets in star systems which are to be colonised. The late Commander Powell is stored in deep freeze, where he is still able to offer advice. As their mission nears completion, they must cope with a runaway alien which resembles a beach-ball, faulty computer systems, and a "smart bomb" who thinks it is God.', null, 6.3, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.224026 +00:00', '2021-06-16 20:14:09.224043 +00:00', 'd38c5a13-860e-478b-a645-e09d5d727244', 'Star-Crossed', 'What starts out as a star crossed lovers story gradually changes focus to explore moral conflicts with integration and racism Both humans and aliens feel like they are the superior race so they fight each other to try to achieve the most power. The seven aliens and their families help each other out and take great risks to ensure their survival.', null, 7.3, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.224078 +00:00', '2021-06-16 20:14:09.224094 +00:00', 'ddbc2fc3-389e-419f-a8fa-59e6cee10802', 'A Star Is Born', 'Norman Maine, a movie star whose career is on the wane, meets showgirl Esther Blodgett when he drunkenly stumbles into her act one night. A friendship develops, then blossoms into romance before tensions increase as Esther''s career takes off while Norman''s continues to plummet.', null, 7.6, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.224128 +00:00', '2021-06-16 20:14:09.224145 +00:00', '192b3fc9-97e2-4260-91c6-a9b91a41e520', 'Dickie Roberts: Former Child Star', 'Once, he was on top of the world as a popular child actor on TV. Now, he''s Hollywood''s punchline about everything wrong with people who were famous as children. All Dickie Roberts wants to do is find that one gig that will restore his honor and everyone''s love of him, so after learning that Rob Reiner''s making an ambitious new movie destined to sweep the Oscars, Dickie''s first in line to audition. He walks out having learned he certainly looks the part but can''t act it... yet, owing to his very unusual childhood. To research the role, Dickie embarks on a bizarre scheme to live with a suburban family to see how the average American child lives, having them put him up as their "son". But once his gloves are off, Dickie discovers how great it is to be part of a true family, and whether he gets the part or not, his attempt at method acting will certainly change his life forever.', null, 5.5, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.224182 +00:00', '2021-06-16 20:14:09.224198 +00:00', '9c7dc26a-489d-4c08-9bba-6ae9dc8117f1', 'All-Star Superman', 'While saving the crew of the first manned mission to the sun, Superman is poisoned by solar radiation. Dying, he decides to fulfill his lifelong dreams, while still saving the Earth from various threats. But when Lex Luthor reveals his latest plot to control the world, Superman must use his remaining strength to stop him.', null, 7, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.224233 +00:00', '2021-06-16 20:14:09.224249 +00:00', '134989c3-3b20-4ae7-8092-3e8ad2333d59', 'The Star Wars Holiday Special', 'It is Life Day, a holiday that is celebrated on Chewbacca''s home planet Kashyyyk. Chewie and Han Solo are trying to get to the planet where Chewie''s family is waiting for him, but the Empire is out searching for the Rebels, giving everyone a hard time. While we are waiting we get a look at the everyday life of a Wookiee family. We meet all the familiar characters from Star Wars: Episode IV - A New Hope (1977) and we are introduced to Boba Fett during a short cartoon. We also pay a visit to the Cantina and meet all the monsters again.', null, 2.1, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.225103 +00:00', '2021-06-16 20:14:09.225119 +00:00', '78efe505-6ef8-41f7-88ef-15840be2e680', 'Star 80', 'Paul Snider is a narcissistic, small time hustler who fancies himself a ladies man. His life changes when he meets Dorothy Stratten working behind the counter of a Dairy Queen. Dorothy is a pretty but naive high school senior. Paul immediately falls for Dorothy, who sees in Paul a wise, worldly person unlike herself. Paul believes Dorothy is Playboy material, the magazine he sees as only a springboard to bigger and better things. Paul''s dream does become a reality: not only does Dorothy eventually marry him, she becomes the August 1979 Playboy Playmate and ultimately Playboy Playmate of 1979, which does indeed lead to the start of an acting career. As Dorothy''s star rises, Paul''s life is one of a hanger-on as those in Dorothy''s new circle, including Playboy publisher Hugh M. Hefner and movie director Aram Nicholas, don''t much like Paul. Paul is unable to eke out a life of his own without using Dorothy''s name, which she increasingly is reluctant to provide to her husband. Those that know the couple know their relationship cannot continue as is, and it''s only a matter of how it will change or end is the question.', null, 6.7, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.259415 +00:00', '2021-06-16 20:14:09.259430 +00:00', '01ab9e34-4ceb-4337-bb69-68a1b0de46b2', 'Axl Rose: The Prettiest Star', 'A biography of Axl Rose.', null, 6.9, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.224288 +00:00', '2021-06-16 20:14:09.224304 +00:00', '935e418d-09f3-4de4-8ce3-c31f31580b12', 'Bucky Larson: Born to Be a Star', 'Living in small town Iowa, Bucky Larson is a simple minded, uneducated, beaver toothed young man still living with his protective parents, Jeremiah and Debbie Larson. Initially saddened when he is fired from his job as a bagger at a supermarket, he eventually sees it as a sign that he is destined for greatness in some other field. Based on some information he learns, Bucky believes that destiny is to become a porn star, despite he being a virgin and only having recently learned what masturbation is. With his parents'' blessing, Bucky hops on a bus to Los Angeles to make it big there as a porn star. He is taken under the wings of a few people in LA. On the professional side, he meets the reigning king of porn, Dick Shadow, who only sees in Bucky a laughing stock. But washed up porn director Miles Deep stumbles across what he sees as an untapped niche market for Bucky''s limited talents. Miles has the challenge of trying to convince investors who only see in Bucky the antithesis of porn. On the personal side, Bucky befriends a young diner waitress Kathy McGee, who helps Bucky find a place to live - albeit with an insensitive oaf named Gary who only wants to get into Kathy''s pants - and navigate general life in the big city. Kathy, however, is facing her own demons in working toward her destiny, those demons which Bucky hopes he can help her beat down.', null, 3.2, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.224342 +00:00', '2021-06-16 20:14:09.224358 +00:00', '1145f9ee-5344-4e57-81d0-5b085f3d0808', 'Tin Star', 'Ex undercover UK cop turned police chief of a small town in the Canadian Rockies does what he must to defend his family from those in power whether it''s the oilmen, the preachers or the gangsters.', null, 7.3, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.224392 +00:00', '2021-06-16 20:14:09.224408 +00:00', 'ea434935-cb62-4012-9138-be74435890cd', 'Star vs. the Forces of Evil', 'An interdimensional princess, from the kingdom of Mewni, named Star Butterfly is sent to a new dimension, the Earth dimension, to learn how to use her newest possession, the royal family wand, and she finds help along the way meeting an Earth boy named Marco Diaz, and she lives with Marco and his parents causing all kinds of interdimensional mischief.', null, 8, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.224443 +00:00', '2021-06-16 20:14:09.224459 +00:00', 'da7941cf-3be4-4f0b-a27e-649f18b4e8e9', 'A Star Is Born', 'Talented rock star John Norman Howard has seen his career begin to decline. Too many years of concerts and managers and life on the road have made him cynical and the monotony has taken its toll. Then he meets the innocent, pure and very talented singer Esther Hoffman. As one of his songs in the movie says "I''m gonna take you girl, I''m gonna show you how." And he does. He shows Esther the way to stardom while forsaking his own career. As they fall in love, her success only makes his decline even more apparent.', null, 6.2, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.224494 +00:00', '2021-06-16 20:14:09.224511 +00:00', '045f2518-5c38-48df-9c48-639520ab57af', 'A Star Is Born', 'Esther Blodgett is just another starry-eyed farm kid trying to break into the movies. Waitressing at a Hollywood party, she catches the eye of alcoholic star Norman Maine, is given a test, and is caught up in the Hollywood glamor machine (ruthlessly satirized). She and her idol Norman marry; but his career abruptly dwindles to nothing', null, 7.3, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.224546 +00:00', '2021-06-16 20:14:09.224562 +00:00', 'c20959d2-daca-4cb2-a104-e1ab63479da3', 'Voices of a Distant Star', 'The story of the high school students Mikako Nagamine and Noboru Terao. When the alien Tarsians attack, Mikako volunteers to be a pilot in the space force that will protect mankind. The lovers try to remain in contact using cellular telephone text messages, but as each battle takes Mikako further from the Earth, each message takes longer to arrive. Will their love stand the tests of time and distance?', null, 7.2, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.224597 +00:00', '2021-06-16 20:14:09.224613 +00:00', 'd77e45fc-2b84-442f-b652-caf31cb07c80', 'Robot Chicken: Star Wars', 'The first of three Star Wars themed Robot Chicken parodies.', null, 8.1, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.224647 +00:00', '2021-06-16 20:14:09.224664 +00:00', '5a5603b2-afb5-42f5-8235-bb75b2cd9edd', 'My Love from Another Star', 'Do Min-Joon, an alien that came to our planet 400 years ago, will be able to return to his planet in 3 months, but when he meets famous actress Chun Song-Yi, all the centuries he spent distancing himself from humans come to an end.', null, 8.3, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.224697 +00:00', '2021-06-16 20:14:09.224714 +00:00', '1eb9cc6b-879f-4160-8971-918ecbe47a87', 'Star', 'The Driver now carries an arrogant rock star who is visiting a major city (not Pittsburgh as earlier believed). Played by Madonna, this title character wants to get away from her bodyguards in the Driver''s BMW. He soon gets tired of her and decides to have a bit of fun.', null, 7.7, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.224748 +00:00', '2021-06-16 20:14:09.224764 +00:00', '96c5ff26-b615-408a-a144-137664907c48', 'Wish Upon a Star', 'Handsome, considerate high-school jock Kyle Harding is the only taste the Wheaton sisters share. Tall, fashionable, popular airhead big sister is dating him, but fails to truly appreciate the young gentleman, let alone contemplate a serious relationship. Nerdy kid sister Haley hates the waste and expresses her envy by thoughtlessly wishing at a ''shooting star'' (comet) to be Alexia. To their stupor, that happens the next morning. Forced to live each-other''s lives, but unable to do it well by the other''s standards, the sisters soon hate each-other even more and deliberately screw up. Gradually, they realize they would only both lose out, learn to appreciate the other''s values and reconsider their own. Remain the matters of obviously utterly confused Kyle, and new neighbor boy Simon, whose no longer secret crush on Haley was confounded by Alexia.', null, 6.7, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.224800 +00:00', '2021-06-16 20:14:09.224816 +00:00', 'e2db51c4-096c-44fd-bdf7-cbaa4052d808', 'Third Star', 'James and his three closest lifelong friends go on an ill-advised trip to the stunning coastal area of Barafundle Bay in West Wales. What follows is a touching and comical adventure dealing with friendship, heroism and love.', null, 7.5, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.224850 +00:00', '2021-06-16 20:14:09.224866 +00:00', 'b74a0e51-293b-4b76-9a96-0f5af7dc2030', 'The Star Chamber', 'Disgusted with criminals escaping the judicial system via technicalities, an idealistic young judge investigates an alternative method for punishing the guilty.', null, 6.3, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.224899 +00:00', '2021-06-16 20:14:09.224916 +00:00', '996262ef-e565-426a-a25e-c6863eff474d', 'The Star', 'In Sony Pictures Animation''s THE STAR, a small but brave donkey named Bo yearns for a life beyond his daily grind at the village mill. One day he finds the courage to break free, and finally goes on the adventure of his dreams. On his journey, he teams up with Ruth, a lovable sheep who has lost her flock and Dave, a dove with lofty aspirations. Along with three wisecracking camels and some eccentric stable animals, Bo and his new friends follow the Star and become accidental heroes in the greatest story ever told - the first Christmas.', null, 6.2, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.224950 +00:00', '2021-06-16 20:14:09.224967 +00:00', '894b0d4a-291c-4a9d-8d39-8fe856ee237c', 'Fist of the North Star', 'After a nuclear holocaust tears the world apart, mankind is forced to the harshness of not only the oppression of others who are much more powerful, but the dead earth which seems to be getting worse with every passing moment. But a savior has risen from the ashes, a man who will defeat those who would torment the weak and make the world a livable place once more. A man named Kenshiro.....', null, 7.3, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.225001 +00:00', '2021-06-16 20:14:09.225017 +00:00', '58fd971d-4550-4164-8428-06f9a19f93cc', 'Star Wreck: In the Pirkinning', 'The future looks bleak for Captain Pirk. Originally from the far future, he traveled back to save the world, but was shipwrecked on the 21st century. The world of the past is a dangerous place and he is finding it difficult to convince the ladies he is, in fact, an intergalactic space hero from the future. To make things right Pirk comes up with a questionable plan to save mankind''s future...', null, 6.6, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.259462 +00:00', '2021-06-16 20:14:09.259478 +00:00', '075587eb-91c1-4629-adcb-67c516cdb6eb', 'Star Trek: A New Vision', 'A look at the process behind bringing the Star Trek characters back to life.', null, 6.8, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.225155 +00:00', '2021-06-16 20:14:09.225171 +00:00', '2a090dde-f688-46fe-a9f4-b781a985275e', 'Star Wars: Knights of the Old Republic', 'Four thousand years before the fall of the Republic, before the fall of the Jedi, a great war was fought, between the armies of the Sith and the forces of the Republic. A warrior is chosen to rescue a Jedi with a power important to the cause of the Republic, but in the end, will the warrior fight for the Light Side of the Force, or succumb to the Darkness?', null, 9.6, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.225209 +00:00', '2021-06-16 20:14:09.225226 +00:00', '7159c8c2-b9a4-410a-965b-1096b8d1e614', 'The Star Maker', '"Dottore" Joe Moretti travels round Sicily doing screen tests for the big Roman studios. He''s a conman and takes money or favours for his efforts. Beata, a young illiterate convent girl desperately wants to change her life and falls for him, belatedly he realises his feelings for her. Their love affair is doomed when he''s arrested.', null, 7.4, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.225260 +00:00', '2021-06-16 20:14:09.225277 +00:00', '523f1a55-51fe-4d3c-a58d-30d8a61bb267', 'The Sun Is Also a Star', 'A hopeless romantic ambivalent about his future in medical school falls for a hard-luck young woman who doesn''t believe in love.', null, 5.8, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.225310 +00:00', '2021-06-16 20:14:09.225327 +00:00', '8a96580a-6b7b-422e-b4fb-694eaa269ff7', 'The Tin Star', 'Veteran bounty-hunter Morg Hickman rides into a town in danger. The sheriff has been killed, and young inexperienced Ben Owens named a temporary replacement until a permanent can be found. Ben wants to be that permanent replacement, so needs to impress the townspeople with his skill. When he finds that Morg was a sheriff for a long time before he became a bounty-hunter, he asks the older man to teach him. Morg thinks that being a sheriff is a foolish goal, but agrees to instruct Ben in handling people, more important to a sheriff than handling a gun.', null, 7.4, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.225362 +00:00', '2021-06-16 20:14:09.225378 +00:00', 'd1099968-805e-4a2b-a2ec-18bbde1201ac', 'Robot Chicken: Star Wars Episode II', 'The second of three Star Wars themed Robot Chicken parodies.', null, 8.1, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.225412 +00:00', '2021-06-16 20:14:09.225428 +00:00', '3cb639db-cd8a-48b0-90e3-9def109a4492', 'Star Wars: The Force Unleashed', 'Darth Vader''s secret apprentice, codenamed Starkiller, is trained in the Dark Side to defeat the enemies of the Empire, but must find his own path when his master betrays him.', null, 8.2, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.225462 +00:00', '2021-06-16 20:14:09.225478 +00:00', 'cc75c41e-c4b4-4544-b70a-2b59f7013744', 'Fullmetal Alchemist: The Sacred Star of Milos', 'In the lost holy land of Milos, the Elrics search for the truth behind an unknown form of alchemy. What secrets are hidden in Milos? Riddles must be solved and dangers faced before the truth can be found.', null, 7, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.225511 +00:00', '2021-06-16 20:14:09.225528 +00:00', 'f061235e-779f-4a59-9eaa-fc533c3c0584', 'Star Wars: Battlefront II', 'You play as a member of the Clone 501st Legion, the most elite clone trooper attack group, also known as Vader''s Fist, and led by Anakin Skywalker/Darth Vader, over the course of the start, the middle, and the end of the Clone Wars, Operation Knightfall, and the key battles of the Galactic Civil War.', null, 8.8, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.225562 +00:00', '2021-06-16 20:14:09.225579 +00:00', '830857b7-64d2-4a95-98c4-b03351daff52', 'Robot Chicken: Star Wars III', 'The Emmy Award-winning Robot Chicken returns with its third send-up of the Star Wars universe! In this all-new hour-long special, four very different characters -- Emperor Palpatine, Darth Vader, Boba Fett and Gary the Stormtrooper -- reveal untold stories that weave and interconnect throughout all six Star Wars films! Set phasers to "fun"! Oh wait, that''s the wrong franchise.', null, 8.1, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.225613 +00:00', '2021-06-16 20:14:09.225630 +00:00', '5c4ed86e-021e-44ef-b899-5db849ed343f', '9-1-1: Lone Star', 'A New York firefighter relocates to Austin, Texas with his son, where he works to save people''s lives while trying to solve his own personal problems.', null, 6.3, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.225664 +00:00', '2021-06-16 20:14:09.225680 +00:00', 'fbe9f7b7-6e83-4ecb-8ddf-f15a505c07e2', 'The Evening Star', 'Continuing the story of Aurora Greenway in her latter years. After the death of her daughter, Aurora struggled to keep her family together, but has one grandson in jail, a rebellious granddaughter, and another grandson living just above the poverty line.', null, 5.9, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.225713 +00:00', '2021-06-16 20:14:09.225730 +00:00', '0236282f-8ea5-418e-ab9b-13662a4688a9', 'Buzz Lightyear of Star Command: The Adventure Begins', 'After a successful mission in which his partner, Warp Darkmatter, fell in battle, Buzz Lightyear vows never to put another partner at risk and works solo. This vow, however is challenged by Star Command who assigns young Mira Nova to be Warp''s replacement over Buzz''s objections. In addition, the LGMs suggest he tries a new robot for an assistant while a lowly janitor, Booster, has his dreams of joining the Space Rangers. Together, this group of disparate heroes find they must work together to save the galaxy when Emporer Zurg hatches his grandest scheme for conquest yet.', null, 6.2, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.225768 +00:00', '2021-06-16 20:14:09.225785 +00:00', 'dc2dbf5d-de5d-4153-a049-51ba44f15e04', 'Empire of Dreams: The Story of the ''Star Wars'' Trilogy', 'This documentary chronicles the making of the original Star Wars trilogy from start to finish. We get some background on George Lucas'' start in the business and then continue with the making of Star Wars (1977), Star Wars: Episode V - The Empire Strikes Back (1980) and Star Wars: Episode VI - Return of the Jedi (1983). The visual/special effects and financial problems are explained as well as casting, editing, scoring and releasing the films with tons of archival footage and interviews with plenty of cast & crew members.', null, 8.3, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.225820 +00:00', '2021-06-16 20:14:09.225837 +00:00', '68e9a139-976d-4a83-ad1b-e374376814c9', 'Star', 'A trio of women form a musical group in Atlanta.', null, 6.6, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.225871 +00:00', '2021-06-16 20:14:09.225887 +00:00', 'e5a21648-59b1-4672-ac3b-867bcd64b6ea', 'Star Wars Jedi: Fallen Order', 'Set shortly after Revenge of the Sith, the player takes on the role of a Jedi padawan being hunted by the Empire after Order 66.', null, 8.8, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.225921 +00:00', '2021-06-16 20:14:09.225937 +00:00', '5065b37b-fd5b-4c48-8a24-435198c44830', 'Star Wars Resistance', 'Kazuda Xiono, a young pilot for the Resistance, is tasked with a top secret mission to investigate the First Order, a growing threat in the galaxy.', null, 4.9, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.225970 +00:00', '2021-06-16 20:14:09.225987 +00:00', '77bff1a8-f6e2-4a6c-b555-b5d44c34c0dd', 'Star Trek: Renegades', 'When a seemingly unstoppable new enemy threatens the very existence of the Earth, Admiral Pavel Chekov (Walter Koenig) is forced to work outside the boundaries of Starfleet''s rules to combat this deadly new foe. When planet after planet winks out of existence, yet Starfleet refuses to act, Chekov turns to Commander Tuvok (Tim Russ, who also directs), the new head of Starfleet''s covert operations division, Section 31. Together, they assemble a new elite strike-force, consisting of rogues, outcasts and criminals, led by the fearless yet haunted Lexxa Singh (Adrienne Wilkinson). The Renegades'' mission is simple: take on an army and stop their leader, Borrada (Bruce Young), from destroying the Earth. Outnumbered and out-gunned, the ragtag crew is in an adrenaline-pumping race against time and space. But they soon find their foes are the least of their concerns: the real trouble may be coming from within!', null, 4.9, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.226023 +00:00', '2021-06-16 20:14:09.226039 +00:00', '40f515ab-e69e-481c-aac3-ebf3b3833253', 'Star Wars: Knights of the Old Republic II - The Sith Lords', 'Five years after the defeat of Darth Malak, the Sith Lords have nearly destroyed the Jedi Order. An exiled Jedi has returned only to find the galaxy in shambles, and must decide whether to follow the path of the Dark Side and participate in the destruction of the Jedi Order or the Light Side and restore the Jedis to glory.', null, 8.9, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.231719 +00:00', '2021-06-16 20:14:09.231735 +00:00', '9b70da60-15c9-4f05-ae3a-ec07bf7cfb0d', 'Look for a Star', 'Inspired by the relationship between Stanly Ho and his fourth wife, Angela, it''s a romantic comedy about a billonaire who falls in love with a feisty casino dealer. Rated PG', null, 5.6, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.237370 +00:00', '2021-06-16 20:14:09.237387 +00:00', '8f6cf1a6-7a5c-43fd-864a-93e80d91054a', 'Star Boys', 'Two Finnish boys battle adolescence and family troubles. Meanwhile, their homes are being encroached upon by inevitable urban development.', null, 5.7, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.226074 +00:00', '2021-06-16 20:14:09.226090 +00:00', 'acaa9ff8-b261-4ff4-b194-a99fd7669542', 'Outlaw Star', 'Gene Starwind dreams of a life as an Outlaw, and fate smiles on him as he seems to suddenly wind up with a great job. But things go awry, and he finds himself the new owner of the fastest, most technologically advanced space ship in the galaxy. Unfortunately, it''s stolen and the owners want it back Along with his partner Jim and the lovely Melfina, Gene must fight his way across the galaxy battling pirates, aliens and assassins as he attempts to discover the secrets of the Outlaw star.', null, 7.9, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.226126 +00:00', '2021-06-16 20:14:09.226142 +00:00', 'e42d300d-d671-4877-aa3f-d7fb1ced52ad', 'The Star', 'Middle-aged Oscar winning actress Margaret Elliot - Maggie to those that know her - is a Hollywood has-been. Her life is in shambles. She clings to the hope of resurrecting her past movie stardom as a leading ing√©nue. No one will hire her, she''s penniless with creditors selling off anything that she owns that is of monetary value, and she has no one to turn to that can see her through financially. She has in the past supported her sister and brother-in-law, who still want to use her as their meal ticket. Divorced from her actor husband, she shares joint custody of their teen-aged daughter Gretchen, from who Maggie tries to hide her problems. When it looks as if Maggie has hit rock bottom, Jim Johannsen re-enters her life. Jim, who once had the stage name Barry Lester, got his big break in Hollywood movies by Maggie. He came to the quick realization that he was neither good as an actor or that he wanted to do it as a profession. He now works as a boat parts supplier and mechanic. Jim tries to help her come to the realization of the stage of life that she is in to help her reinvent herself. But Maggie wants to regain her star status on her own terms, and does whatever she needs to for that great ing√©nue role that has eluded her for so many years.', null, 7, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.226180 +00:00', '2021-06-16 20:14:09.226196 +00:00', 'c3c6a2ef-7776-43cb-b57d-7863bc9f7331', 'The Last Movie Star', 'An aging former movie star is forced to face the reality that his glory days are behind him. On its surface, the film is a tale about faded fame. At its core, it''s a universal story about growing old.', null, 6.9, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.226230 +00:00', '2021-06-16 20:14:09.226246 +00:00', 'bb806d5e-6b07-4350-bb50-b28e94ff38f4', 'Fist of the North Star', 'Based on a graphic novel, this apocalyptic adventure centers on a man who must reverse the cataclysmic conditions of his world.', null, 3.9, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.226279 +00:00', '2021-06-16 20:14:09.226295 +00:00', '80d1bf50-ce62-43a8-b852-6f116ce4f91b', 'Flaming Star', 'West Texas in the years after the Civil War is an uneasy meeting ground of two cultures, one white. The other native American. Elvis portrays Pacer Burton. The son of a white rancher (John McIntire) and his beautiful Kiowa Indian wife (Dolores DelRio). When fighting breaks out between the settlers and natives, Pacer tries to act as a peace maker, but the "flaming star of death" pulls him irrevocably into the deadly violence.', null, 6.5, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.226333 +00:00', '2021-06-16 20:14:09.226350 +00:00', 'dcab54f1-6958-4699-b3f5-2fb92c185b33', 'Star Wars: The Force Unleashed II', 'A clone of Starkiller is created by Darth Vader, but, after he escapes his master''s grasp, he travels across the galaxy to discover who, or what, he really is.', null, 7.1, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.226383 +00:00', '2021-06-16 20:14:09.226399 +00:00', '8d4f3766-a857-49a3-ae9c-4565a9459a29', 'Man Without a Star', 'Dempsey Rae, a cowboy with no clear aim in life, winds up working on a spread with a hard lady owner just arrived from the East. She needs a tough new top hand and uses all her means of persuasion to get Rae to take the job. But he doesn''t like the way the other settlers are getting treated and starts to side with them, despite their introduction of the barbed wire he loathes.', null, 6.9, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.226434 +00:00', '2021-06-16 20:14:09.226450 +00:00', 'a0451bbf-e64d-4756-8360-e10382f86dc9', 'Lone Star State of Mind', 'Earl is engaged to his step-sister Baby. Baby has entrusted him to take care of her misfit cousin Junior. Baby is also intent on leaving Texas for LA on Tuesday. When Junior and his recently released ex-con friend Tinker rob a pizza delivery boy and end up with $20,000 of drug money Earl is forced onto the scene, giving up his and Baby''s LA money to save Juniors limbs.', null, 6.1, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.226488 +00:00', '2021-06-16 20:14:09.226504 +00:00', 'a1bf30bf-08ee-4000-8d9a-a1e17ab2c197', 'Buzz Lightyear of Star Command', 'The further (animated) adventures of Buzz Lightyear of "Toy Story" and "Toy Story 2." Buzz, along with fellow Star Command Rangers Mira Nova, Booster, and XR, fight to keep the universe safe from the evil clutches of Emperor Zurg and his henchman, Warp Darkmatter.', null, 6.7, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.226539 +00:00', '2021-06-16 20:14:09.226555 +00:00', '4547b202-5f72-4c5e-ae79-9c46f3f95037', 'Fist of the North Star', 'In the year 199X, human civilization has been all but destroyed by a nuclear holocaust. In an age where the strong rule over the weak, the survivors of the fallout struggle over the remaining supply food and water left. Kenshiro, successor to an ancient, deadly martial art known as Hokuto Shinken (Fist of the North Star), wanders the wasteland with seven scars in the shape of the Big Dipper on his chest. This infamous style uses the body''s hidden 708 pressure points to destroy opponents from within and allows practitioners to unleash 100% of their humanly strength. Accompanied by a young thief and an orphan girl, this messiah brings justice to this lawless world with the strongest fist in the world.', null, 8.3, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.226590 +00:00', '2021-06-16 20:14:09.226606 +00:00', 'cdd0d1bf-e473-4cfd-bf4a-31e42a5df212', 'Star Kid', 'Shy seventh-grader Spencer Griffith''s life changes when a meteor falls into a local junkyard and he finds a Cybersuit - an exoskeleton with AI from another galaxy. Spencer puts on the Cybersuit and becomes a different kind of person.', null, 5.3, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.226640 +00:00', '2021-06-16 20:14:09.226656 +00:00', '9b3c278c-665f-4055-a824-891f19cb4993', 'Star Trek Continues', 'The USS Enterprise''s historic five-year mission continues with all new episodes of the original series. "Star Trek: Continues", a new Trek series, beams down with exciting adventures of the Federation''s most heroic crew led by Captain James T. Kirk. The lighting and color of the highly accurate sets accentuate the equally detailed props and costumes, matching the original series that ran from 1966-69! With acting and stories that also replicate the original series, the adventures are sure to dazzle even the most die hard Trek fans. Witness now the untold morality plays that explore the final frontier and more importantly... the human condition. Fans of the original series will especially enjoy the pilot episode as a familiar guest star from the original series reprises his role in a sequel entitled "Pilgrim of Eternity".', null, 8, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.226694 +00:00', '2021-06-16 20:14:09.226710 +00:00', '445c5df6-06b4-42a8-83f8-ebbf00a04a5c', 'Porn Star: The Legend of Ron Jeremy', 'Porn Star: The Legend of Ron Jeremy offers audiences a penetrating look inside the world of Ron Jeremy, America''s most unlikely sex star and hero to millions. With nearly 25 years in the adult film industry and over 1,600 films to his credit, Ron Jeremy is huge. In his world, Ron reigns supreme-he''s made millions of dollars and slept with thousands of beautiful women, and is indisputably the industry''s biggest star. And everyone who''s anyone knows Ron-a pop icon to millions, he is a beacon of hope for many American male, since he stands as living proof that pretty much anyone can get some. So how did such a classically unhandsome, big and hairy guy ever get to be such a super stud? In one of the most fascinating and entertaining comedies of the last year, audiences finally get a chance to get inside the life and times of Ron Jeremy, and find out what''s really behind the hardest working man in show business.', null, 6.3, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.233490 +00:00', '2021-06-16 20:14:09.233507 +00:00', 'b6b8a3b7-1c12-45a8-9da7-4b20db8867df', 'Star Wars', 'In this game, you assume the role of Luke Skywalker and fight past many enemies to to reach and destroy the Death Star.', null, 7.8, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.226750 +00:00', '2021-06-16 20:14:09.226767 +00:00', '0352be33-bb3a-455b-80dd-444202dff23d', 'A Five Star Life', 'Forty-something Irene had a dream job that made her life easy: she was indeed a luxury hotel inspector and her work got carried out in a wonderful ever-renewed setting, from Paris to Gstaad to Berlin to Morocco to China... But does a dream job necessarily mean a dream life? Irene tried not to ask herself the question too openly. Yes she was single but she had manged to remain on good terms with Andrea, her former life companion. For sure she was childless but she occasionally took care of her two little nieces. And it was such fun to play the mystery guest in those magnificent hotels... Things could have gone on that way hadn''t one day Irene met Kate Sherman...', null, 6.3, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.226802 +00:00', '2021-06-16 20:14:09.226819 +00:00', '0bb10475-0043-4f98-804f-986433d6f7ac', 'Star Wars: Battlefront', 'Battlefront is a multiplayer online first-person shooter which allows players to choose from a variety of armies (Stormtroopers, Rebel pilots, AT-AT commanders, Republic Guards) and crafts (X-wings, snowspeeders and AT-STs) from the epic film series. Team up or fight head-to-head on any of ten planets. ESRB Rating: RP', null, 8.4, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.226853 +00:00', '2021-06-16 20:14:09.226870 +00:00', '181c2b64-4b8e-45b0-8b2e-ea71a2b34285', 'Instant Star', 'Based on a song she wrote and performed, a young girl wins a national contest for a recording contract. Now she must balance the life of a normal teenager with that of a rising star in the music industry.', null, 7.4, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.226903 +00:00', '2021-06-16 20:14:09.226919 +00:00', '2cd808c5-d2ca-4e5d-bbbb-061e9a63aee7', 'The Star', 'The film is based on the eponymous book by Emmanuil Kazakevich. In the summer of 1944 the Nazi Armies prepare a massive Tank Division named ''Viking" for the offensive on occupied Russian land. The Russian Army''s special group of seven snipers named "Zvezda" is sent for a reconnaissance operation behind the enemy lines in the back of the Nazi Tank Division. Two previous Russian groups never came back. The seven Russians know that they are going to an almost certain Death for the sake of Victory.', null, 7.1, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.226955 +00:00', '2021-06-16 20:14:09.226971 +00:00', '9f9393d3-c54e-4e4f-bab0-272a7f80de9e', 'Saber Rider and the Star Sheriffs', 'In the distant future, a team of four high tech Star Sheriffs defends frontier space colony Yuma from outlaws, as well as Outriders, an army of humanoid alien beings called Vapors, led by mysterious Nemesis, who need Yuma''s resources.', null, 8.4, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.227005 +00:00', '2021-06-16 20:14:09.227021 +00:00', '6fddb231-8127-42f0-81e5-f53a806c2ae8', 'The Cloud-Capped Star', '"Meghe Dhaka Tara" tells the tragic story of the beautiful daughter of a middle-class refugee family from East Pakistan, living in the outskirts of Calcutta under modest circumstances. Neeta sacrifices everything for her family, including her personal happiness, her money, and her health, while her achievements are hardly ever recognized by the people around her.', null, 7.9, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.227057 +00:00', '2021-06-16 20:14:09.227073 +00:00', 'dd453840-3491-4836-a1c8-61aee8a2d283', 'Star Wars: Battlefront', 'Join the battle and play an important part in the Star Wars Galaxy. Lead the battle as you fight against the powerful empire in hope to regain freedom for the Galaxy.', null, 7.1, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.227107 +00:00', '2021-06-16 20:14:09.227123 +00:00', '7dc44185-c268-476d-8b0e-488a091c1d4b', 'Star Wars: Jedi Knight II - Jedi Outcast', 'You guide mercenary Kyle Katarn, who must stop the evil plot of a renegade Jedi by relearning his skills as a Jedi Knight.', null, 8.6, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.227157 +00:00', '2021-06-16 20:14:09.227173 +00:00', '4cfc6519-7e07-4419-9db3-127b0166331a', 'Star!', 'Film based on life of actress Gertrude Lawrence, on- and offstage, takes the opportunity to feature extravagant musical production numbers with ''Julie Andrews'' , acting, singing and dancing.', null, 6.6, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.227207 +00:00', '2021-06-16 20:14:09.227223 +00:00', '8fcebebd-a1d9-45c9-96c5-bd798db4a9c6', 'Lucky Star', 'Having fun in school, doing homework together, cooking and eating, playing video games, watching anime. All those little things make up the daily life of the anime-and chocolate-loving-Izumi Konata and her friends. Sometimes relaxing but more than often simply funny.', null, 7.3, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.227257 +00:00', '2021-06-16 20:14:09.227274 +00:00', '3aba7aa0-8930-417c-bf78-3df596c3f062', 'Star Wars: The Old Republic', 'Set long before the Star Wars films, the Sith Empire returns to the galaxy to begin a war with the Galactic Republic. After some brutal battles, both sides stop fighting each other, but the peace is broken and the Empire and the Republic are soon at war again.', null, 8.7, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.227308 +00:00', '2021-06-16 20:14:09.227324 +00:00', 'b57a6405-b6fa-4ac5-afda-7b8b6cbd9592', 'Still Star-Crossed', 'A period drama that picks up where the famous story of Romeo and Juliet leaves off, charting the treachery, palace intrigue, and ill-fated romances of the Montagues and Capulets in the wake of the young lovers'' tragic fate. Based on the book by Melinda Taub.', null, 5.5, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.227358 +00:00', '2021-06-16 20:14:09.227374 +00:00', '69a788c6-3367-4d1e-ae19-46f0aa74253e', 'Oban Star-Racers', 'Earth, 2082, twenty-five years after the failed invasion of the Crog forces. Young Eva (15) is determined to be reunited with her father, race manager Don Wei, who sent her off to a tough boarding school after the tragic death of the mother, ten years earlier. She escapes from school and secretly joins her dad''s famous star-racer team under the alias "Molly". But Don Wei doesn''t recognize his daughter. He has other troubles on his mind: the President of the Earth Coalition has just put him in charge of a dangerous top-secret mission. Don Wei must lead the Earth to victory in a mysterious and mythical intergalactic competition - The Great Race of Oban. It is said that the outcome of the competition will radically transform the balance of power within our Galaxy. Earth cannot afford to lose - especially not against the Crogs! Before she knows what is happening, "Molly" takes off for the planet Alwas, the first stage of The Great Race of Oban, with Don Wei, champion pilot Rick Thunderbolt, gunner Jordan and mechanics Stan and Koji. The fate of Molly and her friends, as well as the future of the human race, are now inextricably intertwined.', null, 8.1, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.227410 +00:00', '2021-06-16 20:14:09.227426 +00:00', 'aa90ffe4-6fc2-4cb9-b984-0cd169aedcd9', 'Lego Star Wars: The Padawan Menace', 'Ian,a young boy,Commander Cody and Yoda must go to rescue the secret battle plans.However,when substitute teacher C-3PO and a class of padawans go too,things become more complicated....', null, 7.2, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.227460 +00:00', '2021-06-16 20:14:09.227478 +00:00', '5c612da0-9c15-48db-b46e-e6c82b071a9b', 'Star Tours', 'Groups of visitors are taken on "Star Tours", a space tour bus set in the Star Wars universe. Thanks to an inexperienced and thoroughly incompetent robot pilot, what is billed as a leisurely tour to the Endor Moon becomes a wild ride as the tour gets caught up in a battle between the Empire and the rebels.', null, 8, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.227513 +00:00', '2021-06-16 20:14:09.227529 +00:00', '73ecd1e6-6326-405a-b51b-69008f383b72', 'Lego Star Wars: The Complete Saga', 'In Lego Star Wars: The Complete Saga, you can now experience all 6 episodes at once. Containing the same levels and locations. Only with newer features and improvements. Such as more extras to unlock, more vehicles to build, new playable characters, & a better customizing Lego character feature. Now all Lego & Star Wars fans alike can experience this game more than it''s successors.', null, 8.5, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.227563 +00:00', '2021-06-16 20:14:09.227580 +00:00', '6a2fccf4-ed37-4483-9619-4189bf43ab97', 'Catch a Christmas Star', 'With the help of his two precocious kids, a widower reconnects with his high school sweetheart, who just happens to be one of the biggest pop stars on the planet.', null, 6.3, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.229157 +00:00', '2021-06-16 20:14:09.229174 +00:00', '4154ea8a-a96a-45be-bf93-7539bee29e7e', 'Star Runners', 'Given a undercover government mission to retrieve a "crate" from a distant planet, TY JOHNS and LEI CHEN find that they must smuggle not a crate, but a woman off world -- and when their rocket-ship crash-lands on a planet packed with vicious giant alien bugs, they''ll need all the cunning and ferocity they possess to stay alive...', null, 4.3, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.227613 +00:00', '2021-06-16 20:14:09.227629 +00:00', '1a3407d1-0ad8-4882-a2dd-1fd37555ace6', 'Five Star Final', 'Hinchcliffe, the ruthless publisher of a sleazy New York tabloid, is concerned that the ethical journalistic policies of City Editor Randall have caused a drop in circulation. He pressures the newsman to run more sensational stories including resurrecting the twenty year old Vorhees Murder Case. Although the perpetrator''s actions were ultimately judged justifiable, and she has been subsequently living an exemplary life in anonymity, Hunchcliffe insists Randall revisit the story. Randall assigns Isopod, an alcoholic degenerate, to dig up anything lurid that he find. The unprincipled reporter fraudulently insinuates himself into the Vorhees'' home masquerading as a minister and gets the expose he sought. Yellow journalism triumphs, and a decent woman''s name gets dragged through the mud again... with tragic consequences.', null, 7.3, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.227665 +00:00', '2021-06-16 20:14:09.227682 +00:00', 'c4d36327-b330-4506-a63d-fef69d3f2f8a', 'Star Wars: Jedi Knight - Jedi Academy', 'You play a young Jedi Academy student who must help stop an evil plot by Dark Jedi to collect and use Dark Side energy for their own ends.', null, 8.5, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.227715 +00:00', '2021-06-16 20:14:09.227731 +00:00', '19d6b54f-8519-4147-baeb-125d05661395', 'Dog Star Man: Part I', 'From a murky landscape, a wooded mountain emerges. We watch the sun. We see a bearded man climbing up the mountain through the snow. He carries an ax, and he''s accompanied by a dog. His labors continue. There is no soundtrack. Images rush past - water, trees, and surfaces too close up to distinguish. He struggles. A fire burns. Nature, in long shots and magnified, is formidable and silent. It''s tough going; he carries on. In a capillary, blood flows.', null, 6.3, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.227766 +00:00', '2021-06-16 20:14:09.227782 +00:00', '0e60f41c-cdc2-4556-ae73-a517fbbe230a', 'Star Wars: Droids', 'This series recounts the adventures of C-3P0 and R2-D2 before they met Luke Skywalker as they serve various masters over the years. As it turns out, their lives were no less hectic as they became involved in battles versus gangsters, pirates, the Empire and even Boba Fett on one occasion.', null, 6.1, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.227817 +00:00', '2021-06-16 20:14:09.227833 +00:00', 'e03e89c8-1d1f-4676-a574-de838d589286', 'Lucky Star', 'Rafael witnesses Marina - a woman with a glass eye - being attacked on the street by Daniel; her long-time acquaintance since the orphanage, where they were both raised as kids. He rescues her from Daniel and brings her to his home, where a relationship between them soon develops. Marina is pregnant, but since Daniel does not want the child, Rafael offers to step in as the father, having his own physical problems, preventing him from having kids. He and Marina stays together as a couple, and as a family. But once everything seems to be settled, Daniel - released from prison - shows up again.', null, 7.3, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.227870 +00:00', '2021-06-16 20:14:09.227887 +00:00', '22d50530-14d5-483e-a063-246e92c8c14f', 'Lick the Star', 'A clique of school girls devise a secret plan that they code-name "Lick the Star".', null, 6, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.227921 +00:00', '2021-06-16 20:14:09.227938 +00:00', '88faa02d-f26f-40a1-9cc6-8045ed08d51e', 'Star Wars: Episode III - Revenge of the Sith', 'Game that portrays the life of a jedi knight and sith lords, while you find your way around the galaxy, as you become part of the story.', null, 7.3, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.227971 +00:00', '2021-06-16 20:14:09.227988 +00:00', '231583e8-50bd-4e4d-8514-325b4bb8a61e', 'Prelude: Dog Star Man', 'A creation myth realized in light, patterns, images superimposed, rapid cutting, and silence. A black screen, then streaks of light, then an explosion of color and squiggles and happenstance. Next, images of small circles emerge then of the Sun. Images of our Earth appear, woods, a part of a body, a nude woman perhaps giving birth. Imagery evokes movement across time.', null, 6.7, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.228022 +00:00', '2021-06-16 20:14:09.228039 +00:00', 'a9ee0b3f-ec56-4107-9b6d-0458dfa3f415', 'Star Trek: Short Treks', 'A series of stand-alone short films featuring characters and storylines from Star Trek: Discovery (2017).', null, 7, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.228072 +00:00', '2021-06-16 20:14:09.228088 +00:00', '3b131cb1-37d1-4b74-a3e8-f225ba00f4ad', 'Big Star: Nothing Can Hurt Me', 'BIG STAR: NOTHING CAN HURT ME is a feature-length documentary about legendary Memphis band Big Star. While mainstream success eluded them, Big Star''s three albums have become critically lauded touchstones of the rock music canon. A seminal band in the history of alternative music, Big Star has been cited as an influence by artists including REM, The Replacements, Belle & Sebastian, Elliott Smith and Flaming Lips, to name just a few. With never-before-seen footage and photos of the band, in-depth interviews and a rousing musical tribute by the bands they inspired, BIG STAR: NOTHING CAN HURT ME is a story of artistic and musical salvation.', null, 7, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.228124 +00:00', '2021-06-16 20:14:09.228140 +00:00', 'fe3d6908-2991-442b-8e81-3ecc46ecc786', 'Journey to the Christmas Star', 'Once upon a time a little girl went out to find the Christmas star.', null, 5.8, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.228174 +00:00', '2021-06-16 20:14:09.228190 +00:00', 'd2d9b15d-a134-446a-af51-eb8c5207fd46', 'Star Trek: Of Gods and Men', 'It is the year 2306. Thirteen years have passed since Captain James T. Kirk was swept away by the Nexus, after saving the crew of the Enterprise-B. The remaining crew members of the original USS Enterprise have gone their separate ways. Captain Nyota Uhura and Captain Pavel Chekov, along with Captain John Harriman of the Enterprise-B, come together for a special dedication in honor of Kirk''s Enterprise. Their reunion is cut short when they receive a distress call from a mysterious planet, that presses the three friends to embark on a mission that will change their lives forever.', null, 6.1, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.228226 +00:00', '2021-06-16 20:14:09.228242 +00:00', '70203d0c-9df4-42ae-80fb-39dd0dab4f6a', 'Star Wars: Revelations', 'Seers once shaped the path of the Jedi Order. But their visions grew unreliable and the Jedi came to distrust those with the ability. Seers hid their visions or left the Order forever. In the wake of the Temple''s destruction a power struggle has emerged between Darth Vader, the Dark Lord of the Sith, and Zhanna, the Emperor''s Hand. Each seek to eliminate the last of the Jedi and gain the Emperor''s favor. Caught between them is one woman who cannot deny the truth of her visions as all race to possess an ancient Jedi secret.', null, 5, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.228277 +00:00', '2021-06-16 20:14:09.228294 +00:00', 'e99620fb-11bb-481b-8702-a14efa6bb0ef', 'Lego Star Wars II: The Original Trilogy', 'Play the original trilogy of star wars A New Hope,The Empire Strikes Back, and Return Of The Jedi. All in LEGO!!!!!!!!!', null, 8.4, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.228327 +00:00', '2021-06-16 20:14:09.228344 +00:00', '259935b8-d79d-4050-93a7-b3713cfb640c', 'North Star', 'Set during the Alaskan gold rush of the late 1800''s. In his efforts to gain control of a small mining town, Sean McLennon is buying up every mining claim that becomes available, usually after the deaths of the previous owners at the hands of McLennon''s ''assistants''. One of the miners targeted by McLennon, a half-Indian hunter named Hudson Saanteek, manages to escape his hired thugs and comes back into town looking to re-establish his claim and get revenge. McLennon and his men have the advantange of numbers and weapons, but Saanteek has his survival skills and knowledge of the Alaskan wilderness.', null, 4.9, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.228381 +00:00', '2021-06-16 20:14:09.228398 +00:00', 'e4685c58-06eb-4575-a5e6-9932fbf84794', 'Star Wars: Forces of Destiny', 'Small moments and everyday decisions shape a larger heroic saga.', null, 5, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.228431 +00:00', '2021-06-16 20:14:09.228448 +00:00', 'ca800b80-c182-49a7-9fd9-3ff2a1ce976e', 'Food Network Star', 'A food network contest to find a well rounded great chef with a unique point of view and hosting type of personality to host their own show!', null, 6.3, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.229209 +00:00', '2021-06-16 20:14:09.229225 +00:00', 'fb3e0374-9b4a-45e0-9a24-c9aa7a6d868c', 'What We Left Behind: Star Trek DS9', 'Ira Steven Behr explores the legacy of Star Trek: Deep Space Nine (1993).', null, 8.4, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.259510 +00:00', '2021-06-16 20:14:09.259526 +00:00', '5c568226-b6cb-4c04-b9a8-24117ec85bb2', 'Top star magaz√≠n', 'Social magazine about famous people and news fro Czech celebrities.', null, 2.9, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.228481 +00:00', '2021-06-16 20:14:09.228498 +00:00', 'bf56a0d7-5fdb-4aa4-8526-0e2e083dde0e', 'Lucky Star', 'Mary, a poor farm girl, meets Tim just as word comes that war has been declared. Tim enlists in the army and goes to the battlefields of Europe, where he is wounded and loses the use of his legs. Home again, Tim is visited by Mary, and they are powerfully attracted to each other; but his physical handicap prevents him from declaring his love for her. Deeper complications set in when Martin, Tim''s former sergeant and a bully, takes a shine to Mary.', null, 7.8, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.228533 +00:00', '2021-06-16 20:14:09.228549 +00:00', '791e4f61-f2f2-471e-866c-9ab1aa318e18', 'The North Star', 'In a peaceful Ukrainian village, the school year is just ending in June 1941. Five young friends set out for a walking trip to Kiev, but their travels are brutally interrupted when they are suddenly attacked by German planes, in the first wave of the Nazi assault on the Soviet Union. When the village itself is attacked and occupied, most of the men flee to the hills to form a guerrilla unit. The others resist the Nazis as well as possible, but soon the village is placed under the command of a Nazi doctor who begins using the town''s children as a source of constant blood transfusions for wounded German soldiers. Meanwhile, the small group of young persons tries desperately to take a supply of firearms to the guerrillas.', null, 6, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.228584 +00:00', '2021-06-16 20:14:09.228600 +00:00', 'daae47e4-cbd0-4ffd-a150-55201b357d5b', 'Lego Star Wars: The Video Game', 'Play through the star wars prequel trilogy in episodes 1,2,and 3, in lego.', null, 8.2, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.228634 +00:00', '2021-06-16 20:14:09.228650 +00:00', '2ee16da4-7bc4-40da-be77-cf0a1769abd2', 'Amateur Porn Star Killer', 'The unofficial story of a killer who kidnaps and kills three girls is told through the tale of his last victim, ''Amateur Porn Star Killer'' is about a girl he picks up on the street and convinces to go back to his hotel room. The girl is shy, unnerved, and yet unable to take herself out of a bad situation. The killer is a guy who seems at first nothing more than your standard, 18 year old pervert with a penchant for filming his sexual escapades. An unsettling darkness descends.', null, 4.3, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.228685 +00:00', '2021-06-16 20:14:09.228702 +00:00', '6313d0f5-e6a6-4071-a0c2-3d737fd1d56d', 'Lego Star Wars: The Empire Strikes Out', 'Luke Skywalker embarks on a mission to find and destroy an Imperial base on Naboo, but is relentlessly chased by a group of fanatic girls, who think of him as a celebrity for destroying the Death Star. Meanwhile, Darth Vader engages a "sibling" rivalry with Darth Maul, in order to prove he''s the best Sith Lord to Emperor Palpatine.', null, 7.3, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.228736 +00:00', '2021-06-16 20:14:09.228753 +00:00', '107dac30-6c1c-4857-a937-682a6f0cccb0', 'Star Trek New Voyages: Phase II', 'These are the new voyages of the starship Enterprise. Picking up from where the original 5-year mission left-off, a new cast continues the adventures of this legendary crew: to boldly go where no human has ever gone before & to search for new life forms.', null, 6.7, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.228787 +00:00', '2021-06-16 20:14:09.228803 +00:00', 'd2de739d-49e5-4308-947d-d683a3f07aca', 'Rainbow Brite and the Star Stealer', 'Rainbow Brite, and her magical horse Starlite, must stop an evil princess and her underlings from taking over the planet Spectra. When they meet Orin, the wise Sprite tries to make the two children get along and work together to stop the evil Princess. Orin tells them that they can only destroy her by combining their own powers against her. Getting in the way of their mission is the sinister Murky Dismal and his bumbling assistant Lurky who, as usual, are lavishing in the new gloom created by the darkening of Spectra, as well as trying to steal Rainbow''s magical color belt.', null, 6.9, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.228841 +00:00', '2021-06-16 20:14:09.228857 +00:00', '2c4d0aa4-ea9f-418a-b1da-5485da74c27b', 'Star Blazers', 'In the late 2100s, the planet Gamilon, a world far beyond Earth''s solar system, declares an invasion of Earth. The nations of Earth fight as one against the Gamilons, but one by one, Earth''s fleets are defeated. When the nations of Earth refuse to surrender, Gamilon begins bombarding Earth with planet bombs, radioactive missiles that look like meteors, which gradually spread deadly radiation all over Earth, forcing what''s left of humanity to retreat to underground cities. Queen Starsha of planet Iscandar contacts Earth and promises to provide Cosmo-DNA that can remove the radioactivity and restore Earth to beautiful life. She provides plans to an engine that will allow a brave, young group of technicians to journey more than a hundred thousand light-years to Iscandar, obtain the Cosmo-DNA, and return to Earth within one Earth year. In 2199, an ancient seagoing vessel is fitted with the awesome engine and launched toward Iscandar. Along the way, the intrepid crew must fight the Gamilons, who are determined to prevent the brave voyagers from saving Earth from extinction.', null, 8.4, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.228896 +00:00', '2021-06-16 20:14:09.228913 +00:00', '63e95875-fea6-483b-8d0b-beedee774926', 'Dog Star Man: Part II', 'A man, accompanied by a dog, struggles through snow on a mountain side. We see film stock blister; drawn square shapes appear. Then, we see an infant''s face. The images of struggling climber, baby, blurred film stock, large snow flakes, and what may be microscopic details of matter are superimposed on each other, one dominating the frame briefly to be replaced by another. As the man falls in the snow and tries to regain his feet, the baby continues to appear, first with eyes closed. Alternately, images rush by - montages of paper cutouts and life under a microscope.', null, 6.5, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.228949 +00:00', '2021-06-16 20:14:09.228965 +00:00', '78566220-add4-4171-bd86-3d41a1e9cd2d', 'Dog Star Man: Part III', 'Sexual intimacy. Three kinds of images race past, superimposed on each other sometimes: two bodies, a man and a woman''s, close up, nude - patches of skin, wisps of hair, glimpses of a face and genitalia; strips of celluloid with lines and squiggles scratched on them; and, close-up shots of what appear to be the insides of living bodies - a heart beating, muscle and sinew and tissue wet with fluids. The exterior and interior of desire.', null, 6.5, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.229000 +00:00', '2021-06-16 20:14:09.229017 +00:00', '36d4c8f6-26a4-4acf-97c6-41f42a674dec', 'Dark Star: HR Gigers Welt', 'He feels at home in places we would flee from and lives his life among the very things we fear. Throughout his life, HR Giger had inhabited the world of the uncanny, a dark universe on the brink of many an abyss. It was the only way this amiable, modest and humorous man was able to keep his fears in check. Giger was merely the bearer of dark messages, charting our nightmares, drafting maps of our subconscious and molding our primal fears. A film with and about the internationally acclaimed and controversial painter, sculptor, architect and designer (Oscar for ''Alien'').', null, 7, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.229051 +00:00', '2021-06-16 20:14:09.229068 +00:00', '77c07191-ea18-4e55-bb13-275a2f2259fe', 'Dog Star Man: Part IV', 'The fourth and final part of Dog Star Man (1964), an experimental film wherein a man climbs a mountain along with his dog.', null, 6.6, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.229101 +00:00', '2021-06-16 20:14:09.229117 +00:00', '700137a3-1b15-4ed1-a17f-bf4c5e6b814e', 'Star of Midnight', 'Friend Tim Winthrop asks criminal lawyer and amateur detective Clay Dalzell to find his girl, Alice, who disappeared a year earlier without a trace. When they go to the theater with Clay''s would-be fianc√©e, Donna Mantin, Tim recognizes the star, Mary Smith, as his girl, and yells "Alice," after which she bolts from the stage and disappears once again. Reporter Tommy Tennant knows why she bolted, but before he can tell Clay the reason, he is shot dead and Clay is wounded slightly in Clay''s apartment. The many suspects include Roger Classon and his wife, Jerry, who are looking for Alice to testify and save Roger''s friend from the electric chair for a murder he didn''t commit; Abe Ohlman, the producer of Mary''s show; and gangster Jimmy Kinland who seems to know more than he''s telling. It''s up to Clay, with the help of Donna, to trap the murderer and find Alice.', null, 6.7, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.229308 +00:00', '2021-06-16 20:14:09.229325 +00:00', '08c9c955-d91f-47aa-a34c-30982e8fdd9d', 'Afghan Star', '"Afghan Star" is a TV show modeled on the UK''s "Pop Idol." We join the 2008 contest when it''s down to nine contestants, and we focus on two women, Setara and Lema, and two men, Hameed and Rafi. We watch the two women in particular: Satara sings with emotion and includes dance in her final performance, an action that puts her life in danger; Lema is traditional, but her very appearance brings death threats. The three finalists are from different tribes, and each makes a plea for Afghan unity. The camera visits families watching the competition, there are comments from people in the street, and we return home with a nervous Setara. In Afghanistan, singing is an expression of freedom.', null, 7.3, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.229363 +00:00', '2021-06-16 20:14:09.229379 +00:00', '11b75468-afb6-4721-bd4f-2eccffc546c2', 'Star Maps', 'Carlos wants to be an actor. But his father, Pepe, wants him to work in the family business, that is, male prostitution. Carlos decides that he will be one of his father''s boys until he can get his foot in the door in Hollywood. Finally one of his clients, a rich soap star, offers him a bit part in her show. Pepe tell Carlos that she is just using him and demands that he not see the women any longer. Carlos defies his father and when his big day comes he is finds out the harsh realities of life are even harsher than he imagined.', null, 5.9, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.229415 +00:00', '2021-06-16 20:14:09.229431 +00:00', '9905f1ff-5da7-4142-97e6-7a0677228493', 'The Star Packer', 'John Travers and his Indian companion Yak are after the mysterious Shadow and his gang. When Sheriff Davis is killed, Travers becomes Sheriff. Catching two gang members, he learns of the room where the gang gets their orders from behind a fake wall safe and makes plans to trap the Shadow.', null, 5.3, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.229465 +00:00', '2021-06-16 20:14:09.229481 +00:00', 'ce7a7670-9cb7-47c6-b64d-c62103fa559c', 'A Star for Christmas', 'The only thing that is working in Cassie''s world is her small town business. Her Christmas Cupcakery is a huge success, but her love life is a mess. Cassie''s whole universe is turned upside down when she falls in love with a co-worker who is revealed to be the famous and notoriously troubled actor Alex Gray. There''s no denying that Alex and Cassie are in love, but can their relationship survive the pressure of Hollywood and the holidays?', null, 5.3, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.229516 +00:00', '2021-06-16 20:14:09.229533 +00:00', 'eb88b9fc-307f-4211-8d0a-9f6854c75821', 'Lone Star', 'Rip-roaring big star, big budget semi-historical story about cattle baron Devereaux Burke, who is enlisted by an aging Andrew Jackson to dissuade Sam Houston from establishing Texas as a republic. Burke must fight state senator Thomas Craden, in the process winning the heart of Craden''s newspaper-editor girlfriend Martha Ronda.', null, 6.2, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.229567 +00:00', '2021-06-16 20:14:09.229584 +00:00', '1a9d68b3-885c-4f01-b3e7-6832d21ddc57', 'A Christmas Star', 'Born under the Christmas Star, Noelle believes she has the gift to perform miracles, so when conniving developer McKerrod threatens her peaceful life she and her friends determine to use this gift to thwart his plans and save their village.', null, 5.2, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.229617 +00:00', '2021-06-16 20:14:09.229633 +00:00', 'e36d9009-3566-46f7-a716-d9a086365e75', 'The Missing Star', 'Labourer Vincenzo travels from Italy to China in search of a machine with a deficiency that was produced in the now defunct establishment at which Vincenzo worked for years.', null, 6.8, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.229667 +00:00', '2021-06-16 20:14:09.229683 +00:00', '6d408030-e673-41c5-b4ce-5d713e8483de', 'Star Crystal', 'Set in 2032, as missions from Earth are being sent to explore Mars. After two groups of astronauts are mysteriously killed following the discovery of strange artefacts on the martian surface, the crew of the SC-37 go in to try and find out what happened. They soon learn what became of their predecessors when a bloodthirsty space monster begins lunching on members of the crew. Will any of them make it back to Earth alive?', null, 3.5, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.229718 +00:00', '2021-06-16 20:14:09.229734 +00:00', '48182513-830f-4501-888a-08ccdfdaeda6', 'Star Wars: Republic Commando', 'Utilizing the heralded Unreal engine, Star Wars: Republic Commando is a first-person shooter from the perspective of an elite member of a Republic Special Ops unit. Set at the start of the Clone Wars, players find themselves able to carry out missions, as a Clone Trooper squad leader, deep behind enemy lines.', null, 8.5, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.229768 +00:00', '2021-06-16 20:14:09.229784 +00:00', '5e5fd2e0-be06-4806-b3ac-e8d0be6716c1', 'Son of the Morning Star', 'The life of George Armstrong Custer comes alive in this made for television movie.', null, 7.5, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.229817 +00:00', '2021-06-16 20:14:09.229833 +00:00', '9465d239-1d6a-4f2f-9dfa-21ee8e7e1d47', 'Lone Star', 'A FOX series that was cancelled after the second episode that involves a con man who lives a double life. He''s married to two different women in two different Texas towns.', null, 6.9, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.229866 +00:00', '2021-06-16 20:14:09.229882 +00:00', '201c0ec8-2add-4d55-90e9-6596afd6dfe9', 'Here, Beneath the North Star', 'T√§√§ll√§ Pohjant√§hden alla is based on the book with the same title. It is a story of the little village. The movie starts in the 1890''s and it ends to the Finnish civil war in 1918. Story concentrates around a tenant farmer family, although it gives us a good look at the society at whole. While the class struggle depends, people of the village are driven to bloody civil war.', null, 7.6, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.229921 +00:00', '2021-06-16 20:14:09.229937 +00:00', '00af52ec-9345-4d66-adbe-50eb917f463a', 'Star Slammer', 'Two women who have been unjustly confined to a prison planet plot their escape, all the while having to put up with lesbian guards, crazed wardens and mutant rodents.', null, 3.5, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.229971 +00:00', '2021-06-16 20:14:09.229988 +00:00', '43c134af-fdbd-4ed0-93e5-0fb05c0b6947', 'Demolishing and Building Up the Star Theatre', 'This film shows the demolition of the historic Star Theatre building (formerly Wallack''s) at the corner of Broadway and 13th Street, New York. To secure this unique picture a Biograph camera was kept constantly at work by specially devised electric apparatus for weeks, during which time exposures were made every four minutes, 8 hours a day. Before the contractors began their work of tearing down and after the last vestige of the building had been removed, 15 seconds of exposure at normal speed were made. Thus in the finished positive one views at first the old Star Theatre standing as it had for years looking down with serenity upon the bustle of Broadway traffic. Then as if struck by a tornado of supernatural strength, the building begins to crumble. Chimneys totters, walls cave in, and whole stories vanish, until at last the site shows only a cellar excavation; and the Broadway cars with the sidewalk procession continue as if nothing unusual had happened. When this view is shown in the reverse, the effect is very extraordinary.', null, 6.7, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.230024 +00:00', '2021-06-16 20:14:09.230040 +00:00', '6d867402-f033-4d30-ae20-a149cfa5cacf', 'Star Wars: Jedi Knight - Dark Forces II', 'You play as Kyle Katarn, a mercenary whose skills progress into becoming a Jedi knight, to stop a team of dark Jedis from taking the valley of the Jedi''s power.', null, 8.7, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.230073 +00:00', '2021-06-16 20:14:09.230090 +00:00', '64aa7000-698f-4332-b52f-9469e4d44ee1', 'Star Wars: Shadows of the Empire', 'You are the protector of Luke Skywalker.', null, 8.2, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.230123 +00:00', '2021-06-16 20:14:09.230139 +00:00', '18c21a03-3127-4746-a5f0-4439612f56b7', 'Hour of the Star', 'Macabea has just moved to the big city after her aunt, who raised her, died. She gets a job as a typist and moves into a boarding house with three other women. In her spare time she listens to time Radio Station; on Sundays she likes to ride the subways. She describes herself saying, "I am a typist and a virgin, and I like Coca-Cola." Then she meets Olimpico, a north-easterner like herself, who has dreams of becoming a Congressman.', null, 7.4, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.234318 +00:00', '2021-06-16 20:14:09.234335 +00:00', 'fd337efe-a136-4904-bab2-14c91813d6de', '√à nata una star?', 'Mother find out from her neighbours, that her teen son is a pornstar with really big tool. This comedy shows how mother and how father deal with this problem.', null, 4.9, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.230173 +00:00', '2021-06-16 20:14:09.230189 +00:00', '8796d72e-0eb8-443a-80cf-100dad4de2d4', 'Star Fox 64', 'You take on the role of Fox McCloud, the leader of the Star Fox team. ''Star Fox'' is an elite group of fighter pilots that works as mercenaries for the Cornarian Army. Corneria is the home planet of the team, and also of Dr. Andross, a mad scientist who was responsible for the death of Fox''s father five years after General Pepper, the leader of Corneria, exiled him (Andross) to the planet Venom, and the Star Fox team went to investigate the strange activity from the planet. Many years later, Andross arises as the emperor of Venom and the supreme ruler of an almost unstoppable military force and declares war on the entire Lylat System, starting with Corneria. General Pepper calls the team to action. The orders: protect the key planets of the Lylat System, infiltrate Venom, and stop Dr. Andross.', null, 8.6, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.230225 +00:00', '2021-06-16 20:14:09.230242 +00:00', 'eb075c31-9f9a-4e14-a8ba-b777585f8afa', 'Star in the Night', 'It''s Christmas Eve. Three cowboys have just bought out a store of items as Christmas presents, despite not having anyone to give the presents to. While two of them admit to wanting to impress the pretty sales clerk, the third just felt good buying gifts to give to someone. Riding through the dark desert on horseback, they see a flashing star off in the distance, which they ride over to investigate. The newly purchased second hand star is a sign just erected by Nick Catapoli for his business, the Star Auto Court. Nick has no Christmas spirit, especially as he deals with the problems of customers, this despite his wife Rosa serving all their customers with a smile and warm heart. He believes most people are hypocrites in that they espouse this spirit at this one time of the year while not having it any other time. As such, he does not want to extend his lobby as shelter for a drifter who just wants to come in from the cold for a little while. Although the drifter tries to explain the true meaning of Christmas to Nick, Nick watching the interactions of all those around him may be a better way to show him, especially when a young and obviously in distress young couple named Jos√© and Maria Santos arrive, with no more rooms available at the inn.', null, 7.8, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.230282 +00:00', '2021-06-16 20:14:09.230299 +00:00', 'eed327be-1d0d-4adf-8391-8c8491747f59', 'Star Wars: Empire at War', 'The game is set before the Battle of Yavin, while the Empire is still constructing the Death Star. The campaign goes through the events before this, on both the Rebel and Imperial side.', null, 7.8, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.230333 +00:00', '2021-06-16 20:14:09.230349 +00:00', 'ee580283-32db-4181-9f11-bd9d171944c3', 'Lego Star Wars: The Force Awakens', '30 years after the destructive Battle of Endor, a new threat emerges from the bricks of the old Empire, the First Order. Their plan: to end the New Republic and the Resistance, complete their ultimate weapon, and take over the galaxy. Luckily, hope is not lost. A scavenger, a rogue stormtrooper, and the Resistance''s best pilot must come together with the aid of old allies to end the First Order''s plans brick by brick. The most beloved LEGO video game franchise by Traveler''s Tales returns to take you back to a long time ago in a galaxy far, far away with LEGO Star Wars: The Force Awakens - The Videogame!', null, 8.4, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.230384 +00:00', '2021-06-16 20:14:09.230401 +00:00', 'bf02a1ac-c706-4985-9c82-6c109faf09dc', 'The Whispering Star', 'A feminine android delivers packages to the scattered humans in the galaxy. With years to spare the android and us have time to contemplate what it is to be human.', null, 6.3, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.230434 +00:00', '2021-06-16 20:14:09.230450 +00:00', '24eafcd7-1018-4951-9e17-583e2554ef0a', 'The Star Boarder', 'Charlie stays at a boarding-house, where he is the landlady''s favorite. Her husband grows jealous when observing this. Their little son has a camera. He happens to take some photos of his mother and Charlie in situations which are innocent but look indecent. He also takes a photo of his father and a female boarding-guest in a similar situation. In the evening the boy arranges a slide show in the boarding-house. Suddenly also the equivocal photos of his parents appear on the screen. His jealous father gets furious and starts chasing Charlie. Soon all the boarding-guests are involved in the fight.', null, 5.4, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.230485 +00:00', '2021-06-16 20:14:09.230502 +00:00', 'b13516e1-10bf-4f22-a5f4-e3ccf7e67097', '5 Star Day', 'Four People. One Horoscope. Infinite Possibilities. Jake Gibson''s (Cam Gigandet) horoscope forecasts a perfect FIVE STAR DAY the morning of his birthday, but what''s foretold as a flawless day unfolds to be far less than stellar. Jake''s world turns upside down when all that could go wrong ... does. Determined that Astrology has no legitimacy, Jake embarks on a journey to test the theory of Astrology by finding the three people born the same time and place as himself - Sarah Reynolds (Jena Malone), Yvette Montgomery (Brooklyn Sudano) and Wesley Henderson (Max Hartman). The journey quickly uproots Jake from the small college town of Berkeley, California, to downtown Chicago where he sets out to find and interview Sarah, Yvette and Wesley to see if their birthdays proved to be as deplorable as his own. Jake''s pursuit in finding his three Astrological matches (or Zodiac twins) will not only test his convictions, but validate how life''s unexpected twists of fate can deliver much more than the anticipated. The unforeseen takes Jake from the Windy City, to the boardwalk of New Jersey''s Atlantic City, to the bustling streets of New York. What Jake learns along the way is an important lesson about life, love, fate and destiny that will unexpectedly change his life forever.', null, 5.8, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.230538 +00:00', '2021-06-16 20:14:09.230554 +00:00', '754589c1-e304-4ed8-87bc-1ac897529b97', 'Lego Star Wars: The Freemaker Adventures', 'The series stars the Freemakers, a family of scavengers who build and sell starships from the scoured debris of space battles strewn throughout the galaxy. When their youngest discovers a natural connection with the Force through an ancient artifact . The Kyber Saber, his world is turned upside down, and he and his family are thrown into an epic struggle against the Empire to restore peace and freedom to the galaxy. Throughout their adventures, the Freemakers explore new worlds, meet new and familiar characters, and learn the true value of what it means to be a family.', null, 7.5, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.230593 +00:00', '2021-06-16 20:14:09.230609 +00:00', '8a49a52d-f278-41cf-8458-880134ff462f', 'Rogue One: A Star Wars Story - World Premiere', 'A behind the scenes look at Rogue One: A Star Wars Story.', null, 7.4, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.230643 +00:00', '2021-06-16 20:14:09.230660 +00:00', '569e23df-7e00-459d-b92a-6cb4653d36b8', 'Star Wars: Episode I - The Phantom Menace', 'The Jedi attempt to protect Naboo from the greedy Trade Federation and, as they soon learn, the Sith.', null, 6.6, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.230693 +00:00', '2021-06-16 20:14:09.230709 +00:00', '4fea6a57-49ff-4def-b8ac-5c595d0925f3', 'The Buggles: Video Killed the Radio Star', 'The video for the Buggles'' classic one-shot, about how the rise of television (and, by extension, music videos) hurt the careers of those performers whose looks would not translate well to the new medium.', null, 6.8, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.231563 +00:00', '2021-06-16 20:14:09.231580 +00:00', '3b1d0e70-42e5-4c9b-98cf-2681c420a99b', 'From ''Star Wars'' to ''Jedi'': The Making of a Saga', 'Ever wonder how they ever made Star Wars, Empire Strikes Back, and Return of the Jedi? Well this documentary explains it all as we''re taken on a behind-the-scenes tour of the making of the Star Wars saga. It shows how the puppets are made and worked, and creator George Lucas talks about what influenced him to do it, and everything. Narrated by Luke Skywalker himself, Mark Hamill.', null, 7.7, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.231618 +00:00', '2021-06-16 20:14:09.231635 +00:00', '5d62b55c-1ed5-4563-ae80-10c4baa21a36', 'Lego Star Wars III: The Clone Wars', 'Anakin Skywalker and other Jedi fight their way through the Clone Wars in this interactive LEGO video game. You get to play through levels that make up seasons 1 & 2 of the TV series "Star ...', null, 7.5, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.259558 +00:00', '2021-06-16 20:14:09.259574 +00:00', 'c2383393-0a55-4717-be0d-6adea3fc43bf', 'The Star and the Story', null, null, 7.2, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.230746 +00:00', '2021-06-16 20:14:09.230762 +00:00', '32c9b3b7-4d42-4145-9ca1-47af745df2a1', 'Star Blazers 2199', 'In the year 2199, Earth is invaded by an extraterrestrial race known as the Gamilas, who hail from a dying planet and decide to make Earth their new home. The Gamilas proceed to rain radioactive bombs on Earth, rendering the planet''s surface arid and uninhabitable (but hospitable for their race). Earth''s space fleet is hopelessly outclassed by the Gamilas and all seems lost... until a mysterious space probe is retrieved on Mars. The probe contains blueprints, and a message from Queen Starsha of the planet Iscandar, who claims to have a device which can cleanse Earth of its radiation damage. The blueprints are of a supercraft that can enable any ship to head to Iscandar (situated in another galaxy) and back in a year, and with these plans the denizens of Earth secretly rebuild a Japanese battleship, the Yamato, into a great space battleship. A large intrepid crew of 999 departs for Iscandar in the Yamato to require the device... but with the menace of the Gamilas, can they succeed in time?', null, 8.2, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.230799 +00:00', '2021-06-16 20:14:09.230815 +00:00', '15667b7c-337f-4c00-b1c8-a066884fc56e', 'A Star Is Bored', 'Daffy Duck must double for Bugs in any slapstick which Warners considers too dangerous for its star Bug Bunny.', null, 7.7, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.230849 +00:00', '2021-06-16 20:14:09.230865 +00:00', '257d0f5a-e0c3-4ad7-9d9a-983819ea40d0', 'Star', 'Three different persons, three different lives are connected in a mysterious way. 15-year old teenager suffering of misunderstanding, his glamorous and arrogant stepmother and the young untalented but full of optimism actress. Their destinies aren''t predetermined and their lives are very fragile.', null, 7.1, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.230899 +00:00', '2021-06-16 20:14:09.230915 +00:00', '08002477-4b59-43ed-a1d1-50688fde338f', 'The Princess with the Golden Star', 'A Czech fairy tale about a princess named Lada who runs away from home in a mouse fur disguise in order to escape an unwanted and forced marriage.', null, 7.3, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.230949 +00:00', '2021-06-16 20:14:09.230965 +00:00', 'd62e51ce-b899-4d28-a69e-0323c0b7b41d', 'Star', 'After Vietnam, Crystal Wyatt meets a returning soldier, Spencer Hill and although she is young they are drawn together and find they have a lot in common. Spencer''s visit is fleeting and although he leaves, Crystal still thinks of him often. Crystal''s father dies and her mother, who has never really loved Crystal, begins to mistreat her and use her as a skivvy. After years of this, Crystal is attacked and raped by her brother-in-law. When Crystal gets her father''s shotgun to kill her brother-in law, her brother-in-law accidentally shoots her brother, and Crystal runs away from the farm to San Francisco where she becomes quite well known as a singer. Menawhile, Spencer has embarked upon a socially beneficial, yet ill-advised marriage, when he meets Crystal again in San Francisco. They embark on a hurtful affair, but the path does not run smooth for them. As intertwined as their lives are, it takes Spencer time to act like a decent man and do what is right.', null, 5.8, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.231004 +00:00', '2021-06-16 20:14:09.231020 +00:00', '64a5de61-29fa-4cac-8730-eaecc38992d4', 'Hugo: The Movie Star', 'Hugo, the one-of-a-kind jungle animal, is snatched away from his home for a second time in another attempt for him to become an animal actor. Meanwhile, he''s reunited with Rita the kind, streetwise fox. Finding that life in front of and behind the camera isn''t so bad, he grows more unaccustomed to wild life once he escapes and slowly weakens his relationship with Rita.', null, 5.2, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.231055 +00:00', '2021-06-16 20:14:09.231071 +00:00', '40340129-96e8-49ce-a45d-2d25d17be48a', 'Star Leaf', 'Some Highs Are Out of this World. Star Leaf is a sci-fi thriller about an extra-terrestrial form of marijuana discovered in the Olympic forests. The main character is a veteran of the Afghanistan war, and the film has PTSD and its treatment with cannabis as an underlying theme. Shot entirely on Washington''s Olympic Peninsula, the movie stars Julian Gavilanes and Russell Hodgkinson of Sy-Fy''s Z-Nation.', null, 3.6, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.231106 +00:00', '2021-06-16 20:14:09.231122 +00:00', 'e0b5afee-cc51-419b-b17e-8ee6bc019dc3', 'Star Wars: Rogue Squadron', 'Luke Skywalker leads the Rebel Alliance''s elite starfighter unit, Rogue Squadron, into battle against the Empire.', null, 8.1, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.231155 +00:00', '2021-06-16 20:14:09.231172 +00:00', 'b8d690e1-2ee7-4791-83ad-1339c73662c8', 'Lego Star Wars: Droid Tales', 'After the battle on Endor, the Rebels are retold the story of Episode I and Episode II through the vantage point of C-3PO. A shadowy figure is also listening and steals a ship. ....and R2-D2. C-3PO and Admiral Ackbar set out to rescue R2.', null, 7.5, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.231205 +00:00', '2021-06-16 20:14:09.231222 +00:00', '19babc93-62f5-481a-b6fe-9ebfef689cbc', 'Star Wars: The Legacy Revealed', 'Filmmakers, critics and even politicians discuss the social impact of the "Star Wars" films and the franchise''s reliance in mythology and history.', null, 7.8, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.231256 +00:00', '2021-06-16 20:14:09.231272 +00:00', 'efd7fc0b-a496-45f8-be2e-1faaa47680e3', 'The Prince and the Evening Star', 'The old King (Vladim√≠r Mens√≠k) is not satisfied with his four children. It is high time for the Princesses to get married and for the Prince to assume the reign. Once the King sets out to the fowling and he entrusts the kingdom to the Prince Velen (Juraj Durdiak). His sisters want him to provide them with the bridegrooms. A beautiful girl Evening Star (Libuse Safr√°nkov√°) appears to Velen and he falls in love with her at once. Evening Star also likes Velen and therefore, for a kiss, she helps him to get married his sisters to her brothers Moonbeam, Sunbeam and Wind. After the King returns home he does not find the daughters because the bridegrooms took them right away. The angry King assigns the Prince to bring them home.', null, 7.1, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.231310 +00:00', '2021-06-16 20:14:09.231326 +00:00', '7a25c172-c846-48b6-8cb4-e9003b786937', 'Prelude: Dog Star Man', 'A creation myth realized in light, patterns, images superimposed, rapid cutting, and silence. A black screen, then streaks of light, then an explosion of color and squiggles and happenstance. Next, images of small circles emerge then of the Sun. Images of our Earth appear, woods, a part of a body, a nude woman perhaps giving birth. Imagery evokes movement across time.', null, 6.9, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.231361 +00:00', '2021-06-16 20:14:09.231378 +00:00', 'be9726bb-4fdf-4734-af2c-d0c9fdebfc04', 'Cloud Capped Star', 'To Ritwik Ghatak film was not merely a form of entertainment, but a weapon, a medium to portray struggle of common men. He was successful neither in his career nor he could he become a good...', null, 8.1, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.231412 +00:00', '2021-06-16 20:14:09.231428 +00:00', '44376611-c92d-49a7-99a9-262ceb2d2da3', 'Star Knight', 'When a dazzling craft illuminates the sky above a medieval European village, the townspeople fear mayhem while the ruling party prepares for battle with the mysterious "dragon in the sky." After Princess Alba is discovered missing, the quest for power and the young girl''s affections drive Klever to free her from the strange cosmic knight. But is that her desire? Worldly boundaries are crossed in this gothic sci-fi tale of power, greed and the universal language of love.', null, 4.1, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.231463 +00:00', '2021-06-16 20:14:09.231479 +00:00', 'ce6e41a2-ac38-443a-b4ec-10307b4e0b38', 'Confessions of an Action Star', 'A ''mocumentary'' on the rise and fall of Chip and Dales dancer turned martial arts action star, Francis Allen Sledgewick, AKA Frank Sledge. When fame and fortune caused Frank to lose his sense of what''s truely important, he realised he''s going to have to get in touch with his roots if there''s ever going to be a comeback.', null, 2.9, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.231514 +00:00', '2021-06-16 20:14:09.231530 +00:00', 'e427011c-e6e7-491b-95db-128598f26684', 'Amateur Porn Star Killer 2', 'This sequel to Amateur Porn Star Killer. The film follows a deranged serial killer who poses as a filmmaker to lure women into his lair.', null, 3.7, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.236107 +00:00', '2021-06-16 20:14:09.236124 +00:00', '6cb70f8c-da1a-472e-87e7-bab2ac224af2', 'Falling Star', 'The difficulty of establishing beauty and the futility of power.', null, 5, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.259605 +00:00', '2021-06-16 20:14:09.259620 +00:00', 'd7c7aba0-a713-417c-92ff-cf895996e94a', 'The Star of Bethlehem', null, null, 4.9, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.231769 +00:00', '2021-06-16 20:14:09.231785 +00:00', '5ae64472-eab2-47fc-98c4-1a9cc72521a1', 'Star Wars: Wrath of the Mandalorian', 'Years after the Clone Wars end, Darth Vader sends bounty hunter Boba Fett to Kashyyyk to track down the last of the Jedi. Fett, motivated by revenge for his father''s death, proves effective - but he soon finds out a terrible truth about Vader while on the hunt that gives him a change of heart.', null, 3.3, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.231820 +00:00', '2021-06-16 20:14:09.231836 +00:00', '8ba07d95-a105-4082-aa3d-46460893d7b8', 'Fist of the North Star: New Saviour Legend', null, null, 6.8, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.231869 +00:00', '2021-06-16 20:14:09.231885 +00:00', 'e107d0cf-6ab3-4bff-9922-e3b655215b53', 'Laura''s Star', 'Laura is seven year old country girl, who''s just moved along with her family to a city. On her first night in their top floor apartment, she sees a shooting star, actually falling to earth, she finds it in a park and discovers it''s a living being. Taking it back home, she and her toddler brother Tommy discover it can do miracles like making people fly and bringing inanimate objects to life. But over time both notice that the longer it stays on earth, the weaker it becomes, can they along with next door neighbor Max find a way to send it back into outer space, before tragedy occurs?', null, 6.1, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.231920 +00:00', '2021-06-16 20:14:09.231937 +00:00', 'd718c261-e954-4615-97f8-9ba67cd823a9', 'Dog Star Man', 'An experimental film from Stan Brakhage in which a man and his dog ascend a wooded mountain.', null, 6.4, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.231970 +00:00', '2021-06-16 20:14:09.231986 +00:00', '3a28f10a-433e-431c-8e7b-cc3f90af5a41', 'The Making of ''Star Wars''', 'Ever wonder how they ever managed to make a movie like Star Wars? Well, bickering droid duo C-3PO and R2-D2 host this tour of the mind of creator George Lucas and what inspired him to make the movie. Even interviewed are the cast and crew, even features scenes of when C-3PO, R2-D2, and Darth Vader planted their footprints (or in R2''s case, tread-prints) into cement. Also discussed is Star Wars mania, how fans loved the movie, collected the merchandise and danced the disco music. Also shown are behind-the-scenes looks at the movie, as well as how difficult each effect was in doing since they didn''t have the convenience of computer animation back then.', null, 7.5, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.232022 +00:00', '2021-06-16 20:14:09.232038 +00:00', 'beb9019c-2d30-44e4-a6b5-4ff27c5759b7', 'Invasion of the Star Creatures', 'A pair of comical soldiers (Robert Ball and Frankie Ray) investigate a mysterious crater in an atomic detonation area and discover several beautiful alien vixens (Dolores Reed and Gloria Victor) who plan to conquer the world using an army of vegetable monsters.', null, 3, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.232072 +00:00', '2021-06-16 20:14:09.232089 +00:00', '0c63fc65-3fc2-48f3-875e-9e373f251d3c', 'Glow Up: Britain''s Next Make-Up Star', 'A talented group of aspiring make-up artists attempt to prove their potential to industry professionals in this competition hosted by Stacey Dooley.', null, 6.4, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.232123 +00:00', '2021-06-16 20:14:09.232139 +00:00', '08a588bd-5eeb-4cf3-8a42-f20195a02c25', 'Star Wars: Episode I - Racer', 'Compete in the galactic pod-racing championship as one of the many pod-racers featured in ''Star Wars Episode I: The Phantom Menace''.', null, 7.7, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.232173 +00:00', '2021-06-16 20:14:09.232189 +00:00', '99494e57-559b-4e76-8a94-b400dd3f0f45', 'Kaleido Star', 'Sora, a young girl from Japan, comes to America in search of her dream. She wants, with all her heart, to be a member of the famous Kaleido Stage, a combination of musicals, acrobatics and magical effects. With the help of her friends, she struggles to make this dream come true.', null, 7.8, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.232224 +00:00', '2021-06-16 20:14:09.232240 +00:00', 'de003e52-3634-4285-b3e1-1df436f1ae53', 'Ich bin ein Star - Holt mich hier raus!', 'I''m a Celebrity - Get Me Out of Here. (often referred to as a jungle camp) is a reality show that has been aired by the RTL since 2004.', null, 4.8, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.232274 +00:00', '2021-06-16 20:14:09.232290 +00:00', '21d3123e-76f1-41eb-871a-706debe7b243', 'Star Trek: Horizon', 'In a time prior to the United Federation of Planets, a young coalition of worlds led by Earth battle the Romulan Star Empire for their very survival.', null, 5.7, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.232324 +00:00', '2021-06-16 20:14:09.232340 +00:00', '6cd444d6-6165-43be-98ed-8b9e115f3e41', 'Plastic Galaxy: The Story of Star Wars Toys', 'When Star Wars landed in the theaters, it introduced audiences to a galaxy filled with heroes and villains, robots and space ships, and a dizzying variety of alien life. But when the lights came up, they all disappeared... Unless you had all the toys. In which case, the adventure never had to end. In backyards, playgrounds, basements, and bedrooms, Star Wars toys helped kids re-enact scenes from their favorite movies, and create entirely new dangers for Luke Skywalker and his friends to face. They were lusted after on holidays and birthdays, swapped with great cunning out on the school yard, and carefully collected like fine treasures. Like no toys before them, the action figures, space ships, play sets, and props were a phenomenon that swept the nation with as much force as the film that inspired them. Along the way they transformed both the toy and movie industries, earned those behind them vast amounts of wealth, and ultimately created a hobby that, 30 years later, still holds sway over not only the people who grew up with the toys, but also an entirely new generation of fans. Plastic Galaxy is a documentary that explores the groundbreaking and breathtaking world of Star Wars toys. Through interviews with former Kenner employees, experts, authors, and collectors, it looks at the toys'' history, their influence, and the fond and fervent feelings they elicit today.', null, 6.4, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.232379 +00:00', '2021-06-16 20:14:09.232396 +00:00', '8fc11ab2-44cb-48fe-989c-487f72103002', 'Star Wars: Dark Forces', null, null, 8.1, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.232428 +00:00', '2021-06-16 20:14:09.232445 +00:00', 'cd92ecaf-87cb-47b6-be7d-b65e51d8b9c8', 'Five Star', 'A member of the notorious Bloods since he was 12 years old - both in the film and in real life - Primo takes John, the son of his slain mentor, under his wing, versing him in the code of the streets. Set in East New York, FIVE STAR blends documentary and fictional storytelling as director Keith Miller carefully avoids worn clich√©s of gang culture to offer a compelling portrait of two men forced to confront the question of what it really means to be a man.', null, 5.4, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.232483 +00:00', '2021-06-16 20:14:09.232500 +00:00', '3f1dcb88-ebba-4b45-acb5-e6ddc723b632', 'Barbie: Star Light Adventure', 'Barbie(TM) is a cosmic princess who flies high on her hoverboard through a far-off universe with her adorable and devoted pet sidekick, Pupcorn. One day, everything changes when the twinkling stars start to dim and slow their dance in the sky. Barbie(TM) travels to a beautiful new planet to join a special rescue team on a mission to save the stars. Once there, she teams up with a group of talented new friends who work together to save the galaxy through exciting hoverboarding adventures. Barbie(TM) soon discovers that if she listens to her heart, and with the help of her friends, she might be the leader the whole universe has been waiting for!', null, 5.9, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.232536 +00:00', '2021-06-16 20:14:09.232552 +00:00', '463d7234-2af1-4e54-a353-2a8c2c269103', 'Chatur Singh Two Star', 'After an incident at Dadar Railway Station, Mumbai''s Police Commissioner Rajpal K. Sinha suspends bumbling police detective, Chatur Singh, but is compelled to reinstate him after no-one within his department wants to be assigned with the security of disgraced and arrested Agriculture Minister Y.Y. Singh, who, after feigning an illness, is hospitalized. Chatur and his deputy, Pappu Panther, accordingly attend to the hospital and screen everyone that goes to visit him, including his wife, Savitri, and Secretary, Sonia Verma. Shortly thereafter, Singh is assassinated, Sonia is arrested as a suspect and lodged in a cell and refuses to divulge any information. Chatur decides to let her escape so that he can follow her and find out who was behind this high-profile killing. Sonia does manage to escape but he is not quick enough to follow, and she ends up in Capetown. Chatur and Pappu must now travel there and not only locate and apprehend Sonia but also must try to investigate her involvement in her employer''s assassination.', null, 1.8, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.232588 +00:00', '2021-06-16 20:14:09.232604 +00:00', 'b9151ead-cf2f-4e14-aeb9-c4617f68848f', 'Star Quest: The Odyssey', 'As our world expands to include the entire galaxy everyone rushes to claim their own piece of this new world and thousands of colonies arise. With no core government, rogue colonies begin to wreak havoc and without a centralized army to protect the innocent peace is all but lost. Now at the end of mankind''s greatest battle, empires will crumble, alliances will form, enemies will rise, and heroes will fall.', null, 1.5, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.232639 +00:00', '2021-06-16 20:14:09.232655 +00:00', '3f8873be-f6b1-4f3f-8a01-873924659851', 'Justin Bieber: A Star Was Born', null, null, 1, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.232688 +00:00', '2021-06-16 20:14:09.232704 +00:00', '75ac61b5-763e-449c-ab31-381ef3ac9336', 'Star Raiders: The Adventures of Saber Raine', 'Rocket ships, Rayguns, and Robots abound in this heart-pounding tale where the stellar adventurer Saber Raine is hired to guide three elite soldiers on a rescue mission to recover a prince and princess who have been abducted from their home world. The trail leads Saber and his allies to a planet deep within uncharted space that is inhabited by strange mutated creatures, leech-like desert marauders, renegade mercenaries, alien outcasts, and cybernetically enhanced soldiers that guard mysterious ruins of an empire long forgotten. Deep within the ruins, Sinjin, a sinister overlord freed from a cryogenic chamber that was his prison for many centuries, is now in league with the Quintari, a malevolent insectoid race known throughout the galaxy as the scourge. In possession of a powerful new energy source, Sinjin plots his revenge on the descendants of those who betrayed him in the past. Can our heroes complete their rescue mission and stop Sinijin from unleashing his fury on the universe? Find out in Star Raiders: The Adventures of Saber Raine!', null, 3, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.232740 +00:00', '2021-06-16 20:14:09.232756 +00:00', '78ff9d2c-4b31-495c-a2b5-07078fdae8e0', 'Star Wars: Threads of Destiny', '94 years after The Battle of Yavin, the New Republic has been resurrected and democracy once again rules the galaxy. The Jedi Order is reestablished on the planet Yavin 4, and has continued to train new Jedi Knights in the art of peace and justice. But all is not peaceful in this new world. With the fall of the Dark Empire, the ancient Skenvi Empire now comes out of the shadow to make its move. The Skenvi now oppose the New Republic for control over the galaxy with their aggressively growing empire. The Skenvi seek to seize control of all the galaxy''s most valuable resources to cripple their enemies. And if a planet refuses to join them, they have been known to take very aggressive actions. Caught in between this struggle over the fate of the galaxy is the little planet of Coreign. The planet possesses a very powerful resource that would greatly favor the side that has access to it if a galactic war was to emerge. In its eagerness to gain access to Coreign''s resources, the Skenvi Empire sends its most infamous negotiator, Lord Siege. He is a man who is known throughout the galaxy for seeing that the Skenvi Empire gets what it wants by all means necessary. The New Republic sends two of its Jedi ambassadors, Master Soran Darr and his padawan, Raven Darkham.', null, 4, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.232795 +00:00', '2021-06-16 20:14:09.232811 +00:00', '29106b0c-4374-443d-bce7-700b4121d144', 'Under the North Star', 'A new film-adaptation of V√§in√∂ Linna''s famous book here Beneath the North Star.', null, 6.8, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.232845 +00:00', '2021-06-16 20:14:09.232862 +00:00', 'e60412c9-43d2-48c0-94a1-81c6b04af84e', 'Confessions of an Action Star', 'A ''mocumentary'' on the rise and fall of Chip and Dales dancer turned martial arts action star, Francis Allen Sledgewick, AKA Frank Sledge. When fame and fortune caused Frank to lose his sense of what''s truely important, he realised he''s going to have to get in touch with his roots if there''s ever going to be a comeback.', null, 2.4, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.232897 +00:00', '2021-06-16 20:14:09.232913 +00:00', '28acbfdd-9487-4446-974d-8b25ee366249', 'Twin Star Exorcists', 'Grotesque monsters known as Impurities reside in Magano, a realm parallel to the present day. Exorcists purify these evil apparitions to protect the people. Rokuro Enmado is opposed to becoming an exorcist, even though he has the talent to be one, but an oracle gives him the title of "Twin Star Exorcist," the name bestowed upon married exorcists. Benio Adashino, the girl who receives the title along with Rokuro, is determined to exorcise all the Kegare, or Impurities, in the world. The two find themselves wrapped up in more and more battles together as the Twin Star Exorcists.', null, 7.1, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.232949 +00:00', '2021-06-16 20:14:09.232966 +00:00', '365a95f0-37f9-4205-aa38-7fa308c709b9', 'Follow a Star', 'Norman Truscott is a store worker who dreams of stardom. Vernon Carew is a singer who''s star is fading. Vernon manages to get a recording of Norman singing and passes it off as himself.', null, 6.7, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.233000 +00:00', '2021-06-16 20:14:09.233017 +00:00', 'f58cf529-b482-4870-9990-0e08e6ef662a', 'New Fist of the North Star', 'Kenshiro is back to make more people''s heads explode in this 3 episode anime OVA.', null, 7, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.233116 +00:00', '2021-06-16 20:14:09.233147 +00:00', '68dfb5e2-7014-4738-a2da-c65bd41f5af5', 'The Star Witness', 'The Leeds family is thrown right in the middle of a war between the cops and gangland when they are the only witnesses to two murders committed by gang kingpin Maxey Campos. Initially positive in their identification of the murderer, their attitudes change when young Donny Leeds is kidnapped by Campos'' boys. No amount of threatening with perjury by D.A. Whitlock can get them to tell the truth - except for cantankerous old Grandpa, civil war veteran, who berates his family for failing to do their civic duty, whatever the cost. Though having his doubts as to the credibility of his star witness, Whitlock is nevertheless taken aback when he learns Grandpa has disappeared just before he is to testify.', null, 6.4, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.233186 +00:00', '2021-06-16 20:14:09.233202 +00:00', '547147ed-d835-4c22-8c42-4a800d6f32b0', 'Star Force: Fugitive Alien II', 'In this second film compiled from two episodes of a Japanese TV serial, Captain Joe, reformed interstellar marauder Ken and the rest of the crew of the Backus-3 set off to destroy an alien race''s super-weapon, face off with Ken''s vengeful ex-lover Rita and confront the sinister leader of the marauding Star Wolves.', null, 1.9, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.233237 +00:00', '2021-06-16 20:14:09.233253 +00:00', '02c24a84-1667-4f98-b459-f08933befa3d', 'Star in the Dust', 'The sheriff of Gunlock is planning to hang Sam Hall, who shot three farmers found on cattle land, at sundown. At the casino, betting is 8 to 3 he won''t make it. The cattlemen are set to rescue Sam; the farmers hope to lynch him before he can be rescued; and Hall schemes for escape with his girl Nellie. But Sheriff Jorden is most concerned with finding out who hired Hall: a leading suspect is the sheriff''s future brother-in-law.', null, 6.1, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.233289 +00:00', '2021-06-16 20:14:09.233305 +00:00', '75a958bb-ee3f-4710-b1c2-da8eedfc42f9', 'Star Odyssey', 'Earth is attacked by an intergalactic villain and his army of robotic androids.', null, 2.5, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.233339 +00:00', '2021-06-16 20:14:09.233355 +00:00', 'dbb9b244-483b-4592-9194-4938338419bc', 'Quentin Tarantino''s Star Wars', 'We''re all familiar with the story: a long time ago in a galaxy far, far away, on a planet called Tattooine, a boy named Luke Skywalker is adopted by the only remaining Jedi knight and helps the Rebellion destroy the Death Star after learning the ways of the force. However, what if "Pulp Fiction" director Quentin Tarantino had directed George Lucas'' script, using Kenner action figures and stop computer animation?', null, 4.8, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.233390 +00:00', '2021-06-16 20:14:09.233406 +00:00', '98bff7a3-0204-482b-aea5-8b4b70b68248', 'The Southern Star', 'Comedy adventure based on a Jules Verne novel about the ups and downs of jewel thieves in the wilds of Africa circa 1900. George Segal is the appealing hero-heel and Ursula Andress is visually stunning as the lady in the proceedings. Orson Welles has a small role.', null, 5.4, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.233440 +00:00', '2021-06-16 20:14:09.233457 +00:00', '5f51ddbc-4966-40a6-9030-262faa3b9b79', 'Star Stories', 'Comedy Thats Shows Us How Some Of The Worlds Biggest Stars Came To Fame', null, 7.4, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.233540 +00:00', '2021-06-16 20:14:09.233556 +00:00', '7ca79d2f-d600-4691-9ac7-24089951de64', 'She Likes Red Star', 'Srba is graduating pupil and football fanatic, or more precise king of a street soccer, who plays even without others, in a winter, summer, rain or snow, while his grandma lights narrow backyard (so called small Maracana) with a flashlight. He wouldn''t accept to become professional by no means and to play for money, rejecting offers of various scouts promising him a career in Spain, Greece, Germany, Turkey... main characters of Srba''s school days are his best friends, Daca who is secretly in love with him ever since first grade, professors Hannibal and Darwin and Beki, new schoolmate to whom Srba fells in love - and she loves Red Star...', null, 3.8, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.233592 +00:00', '2021-06-16 20:14:09.233608 +00:00', 'c06dd0f4-d75d-4952-a81c-36837a30351b', 'Frat Star', '"Frat Star" explores the alluring, superficial, manipulative, and dark world of Ivy League fraternity culture. An insecure, poor, and broken-hearted Nick enters freshman year with no interest in fraternities. This all changes when his old money roommate Billy convinces him to pledge.', null, 3.5, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.233643 +00:00', '2021-06-16 20:14:09.233666 +00:00', '19c21be1-3c42-448d-a088-cd5d61e26710', 'Star Crossed', 'A modern day "Romeo and Juliet" is told against the backdrop of professional football in Portugal, with two feuding teams, Castelo and Invicta, filling in as the Montagues and the Capulets. The latest incident in the feud is an on-field brawl between the players worse than they have ever had, which results in an indefinite suspension of both teams from the league pending a full investigation. Each game not played results in a loss and thus less and less chance of either team reaching the post-schedule championship. Beyond the direct measures to have the league lift Invicta''s suspension, its owner/president, Jos√© Carlos Silva, believes another indirect measure is to win in the court of public opinion by currying favor with Philip Andrews, a British documentarian filming a movie about the feud, and whose cameras and stories he hopes will document that Invicta is the innocent victim. To curry that favor, Jos√©, upon Philip''s expression of interest, is pushing his innocent daughter, In√™s Silva, to date Philip, in who she truly has no interest despite Philip being a decent man. Meanwhile, one Castelo player not involved in that on-field incident is Brit Paul Collins, who was out sick that game and who is nursing a broken heart over a recent break-up with his girlfriend, Danielle. However, Paul and In√™s fall in love at first sight when they spot each other across a crowded room at a party. Despite the obstacles, Paul and In√™s do clandestinely see each other, with Carla, In√™s'' paternal grandmother, and Dr. Lawrence, Paul''s American physician, reluctantly being their co-conspirators, reluctant in that they are more cognizant about a Paul/In√™s relationship being fraught with life long problems. As Paul and In√™s'' love deepens, so does the feud, the two which truly may be incompatible.', null, 5.9, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.233710 +00:00', '2021-06-16 20:14:09.233726 +00:00', 'c71db79a-6978-46da-9b89-43a92ebfceac', 'Kirby Super Star', null, null, 9.2, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.233759 +00:00', '2021-06-16 20:14:09.233775 +00:00', 'c8f57f93-b02a-40d4-ba55-9600cceddd7e', 'Star Tours: The Adventures Continue', 'In the newly opened Star Tours touring agency, C-3PO is accidentally made to be the pilot of a StarSpeeder 1000. Also on board the craft is one of the guests, who is revealed to be a rebel spy who must be safely delivered from the Empire. With multiple beginnings, middles, and ends, there are 54 possible routes the StarSpeeder 1000 can take.', null, 8.3, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.233810 +00:00', '2021-06-16 20:14:09.233826 +00:00', '8f66a240-1072-4529-88ba-bde17d7d4061', 'Broken Star', 'Abandoned by her friends and family and with her career in jeopardy, starlet Markey Marlowe is sequestered in a duplex with a reclusive landlord who just may be more dangerous than she is.', null, 4.2, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.233860 +00:00', '2021-06-16 20:14:09.233876 +00:00', 'd38bced9-f39d-47b5-ad4c-5052d76c0246', 'Star Trek: The Experience - The Klingon Encounter', 'An attempt by some evil Klingons to kidnap visitors at The Las Vegas Hilton is foiled when the 24th century starship U.S.S. Enterprise transports them safely aboard. Taken to the bridge, the guests are told by Commander Riker that the Klingons plan is to disrupt the future time-line. Riker orders Lt. Commander LaForge to take them through the Klingon battle-zone and back to the 20th century aboard a shuttle-craft so that the time-line can be restored.', null, 7.7, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.233914 +00:00', '2021-06-16 20:14:09.233930 +00:00', '5044be46-fafc-4f98-8577-5da9892b1cb9', 'Star Spangled Rhythm', 'Pop, a security guard at Paramount has told his son that he''s the head of the studio. When his son arrives in Hollywood on shore leave with his buddies, Pop enlists the aid of the studio''s dizzy switchboard operator in pulling off the charade. Things get more complicated when Pop agrees to put together a show for the Navy starring Paramount''s top contract players.', null, 6.8, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.233965 +00:00', '2021-06-16 20:14:09.233982 +00:00', '7ca68da5-0790-4e75-908a-9f164bed923c', 'Earth Star Voyager', 'The Earth Star Voyager is a spaceship sent to another solar system to prepare it for colonization. Earth itself is horribly polluted, so the mission is vitally important. But as the ...', null, 7, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.234015 +00:00', '2021-06-16 20:14:09.234031 +00:00', 'a59e5a82-4944-4e99-a45a-a3de547f5da1', 'My Lucky Star', 'A woman gets caught up in an international diamond heist which pushes her close to a spy who is trying to save the world.', null, 5, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.234064 +00:00', '2021-06-16 20:14:09.234081 +00:00', '66d7de47-16d7-40e9-9d08-6e1773bc0bc3', 'Make Me a Star', 'Menton Gill is longing to become a cowboy actor and leaves his hometown to try his luck in Hollywood, but there his acting ability is regarded as non-existent. Actress Flips gives him a chance in a bit part, but he fails in that; however, the way he fails makes her think that he could be a good comedian. She persuades the studio to put him in a western parody, not telling him what they''re really planing, because they know that he does not like comedies. Rather than ending tragic-comically, the movie becomes a brilliant coda to art and its servants, the artists, in this case the magniloquent Joan Blondell and Stuart Erwin.', null, 6.5, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.234117 +00:00', '2021-06-16 20:14:09.234133 +00:00', 'a20566a2-b3ec-4814-ae9a-040aabcb38e7', 'Star Wars: A Musical Journey', 'Actor Ian McDiarmid introduces several music videos featuring the famous Star Wars scores composed by John Williams. There are sixteen chapters in all, and are all perfectly created to show us the great music from the six films.', null, 8.6, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.234167 +00:00', '2021-06-16 20:14:09.234183 +00:00', '74429db7-22b1-4c93-a71d-44b3ee1ffc11', 'Star Trek: Generations', 'Captain Jean-Luc Picard and the crew of the Enterprise-D are in the middle of a crisis that has been in effect for more then 80 years. An evil El-Aurian scientist named Tolian Soran has been destroying stars in order to change the path of a space anomaly called the Nexus, a ribbon of energy that acts as a gateway to another reality where all of your hopes and dreams come true. In order to do so, Soran has teamed up with the renegade Klingon faction lead by the Duras sisters, and plans on destroying the Veridian system (inhabited with hundreds of millions of people) in order to cross over into the Nexus.', null, 7.1, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.234219 +00:00', '2021-06-16 20:14:09.234235 +00:00', 'fd919eab-c5e2-4074-81c6-4f5b7b52248a', 'Shine, Shine, My Star', 'The story of a young actor during the Civil War years who drives around the countryside giving free performances in order to bring art to the masses.', null, 7.5, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.234269 +00:00', '2021-06-16 20:14:09.234285 +00:00', 'be28b4ab-b554-4430-9244-2022d0a3af0c', 'Lego Star Wars: The Quest for R2-D2', 'During a space battle with the sepretists R2-D2 ends up blasting out of Anakins ship and end''s up getting lost with precious data. Now the Jedi and the sith are hunting down the droid. Who will win?', null, 6.5, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.237321 +00:00', '2021-06-16 20:14:09.237337 +00:00', 'ba76274f-dce9-4b32-9a04-ef9809bba837', 'Lego Star Wars: Bombad Bounty', 'A case of mistaken identity launches an unsuspecting gungan janitor into a chase of galactic proportions.', null, 6.4, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.234368 +00:00', '2021-06-16 20:14:09.234385 +00:00', '5488665b-83ac-42a9-a422-c3646e2ff9e6', 'Fist of the North Star 2', 'Peace was brought to the land by Kenshir√¥ years ago. But now he is gone; merely a legend. Along with the peace came a distinction in classes, and soon a new era of violence began. A new tyranny arose, the fearsome fighters of the Gento K√¥ Ken style that fight for their Emperor of Heaven. Rin and Bat have grown up and formed a resistance called the "Hokuto Army". When times are at their worst, Kenshir√¥ returns! Can he stop the Gento terror? And what is the secret of the mysterious Land of Shura?', null, 8.3, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.234424 +00:00', '2021-06-16 20:14:09.234441 +00:00', 'feddd90c-14b4-4a89-b6f0-625066d989fa', 'Daytime Shooting Star', 'Suzume Yosano''s parents have decided to move to Bangladesh when her father''s job gets transferred there. However, they''re not taking her with them. So, Suzume moves to Tokyo to live with ...', null, 6.9, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.234475 +00:00', '2021-06-16 20:14:09.234491 +00:00', '83ba0fc6-0f89-4d9a-94e0-58dcc611733b', 'Pup Star', 'Welcome to a world where dogs can not only talk -- they can SING! Tiny, a cute little Yorkie pup with a big voice, gets a chance to audition for the singing competition for dogs, "Pup Star." After she earns a place in the finale, she''s suddenly dog-napped! But with the help of her new friend, Charlie, a retired rock-and-roller, she escapes. Together they leave on an incredible journey through some of music''s most iconic cities. They meet Big Ears - a soulful Bassett Hound who teaches Tiny to belt out the blues, Murray - a spiritual shaggy dog who helps her find her inner rhythm, and Emily Rose - a country-singing shepherd who helps her learn to sing from her heart. Most important of all, they all encourage Tiny to believe in herself and never give up on her dreams! Filled with all-new songs and the biggest cast of talking and singing canines ever assembled, Pup Star is an incredible family film filled with fun, music and heart.', null, 4.2, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.234527 +00:00', '2021-06-16 20:14:09.234543 +00:00', 'd23551b8-a8c0-475d-94d6-704ef9dcdbce', 'Child Star: The Shirley Temple Story', 'The life, laughters, and luck of one of the most famous and beloved child stars, Shirley Temple.', null, 6.2, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.234577 +00:00', '2021-06-16 20:14:09.234593 +00:00', '020adfa7-7251-4fb9-b6db-07b60664cb67', 'Star Trek', 'Kirk and Spock team up against the Gorn.', null, 6.9, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.234626 +00:00', '2021-06-16 20:14:09.234642 +00:00', 'b2540995-0f91-4db1-99ed-dd7bcb3976d9', 'Catch a Falling Star', 'Sydney Clarke is a spoiled famous actress who is shooting a film when she suddenly gets angry and storms off. She wakes up in the middle of nowhere and gets a ride to a small New England town. There she meets and develops a friendship with Joyce, a waitress at a bowling alley. There she meets Ben, a steel mill owner, and later when she goes to get a job in that small town, she meets Ben again. Sydney becomes a nurse at the mill. All the men adore her. There they have many great times together, and Sydney realizes how important real friends are and that small towns are better than big name Hollywood.', null, 6, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.234677 +00:00', '2021-06-16 20:14:09.234694 +00:00', '6563a66b-d292-4ef4-9bf1-90019673da70', 'Perry Mason: The Case of the Shooting Star', 'A comedian hatches a great joke: rig a fake killing live on TV. He takes a gun with blanks, and shoots his accomplice during a talk show. Happy that his joke has been successful, he walks away. His accomplice is really dead, however, and nearly a million viewers saw him pull the trigger.', null, 6.9, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.234728 +00:00', '2021-06-16 20:14:09.234744 +00:00', 'b43d3ea2-e1aa-4086-b6c5-9db3f180a0cc', 'King Star King', 'King Star King is an intergalactic warrior who fights various evil foes throughout the Gigantiverse. Always buy his side are his team of "strange heroes" which includes Hank Waffles, Pooza the Wizard, and Gurbles the flying robot bear.', null, 5.9, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.234778 +00:00', '2021-06-16 20:14:09.234794 +00:00', '87677f57-63bc-4498-a39c-4985a3b37643', 'Lego Star Wars: The Yoda Chronicles', 'Centered around Yoda''s stories that take place before ''''Lego Star Wars: The Padawan Menace''''. Yoda begins by training Padawans at the Jedi Temple Academy, but then he feels a disturbance in the Force and rushes off to fight the Dark Side.', null, 7.5, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.234828 +00:00', '2021-06-16 20:14:09.234844 +00:00', '0f05c4a6-7fc6-4b2a-9ecc-551979316aea', 'From Star Wars to Star Wars: The Story of Industrial Light & Magic', 'The incredible evolution of George Lucas'' special effects dream factory, including an inside look at "Star Wars: Episode One - The Phantom Menace."', null, 7.2, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.234878 +00:00', '2021-06-16 20:14:09.234895 +00:00', '2ae92dcc-e043-4a0c-a2cd-6146650b3c71', 'Morning Star', 'In time of war, a man must survive to make a journey to fulfill a promise made and discover the truth. After a terrible battle, he sees his great friend perish, leaving him one request - that he visit the king, father of the deceased, to give him the news of his death. Stuck to the promise, the warrior part to the meeting with the king, who lost his only heir.', null, 2.7, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.234929 +00:00', '2021-06-16 20:14:09.234945 +00:00', '3cbb999f-c92b-495d-92d9-d1b2715009dc', 'The Ancient Magus'' Bride: Those Awaiting a Star Part 2', null, null, 7.8, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.234979 +00:00', '2021-06-16 20:14:09.234995 +00:00', 'a028b7af-0775-42a5-9739-8ff48ea478d1', 'Star Wars: Jedi Knight - Mysteries of the Sith', 'The game starts with Kyle Katarn from Jedi Knight and Dark Forces battling his way onto an asteroid that is being used by the Empire to attack a rebel outpost. Kyle then leaves and the focus shifts to his apprentice, Mara Jade, who completes several missions for the rebels before setting out to locate the missing Kyle.', null, 7.9, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.235030 +00:00', '2021-06-16 20:14:09.235046 +00:00', 'c69c0c98-1eef-4bc1-92da-192d7b637d58', 'Battle Star Wars', 'When the leader of the evil Coalition threatens to destroy a Rebel planet for its resources, his daughter will have no choice but to join the Rebel side and fight for what is right.', null, 1.6, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.235079 +00:00', '2021-06-16 20:14:09.235096 +00:00', '027ba6c5-d805-402a-addf-484b34292625', 'Chasing the Star', 'Three Magi Priests journey the unforgiving desert in search of the new born King.', null, 3.1, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.235130 +00:00', '2021-06-16 20:14:09.235147 +00:00', 'd110b83c-48a8-4b05-977a-1184f7292f45', 'Joan Crawford: The Ultimate Movie Star', 'In this documentary on the life of ''Joan Crawford'', we learn why she should be remembered as the great actress she was, and not only as the "mommie dearest." caricature she has become. Friends, fellow actors, directors, and others reminisce about their association with her, and numerous film clips show off her talent from her start in silents to bad science fiction/horror movies at the end of her career. Daughter ''Christina Crawford'' even explains the origin of the phrase "No more wire hangers!".', null, 6.2, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.235182 +00:00', '2021-06-16 20:14:09.235199 +00:00', '248041f8-8c65-4539-b684-e8f4cd01d10f', 'Star Fox', 'Join the Star Fox team as you battle the forces of the evil Andross.', null, 8.1, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.235233 +00:00', '2021-06-16 20:14:09.235249 +00:00', '3fd7c00f-aaff-4798-a9b7-5cf29a832698', 'Mr. Plinkett''s The Star Wars Awakens Review', 'Mr Plinkett discusses his views and personal feelings on The Force Awakens and the current state of the Star Wars franchise.', null, 8, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.235282 +00:00', '2021-06-16 20:14:09.235299 +00:00', '7b6c0d32-1205-4fd4-848e-12e1e9ef8361', 'Lego Star Wars: The Yoda Chronicles - The Phantom Clone', 'Grievous lures Yoda away from the Jedi Temple and steals the Padawans light sabers. Dooku plans to use the crystals inside the light sabers to make Sith clones. It is up to Yoda and the Padawans to prevent Dooku from carrying out his plan.', null, 7, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.235332 +00:00', '2021-06-16 20:14:09.235348 +00:00', 'eef53bca-4faf-48ae-a52f-5567b5f63fde', 'Pop Star', 'When talented young singer, Roxie Santos, meets music producer, Eddie Marz, he promises her an amazing new lifestyle and a future record deal. All he needs her to do is first lend her voice to a celebrity with no singing talent. However, when things go too far and it looks like she might lose her "voice" forever, she sets off to prove the truth.', null, 4.8, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.266082 +00:00', '2021-06-16 20:14:09.266098 +00:00', '9dafd566-df40-427c-8367-b8904e69d006', 'Star Wars Heroes & Villains', 'A look at the creation and filming of the various heroes & villains from all six Star Wars movies.', null, 6.2, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.235383 +00:00', '2021-06-16 20:14:09.235399 +00:00', '92f246d5-c125-4362-b380-2a993f975757', 'The Christmas Star', 'Horace McNickle (Edward Asner) is a two-time felon serving prison time for counterfeiting. On the week before Christmas, he escapes from prison dressed as Santa Claus due to his uncanny resemblance to St. Nick resulting from his long white beard and heavyset features. McNickle hides out from the police in a nearby suburban neighborhood where he is befriended and helped by two local children who think he is the real Santa Claus. McNickle takes advantage of the kids naivety to help him get his counterfeit money hidden somewhere in a local department store while he develops kind-hearted feelings for his two con victims that make him slowly understand the true nature of Christmas.', null, 6.5, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.235438 +00:00', '2021-06-16 20:14:09.235454 +00:00', '15afdc8b-381f-4bcb-9530-59113d10b5cb', 'Star Trek Voyager: Elite Force', 'Lt. Commander Tuvok, chief officer of the USS Voyager, has started a force against the dangerous races of the Delta Quadrant. You play as a member of this Elite Force of Starfleet Security officers as you battle the Borg, Hirogen, Species 8472, and other races of the Delta Quadrant. Your arsenal includes weapons seen on Voyager, as well as new alien and prototypical Starfleet weapons.', null, 8.3, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.235490 +00:00', '2021-06-16 20:14:09.235506 +00:00', '661d8ee3-1b19-48a1-98b4-b3873907dd1b', 'Star Pilot', 'Aliens from the constellation Hydra crash-land on the island of Sardinia. A prominent scientist, his daughter, several young technicians, and a pair of Oriental spies are taken hostage by the beings so they can use them to repair their spaceship''s broken engine. With that done, they take off towards their home planet, taking the earthlings with them. However, the humans attempt to mutiny against their captors, inadvertently sending their tiny spaceship hurtling into the infinite beyond...', null, 4.3, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.235540 +00:00', '2021-06-16 20:14:09.235557 +00:00', '0f83f470-41d0-42c1-b6bb-aedea263cb4c', 'Star Wars Galaxy of Adventures', 'Key moments and characters of the ''Star Wars'' saga are reintroduced in short animations.', null, 5.1, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.235590 +00:00', '2021-06-16 20:14:09.235607 +00:00', '2a4bed38-ab31-4291-ad12-bb0c71a55b8a', 'Star Wars: Rogue Squadron II - Rogue Leader', 'In this sequel to "Rogue Squadron," Rebel Alliance pilots Luke Skywalker and Wedge Antilles lead the titled squadron on a series of missions that ties in with the universe of the original Star Wars trilogy from the Death Star Trench Run to the Strike at the Core inside the Death Star II.', null, 8, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.235641 +00:00', '2021-06-16 20:14:09.235657 +00:00', '4a09d9ce-e24c-40c7-9ae5-706282fd4296', 'Super Star Wars: Return of the Jedi', 'The Empire is rebuilding the Death Star and planning a big attack on the Rebels. Meanwhile back on Tatooine, the evil Jabba the Hutt is causing trouble. He also has in his possession Han Solo, who''s been frozen in carbonite in the last adventure, so in a land speeder, Luke Skywalker, Chewbacca and Princess Leia rush to Jabba''s palace. After a treacherous ride over cliffs and rocks, you arrive. Leia is dressed as bounty hunter Boush. You rescue Han Solo, then you must defeat Bib Fortuna, survive the Rancor pit, treacherous rides on Skiffs, and send Jabba the Hutt to an early grave! Soon after you all travel to the exotic moon of Endor, while Lando Calrissian leads Rebel pilots into a full scale attack on the Empire. Luke and Leia must survive a fast and furious Speeder rides, avoiding trees. Then they meet Wicket and the rest of the Ewoks who help rid the Ewok Village of Imperial Troops. Luke, meanwhile, heads into the forest and allows himself to be captured and taken onboard the Death Star where he must engage into a lightsaber battle with Darth Vader, and even the Emperor himself! And then, Lando flies the Millennium Falcon into the Death Star and destroys the breaking point, which is the good news because the Death Star will now simultaneously combust. The bad news: you''ve got to zoom out of there at the speed of light, avoiding walls and small ceilings! If you are successful, the Death Star will once and for all be blown away into the heavens, and the Rebels will live happily ever after.', null, 7.9, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.235697 +00:00', '2021-06-16 20:14:09.235714 +00:00', '4ab2508c-7d24-460a-87b5-ff9f200e7240', 'Star Wars: TIE Fighter', 'You play an up and coming combat pilot serving the Galactic Empire.', null, 8.8, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.235748 +00:00', '2021-06-16 20:14:09.235764 +00:00', '8e57a1c4-e952-4c07-a5cf-40c61dac36fa', 'Radio Star', 'Once a superstar with a music award on his belt, rocker CHOI Gon now sings in a run-down caf√©. But an incident with one of the guests at the caf√© has him end up locked behind bars. His manager for more than 20 years, Min-soo makes a deal with the radio station producer to help Gon bail out, and in exchange, to have Gon DJ at a remote radio station in the suburbs. Reluctant to work at first, CHOI Gon soon finds out that the little things matter the most, and his attitude towards his pal and manager Min-soo gradually changes.', null, 7.1, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.235803 +00:00', '2021-06-16 20:14:09.235820 +00:00', 'c03a3a97-5000-4187-944d-b483a984e6f2', 'The Star of Christmas', 'Bob the Tomato and Larry the Cucumber appear as Cavis Appythart and Millward Phelps, respectively--two jingle writers based loosely on Gilbert and Sullivan. The setting is 1880s London, and they''ve written a musical called "The Princess and the Plumber", which they plan to open on Christmas Eve. Cavis thinks the production will "teach London how to love". But children at nearby St. Bart''s Church are planning a nativity play for the same evening, and they plan to feature the Star of Christmas, a religious artifact unseen by the public for decades. The London Post Gazette writes a front-page story about the nativity play and the Star, and Cavis and Millward hatch a plan to make their musical better than the children''s play. In the end, they learn about the true meaning of Christmas.', null, 7, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.235856 +00:00', '2021-06-16 20:14:09.235872 +00:00', 'dda2478e-b12e-4ac9-a0fb-815174073f96', 'Grown Up Movie Star', 'Grown Up Movie Star tells the story of disgraced NHL star Ray and his precocious daughters Ruby and Rose. Once the town hero, Ray has returned home to Newfoundland from the US following a drug conviction, only to have his wife Lillian leave him for another man and aspirations of stardom. With Lillian gone, Ray flails from woman to woman trying to find a replacement for her, while struggling against a growing awareness of his homosexuality. At loose ends for lack of guidance, Ruby is becoming increasingly curious about her own sexuality and, in a desperate plea for attention, putting herself in increasingly risky situations. Ruby begins spending more and more time with Ray''s best friend Stuart, confined to a wheelchair following an accident involving Ray. When Stuart finds himself attracted to Ruby, dangerously motivated by fear and anger, he leads the three of them towards a heartbreaking conclusion.', null, 6.1, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.235908 +00:00', '2021-06-16 20:14:09.235925 +00:00', 'c97c8fbc-4084-4e9b-a486-eb5fcfe6104b', 'Amateur Porn Star Killer 3: The Final Chapter', 'Villainous voyeur Brandon (Shane Ryan) wreaks havoc and pure sexual violence on a poor young girl, Nikki (Regan Reece). Rather than lure her in like the first film, or gain her trust as a ...', null, 2.4, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.235958 +00:00', '2021-06-16 20:14:09.235975 +00:00', '13ab1171-d463-49b5-be86-e64034047cf5', 'Holly Star', 'A broke puppeteer returns home for the holidays and gets caught up in a treasure hunt with her paintball-obsessed best friend, her tango-dancing grandmother, and a childhood sweetheart.', null, 5.1, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.236008 +00:00', '2021-06-16 20:14:09.236024 +00:00', '5c855467-9c2b-491d-a179-c217ea543e93', 'Porn Star Zombies', 'A group of adult film cast and crew members must discover what is causing their fellow stars to rabidly attack them.', null, 2.4, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.236058 +00:00', '2021-06-16 20:14:09.236074 +00:00', 'a9b57067-b910-47b8-bb83-3169429c84e1', 'All Star Comedy Jam', 'The Original King of Comedy and Shaquille O''Neal presents this Stand-Up Special with some of the industry''s most talented and sought after comedians.', null, 7.5, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.260746 +00:00', '2021-06-16 20:14:09.260762 +00:00', '3f8c70a9-999e-45f5-9fda-2ddf5ee37b2a', 'Project Runway: All-Star Challenge', 'Eight of your favorite designers from past seasons of ''Project Runway'' go head-to-head in the workroom.', null, 7.2, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.236157 +00:00', '2021-06-16 20:14:09.236173 +00:00', '3b74bedf-0cba-40c3-8270-0e5024f8b9a4', 'Star-ving', 'David Faustino plays himself as a struggling actor in this very entertaining web series. Great cameos and several appearances by former Married with Children cast members.', null, 7.9, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.236206 +00:00', '2021-06-16 20:14:09.236222 +00:00', '184eeea3-c91a-43f9-9a8b-d6ab8dfb9bf3', 'Jason of Star Command', 'Jason was an officer of Star Command, which was located on the same asteroid as Space Academy. Star Command''s job was to protect the innocent from the bad guys, most notably Jason''s archenemy, the one-eyed Dragos.', null, 6.7, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.236260 +00:00', '2021-06-16 20:14:09.236276 +00:00', '26e7f2cd-2ab5-4ca5-bedd-5fbb81a12973', 'Star Wars: Bounty Hunter', 'You are Jango Fett, the most fearless bounty hunter in the galaxy, hired to capture a deranged Dark Jedi. Armed with an array of deadly weapons and skills, you''ll face off against galactic scum from the darkest corners of the Star Wars universe. For the galaxy''s most wanted-there is no place to hide.', null, 7.9, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.236310 +00:00', '2021-06-16 20:14:09.236326 +00:00', '68bd16e6-754d-4eb7-95f1-4ee532b88b1c', 'Star Trek: Hidden Frontier', 'For the last six years, has continued the ongoing missions of Starfleet after the journeys of Star Trek: The Next Generation, Star Trek: Deep Space Nine, and Star Trek: Voyager. More than "just a fan film", has made an improving production using spectacular special effects.', null, 4.8, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.236360 +00:00', '2021-06-16 20:14:09.236376 +00:00', '0776b9e0-596b-4cef-b95e-ee63429403d1', 'Highway Star', 'A struggling rocker is finally discovered, but unfortunately by producers specializing in Korean "country music" (trot). Can he embrace this new career while staying true to his heart as a musician?', null, 6.5, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.236410 +00:00', '2021-06-16 20:14:09.236426 +00:00', '54b93187-60a1-450c-b023-5cf8ef1e1747', 'Fist of the North Star: The Legend of Yuria', null, null, 6.7, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.236461 +00:00', '2021-06-16 20:14:09.236477 +00:00', 'ab2ec7a9-3cfc-448a-915c-9a0584dfc297', 'Star Runner', 'Get ready for the ultimate martial arts competition, where anything goes and lives are bought and sold. Tank is the celebrated Champion Star Runner and is deemed invincible among the martial arts community. When the headstrong Bond becomes determined to take on the undefeated fighter, he knows he must be in the best fighting condition. Training under a renowned martial arts expert, Bond learns to supplement his Thai Kickboxing skills with various styles of Chinese kun-fu, creating a powerful hybrid fighting style. With his new skills, Bond prepares to take on Tank and the fight of his life.', null, 5.2, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.236513 +00:00', '2021-06-16 20:14:09.236529 +00:00', '65fec30e-43e2-4184-ab90-1985442415dd', 'Pick a Star', 'A Cinderella story of a young country girl who comes to Hollywood and achieves movie stardom with the help of a publicity man.', null, 5.5, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.236562 +00:00', '2021-06-16 20:14:09.236578 +00:00', '26cd91c7-0448-4978-98d6-135ba310d51d', 'The Day I Bought a Star', 'A young boy is tired of the city and escapes into the country. Two strangers trade him a strange seed. The boy accepts and the seed sprouts into a miniature planet, which continues to grow.', null, 8, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.236611 +00:00', '2021-06-16 20:14:09.236628 +00:00', 'a1a1d0e2-b564-42df-87f4-ffd0e3cf0492', 'My Dad the Rock Star', 'Being the son of the world famous rock star, Rock Zilla, may sound wonderful for most people, but Willy has a different opinion. All he wants is a normal life and friends who accept him for himself and not because of his parents. When the Zilla family moves to Silent Springs in semi-retirement, Willy sees his chance. However, that normal life will not be easy to find with his wealthy family stirring things up in their own eccentric ways. Regardless, with the help of two newfound true friends, Willy is ready to deal with his unique challenges in a world that is remarkably new to him.', null, 5, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.236663 +00:00', '2021-06-16 20:14:09.236679 +00:00', 'e7f32409-cc55-4af7-ad30-74558a904467', 'Stalked by a Reality Star', 'A teenage girl lies about her age to get into a Hollywood party and meets a handsome reality TV star - but when she finds out he is a creep and rejects him, he becomes obsessed and starts ...', null, 5.1, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.236712 +00:00', '2021-06-16 20:14:09.236728 +00:00', '5e2ac975-90dd-40f6-9f83-31a7cc55e13e', 'The Powers of Matthew Star', 'Matthew Star was a prince on the planet Quadris, who was forced to flee to Earth when his planet''s government was overthrown by despots. On Earth, he took the form of an ordinary high-school student (albeit one with superpowers), and was accompanied by his guardian Walt, who became the school''s science teacher. The American government knew of Matthew and Walt''s origin, and used them to act as agents on occasion.', null, 6.5, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.236763 +00:00', '2021-06-16 20:14:09.236779 +00:00', '01cd80e2-5db8-4914-9a80-74f15a3a1a24', 'Perry Mason: The Case of the All-Star Assassin', 'Thatcher Horton is owner of a Denver sports arena and a couple of sports teams. Bobby Spencer a friend of Ken was one of his hockey players. It seems that Horton verbally promised him that he would take care of him if he gets injured, which happened. Now it seems that Horton is reneging and he has asked Ken to represent him in his suit against Horton. Bobby threatened Horton and not long after that Horton was killed and the murder weapon was found in Bobby''s possession. So Perry comes to help defend Bobby. It seems that Horton was not liked by other people including his wife and son, and it also seems that the killer was a professional assassin, so did one of them hire him?', null, 6.9, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.236818 +00:00', '2021-06-16 20:14:09.236834 +00:00', '6adef276-79a4-484d-81a5-f39cec7aeb2e', 'Five Star Stories', 'The Joker five-star system is under Emperor Amaterasu. Mecha pilot Ladios must save his co-pilot, Fatima-class female android Lachesis, from one of many warlords, who oppose Amaterasu.', null, 6.2, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.236868 +00:00', '2021-06-16 20:14:09.236884 +00:00', 'f2427707-c155-47cb-a6b1-5250013d2482', 'HGTV Design Star', 'Ten aspiring designers seek to impress home viewers and an expert judging panel with their design expertise, ingenuity, creativity and "it" factor during the reality competition, HGTV Design Star.', null, 6.3, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.236918 +00:00', '2021-06-16 20:14:09.236934 +00:00', 'c321a0d6-14df-444b-bdf8-f228500c6de6', 'The Romancing Star', '(Cantonese with English subtitles) Chow Yun-fat in this hilarious offbeat comedy plays Wong, a mechanic who falls for a beautiful rich girl (played by Maggie Cheung). When Wong finds out his friend also like her, he must fight him for her attention', null, 6.3, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.236970 +00:00', '2021-06-16 20:14:09.236987 +00:00', '79e29f45-8b92-4a37-af07-57431d951dbe', 'Super Star Wars: The Empire Strikes Back', 'The fifth episode of the Star Wars trilogy is now on your Super Nintendo! It opens on the ice world of Hoth, where Luke Skywalker and his band of rebels have established a base. They chose ...', null, 7.8, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.237020 +00:00', '2021-06-16 20:14:09.237036 +00:00', 'f241a62c-2157-432a-bbeb-9c579c8bc18b', 'Star Wars: Episode IV: A New Hope - Deleted Scenes', 'Deleted scenes from Star Wars: Episode IV - A New Hope (1977).', null, 8.4, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.237069 +00:00', '2021-06-16 20:14:09.237085 +00:00', 'f927a766-742d-4f2a-9f3b-bb6e65a0c00d', 'Star Search', 'Hosted by Ed McMahon, and later Martha Quinn, this show gave many young talents their first big breaks in show business as they were given the chance to compete in front of a national audience. Performance categories included singing, dancing, modeling and stand-up comedy.', null, 5.4, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.237124 +00:00', '2021-06-16 20:14:09.237141 +00:00', 'd4b010a5-2648-4850-b15d-307658020923', 'Lego Star Wars: Revenge of the Brick', 'Lego Anakin and Obi-Wan stop an invasion on Kashyyyk using the Force to influence their victory against the droid army.', null, 6.1, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.237175 +00:00', '2021-06-16 20:14:09.237191 +00:00', 'fceabcf0-9879-4c76-9ad8-576802df33ff', 'Hayley Wagner, Star', null, null, 5, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.237223 +00:00', '2021-06-16 20:14:09.237239 +00:00', '3c061ba9-49d2-4603-9ab8-d26954e29ef5', 'Under the North Star II', 'Continues to follow the life of a Finnish family from aftermath of the Finnish Civil War to the Second World War which unites the country. But at what cost?', null, 6.7, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.237272 +00:00', '2021-06-16 20:14:09.237288 +00:00', 'da82ccd5-5dc2-4c68-8bc5-01cf3d3001f0', 'Fallout: Red Star', 'Set in the Fallout game universe, this fan film follows the ranger on a mission to find a person of interest.', null, 8.1, 'movie');
