INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.237419 +00:00', '2021-06-16 20:14:09.237436 +00:00', 'aa5aea7a-cd65-4aec-963f-98375b370717', 'The Young Person''s Guide to Becoming a Rock Star', 'An up-and-coming Glasgow based rock band are faced the harsh realities of the music industry on their journey to becoming the next big thing.', null, 8.1, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.237473 +00:00', '2021-06-16 20:14:09.237490 +00:00', '9013f138-eceb-4e25-8a9d-ecbce22229eb', 'Star Fox Adventures', 'It has been eight years since Fox McCloud defeated the evil Andross. Since then, the Star Fox team has been on a slow downturn. Falco, a loyal friend of Fox, decided to leave the team in search of new challenges. Peppy, in his old age, quit his duties as a pilot to focus on navigation, and Slippy did likewise, focusing on his technological developments. While Fox and his comrades are recognized as heroes, they''ve received little in the way of work since Andross''s death, and their ship, the Great Fox, has seen much better days. However, one day, as they''re approaching Dinosaur Planet at the edge of the Lylat System, they receive a message from General Pepper asking Fox to investigate what''s caused the world to suddenly start breaking up and find a way to fix it. At the same time, Dinosaur Planet''s inhabitants are under the dictatorial rule of General Scales, whom Fox must contend with in order to complete his mission. And then there''s the mysterious Krystal, who became trapped in a large crystal after being attacked within Krazoa Palace. Can Fox free her and receive her help to stop General Scales and save Dinosaur Planet?', null, 7.5, 'movie');
