INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.237671 +00:00', '2021-06-16 20:14:09.237687 +00:00', '00e2e781-7af9-4f82-b4e9-14a488a3e184', 'Star Wars: X-Wing', 'Be a Rebel pilot during the Galactic Civil War. Fly the most famous Star Wars starfighters in furious battles against Imperial pilots.', null, 8.1, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.237720 +00:00', '2021-06-16 20:14:09.237737 +00:00', '15c8d623-7b06-48a9-8cdb-feedfbf6e994', 'Star Vehicle', '"Star Vehicle" follows the downward spiral of movie driver Donald Cardini, a self-professed movie buff with a penchant for explosive violence when provoked. Driving the stars of low-budget movies, along with their fragile egos, to and from locations in the middle of nowhere, pushes Don''s buttons in all of the wrong directions. When Luke, the young and self-absorbed writer/director challenges Don''s authority, murder and mayhem ensues. The movie''s Scream Queen'' starlet, Riversa Red, to her dismay finds herself the target of Don''s obsession. With his encyclopedic knowledge of her "body" and body of work, Don worms his way onto Riversa''s good side, no easy task. Not knowing whether to fear or friend Don, Riversa finds herself at the center of a cyclone with Luke and Don both vying for her attention. A mysterious Hotel Bellboy and an unknown "watcher in the woods" lend themselves to the growing suspense as the cast and crew hold-up at Forest Grove Lodge. After a couple of grueling days into the movie shoot, Don goes berserk, getting himself kicked off of the show. But letting go of Don doesn''t come without a price. When he shows up the next day, 9 mm handgun in tow, the cast and crew are forced to act in Don''s own home movie. Those who make a stand are dealt a deadly hand and those that await their fate wish they never stepped into the "Star Vehicle". Once the wheels of horror start rolling, there''s no turning back.', null, 3.2, 'movie');
