INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.237877 +00:00', '2021-06-16 20:14:09.237893 +00:00', '53ce35b8-7a0e-49a3-a2e4-4abc51d8d257', 'Star Trek 25th Anniversary Special', 'A tribute to Star Trek on its 25th anniversary. This film tells the story of how the series (original and Next Generation) and the first six movies came about. Includes plenty of behind-the-scenes looks, clips from the series and movies, bloopers, and interviews with creator Gene Roddenberry, cast members, and NASA officials.', null, 6.9, 'movie');
