INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.237977 +00:00', '2021-06-16 20:14:09.237994 +00:00', 'c20c249f-91ac-4c6a-9afe-f1c85aa9b277', 'Star Hunter', 'Star hunters are the space monsters who hunt helpless creatures for pleasure. One night couple of high school football players and their cheerleaders are returning home after the lost game....', null, 3.1, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.238027 +00:00', '2021-06-16 20:14:09.238043 +00:00', 'f60241d5-119d-42f8-850a-ea56e8a15cf1', 'The Cowboy and the Movie Star', 'Depressed at the thought of losing his family ranch to settle his divorce, cowboy Clint Brannan decides to drive his cattle up to their high pasture. One day into the drive Clint happens across actress Sean Livingston who has run her car off the road in the middle of nowhere whilst out on a drive to clear her head. Faced with the prospect of a two or three day wait for rescue or accompanying Clint on his cattle drive, Sean decides to go on the cattle drive. Completely unprepared for the harshness and privations of living outdoors Sean initially hates the adventure. However, as the drive progresses Sean and Clint start to appreciate the differences and similarities of their respective lives and begin to realize that they have much in common. As the drive progresses fate and the forces of nature intervene to turn the cattle drive into a race against time to reach their destination to save the cattle and then return to civilization as soon as possible to save Clint''s life. Will their fledgling friendship, borne of enforced intimacy, survive and grow or will they go their separate ways?', null, 6.3, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.238079 +00:00', '2021-06-16 20:14:09.238095 +00:00', 'b0752ea4-76fe-4a00-986d-71fb34f908cd', 'The Blue Star Hotel', 'Zuzanka (Natasa Gollov√°) can finally stop toiling away at washing dishes at hotel Mercur after a distant aunt has bequeathed her her own hotel - Blue Star. She proudly marches over to the luxury hotel in the center of town and immediately begins to change the personnel. Because this involves the facilities belonging to a joint-stock company, which no one can inherit, she is considered insane. It comes out that her inheritance is in reality a small, shabby little hotel of the same name in the IV town district. The personnel are three unemployed youths who in this way work off the money they owe for rent. The first guest is wealthy Vladim√≠r Rychta Rohan (Oldrich Nov√Ω), whose parents spent their honeymoon in this very hotel. He wants to celebrate his wedding there, with which his fianc√©e Milada (Adina Mandlov√°), who is waiting for him at the luxurious Blue Star, does not concur.', null, 7.4, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.238133 +00:00', '2021-06-16 20:14:09.238150 +00:00', '2a18ca80-d2b8-4037-be3c-0a3430992543', 'Super Star Wars', 'Star Wars comes to life on the Super Nintendo. The fourth chapter in the soon to be completed Star Wars trilogy. As the scene sets, a Star Destroyer is firing at a Rebel Blockade Runner, ...', null, 7.8, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.239092 +00:00', '2021-06-16 20:14:09.239108 +00:00', 'f553752e-71c7-4ea0-b780-41408516d0f4', 'Star Wars Empire at War: Forces of Corruption', 'Tyber Zaan, a crime lord, is freed from prison and creates an empire of crime and destruction named after himself. He then begins his wuest for control of the galaxy, destroying Rebels and Imperial alike.', null, 8.1, 'movie');
