INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.238183 +00:00', '2021-06-16 20:14:09.238200 +00:00', 'cc917adf-6327-4773-bc21-936995f84391', 'Journey''s End: The Saga of Star Trek - The Next Generation', 'Your destination: the 24th century. Your mission: to voyage where few have gone before--behind the scenes of Star Trek: The Next Generation! Join Jonathan Frakes, Next Generation''s Commander William Riker, for this fascinating chronicle of Gene Roddenberry''s beloved, Emmy Award-winning series. You''ll explore the Enterprise, meet the show''s stars (and some villainous guest stars), learn special-effects secrets and makeup magic, and finally get the answer to that nagging question, "Where is the bathroom on the Enterprise?" Other highlights include a visit to a Star Trek convention, and a stop at the scoring stage to watch Marina Sirtis (Lt. Commander Deanna Troi) lead the orchestra in a recording session. This program concludes with a special look at the series'' thrilling final episode ("All Good Things . . .") and a sneak peak at the crew''s movie debut, Star Trek: Generations. So set a course for an adventure like no other.', null, 7, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.238236 +00:00', '2021-06-16 20:14:09.238253 +00:00', 'd56f5630-fe52-458a-a5c8-5a0777127b86', 'Star Struck', 'Runner and Robyn were summer camp sweethearts. She became a Hollywood star and Runner stayed at the farm. Finally Runner takes grandma''s advice and goes LA to win his lost love back. He gets a job as her gofer but she doesn''t recognize him. Everyone thinks his down-to-earth ''nice'' is an act, while he keeps hoping Robyn will remember...', null, 5.1, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.238287 +00:00', '2021-06-16 20:14:09.238303 +00:00', 'dbec7abc-4ad6-4ec6-a78d-73efef83f307', 'My Lucky Star', 'The Barthelemys have been training racing horses, trotters, for generations. After tragedy befalls Pierrot Barthelemy, his family''s inheritance seems at stake. Can his daughter and his sole mare, Marquise, save the family from ruin?', null, 6, 'movie');
