INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.238435 +00:00', '2021-06-16 20:14:09.238451 +00:00', '490c91a4-99f1-422d-9a87-ae759acffc09', 'Lego Star Wars: The Yoda Chronicles - Menace of the Sith', 'Darth Sidious shows off the new Sith clone JEK who is an extremely powerful weapon. But JEK wants to be his own master and suddenly, both the Jedi and the Sith try to win him over. It now remains to be seen which side he chooses.', null, 7.2, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.238487 +00:00', '2021-06-16 20:14:09.238504 +00:00', 'f40cffc5-723d-4c84-98b1-3d8fc324727d', 'Star Wars Battlefront: Renegade Squadron', 'The story in this game follow the previously secret "Renegade Squadron" that was made up of the galaxy''s toughest scoundrels. As the plot unfolds, players learn how Han Solo recruited and assembled his team and used their many talents for missions in Korriban''s Valley of the Sith, the rocky remains of Alderaan, and the fiery ashes of the volcanic planet, Sullust. In addition to single-player story missions, Renegade Squadron allows up to 16 players to compete via Infrastructure mode (eight-person support for ad hoc), with a special 100-point spending system to purchase custom kits with more than a million different combinations that can be used to create unique Star Wars characters.', null, 8.2, 'movie');
