INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.238588 +00:00', '2021-06-16 20:14:09.238605 +00:00', 'b8bb8ea6-93c8-4c80-9897-1f9b00b1265b', 'I''m a Porn Star', 'I''m a Porn Star follows the lives of guys in the neighborhood who are likely a lot more famous than you - at least on the Internet. There are an estimated 370 million pornographic websites on-line. Porn is now a thirteen BILLION dollar business. So who''s doing all this moonlighting? Turns out -- probably some people you know.', null, 5, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.238639 +00:00', '2021-06-16 20:14:09.238655 +00:00', 'eda3be8d-d0bd-4cf6-84ed-7bf80c371605', 'Star Trek: Legacy', 'Jonathan Archer, the captain of the first Enterprise, is asked by the Vulcans to retrieve one of their ships that went missing. He locates and saves the ship from the Romulans, but the ship''s mysterious captain T''Uerell decides to use him for her own gain. First Archer, then Kirk, and finally Picard, Sisko and Janeway, will all have to face this dangerous individual in their own eras in order to save the Alpha Quadrant. While Archer, Kirk and Picard each star in one-third of the game, Sisko and Janeway show up only in two of Picard''s missions.', null, 6.5, 'movie');
