INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.238942 +00:00', '2021-06-16 20:14:09.238959 +00:00', '9b21babd-5eb7-432b-8d2b-d28980b740f1', 'Tri-Star', 'A priest hears a prostitute''s confession, a tale which has a 200,000 HK$ debt as its centerpiece. The prostitute accidentally leaves behind an envelope with her address in the confessional. Concealing his true occupation, the priest rents another room in her apartment and begins to straighten out her life. But then the prostitute starts to fall in love with the priest...', null, 6.3, 'movie');
