INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.239142 +00:00', '2021-06-16 20:14:09.239158 +00:00', '2927beba-7e77-4d7e-b22d-a65fda159f72', 'Star Wars: Rebel Assault II - the Hidden Empire', 'When a Rebel patrol goes missing in the Dreighton Nebula, Rebel pilot Rookie One heads out to investigate and discovers a large Imperial presence in the area. With the help of his fellow Rebels, Rookie One uncovers a plan by Darth Vader to destroy the Alliance by developing an army of "cloaked" Phantom TIE Fighters.', null, 7.8, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.239192 +00:00', '2021-06-16 20:14:09.239209 +00:00', '07eb0a2b-b651-446b-895b-2718bd318ce8', 'Star Ocean: Till the End of Time', 'A young 19 year old college student Fayt Leingod and his family are having fun on their vacation in Hyda. While Fayt and his childhood friend Sophia Esteed strolls around the hotel and play the battle simulator, an unknown space force attacks Hyda. Fayt and Sophia were forced to evacuate the hotel and they meet up with their parents. However, Fayt and Sophia were separated from their parents after their escape route falls under attack. Fayt and Sophia later boards the Helre that is heading to Remote Station #6. But however, the Helre went under attack by the space force and everyone was forced to evacuate. Fayt and Sophia boards their escape pods, but they were separated and Fayt lands in the planet Vanguard III. With Fayt by himself, how will he able to find a way back to Sophia and his parents? Fayt must do something about this.', null, 7.9, 'movie');
