INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.239505 +00:00', '2021-06-16 20:14:09.239521 +00:00', '1917e948-d6b7-457e-b450-d4bbdc678474', 'Star Wars: X-Wing Alliance', 'You play a young freighter pilot who eventually must join the rebellion against the Empire.', null, 8.4, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.239554 +00:00', '2021-06-16 20:14:09.239570 +00:00', 'f94cfce9-fa49-4d36-ab4f-ae0ac9b6037b', 'Diego Star', 'A serious accident occurs on board the Diego Star, a dilapidated Russian cargo ship. Traore, a mechanic from the Ivory Coast, is unfairly blamed for it. The ship is towed to the nearest shipyard for repairs. In the interim, crew members find shelter with the inhabitants of the small local village. Far from everyone he loves and knows, Traore is engulfed by the Quebec winter.', null, 6.7, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.239604 +00:00', '2021-06-16 20:14:09.239620 +00:00', '06bd9964-5617-460b-a1bf-74542e89fe43', 'Star Trek: 30 Years and Beyond', 'A star-studded tribute to Star Trek on its 30th anniversary, hosted by many of the stars and guest stars from all of the Trek series and movies. Also features a huge number of clips from all of the series and movies. At the end, real-life astronauts Aldrin and Jemison present NASA award plaques to the cast members.', null, 7.7, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.239654 +00:00', '2021-06-16 20:14:09.239670 +00:00', '12fa1213-c3de-4b62-a3b6-8c939e2addcf', 'Star Time', 'A delusional misfit becomes suicidal when his favorite TV show is cancelled. An agent promises to make him a TV star if he kills certain people, so he becomes "The Baby Mask Killer."', null, 5.8, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.239704 +00:00', '2021-06-16 20:14:09.239720 +00:00', '23d9e50e-5a74-4add-b844-6143b5447ee2', 'A Beautiful Star', 'It portrays a family on Earth who come to believe that they are actually from other planets all of a sudden. They try so hard to save the endangered planet Earth but things get crazy on the way.', null, 5.7, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.239753 +00:00', '2021-06-16 20:14:09.239769 +00:00', 'f73b492e-751e-446a-8c95-c291545033d8', 'Star Spangled Girl', 'A pair of 60''s hippies fall in love with the girl next door, who is exactly the kind of square that they are fighting against.', null, 5.5, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.239802 +00:00', '2021-06-16 20:14:09.239818 +00:00', '035c0aa4-ab66-4088-af9e-b66e76e90059', 'Star Trek: The Experience - Borg Invasion 4D', 'A combination of an interactive 3D movie and a stage performance, Borg Invasion 4D was a Star Trek: Voyager-based attraction, part of the Star Trek: The Experience series of attractions at the Las Vegas Hilton in Paradise, Nevada. Borg Invasion 4D ran from 2004 to 2008. The audience enters a small theater where physically present actors portraying the Star Fleet crew greet them. The story is told through prerecorded 3D film sequences and actors'' interaction with them and the audience. The story takes place some time after the end of the ST: Voyager series. The audience takes the roll of guests on a secret space station where Doctor from Voyager works with researches on creating a new DNA strain that will be resistant to the Borg''s assimilation techniques. The guests are there to have themselves tested and help the research in case their DNA contains the resistant strain. Then the Borg attack. Actors lead the audience through a couple of hallways as other actors dressed as the Borg assimilate the researchers. Finally, the audience and the "surviving" actors reach another small theater that represents an escape shuttle and there a new series of prerecorded 3D film sequences starts. The shuttle launches but the Borg cube with the Queen inside captures it. As the Queen taunts the audience, the Borg are tearing the shuttle apart. Just as they are about to reach the audience, a familiar, charmingly raspy, friendly female voice is heard as well as the sound of proton torpedoes. She disagrees that resistance is futile and is there to prove it.', null, 8, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.239858 +00:00', '2021-06-16 20:14:09.239874 +00:00', 'b1a2aae8-5c9e-4583-b89e-883c0d0c969a', 'Star Trek: Elite Force II', 'After the long return journey of the USS Voyager to the Federation, the elite Hazard Team finds themselves declared redundant and disbanded. You play Lt. Munro, the leader of the team who is relegated to being an instructor at Starfleet Academy. After years at the unexciting post, your fortunes change dramatically when Capt. Picard himself has the team reassembled and assigned to the Enterprise. The good captain''s wisdom could not have been better placed as the Enterprise is sent to investigate the loss of contact with the USS Dallas. Leading your Hazard Team, you find yourself at the front line when you discover a formidable new enemy who represents a terrible threat to the galaxy and it will require all your courage and cunning to stop it.', null, 8.5, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.239909 +00:00', '2021-06-16 20:14:09.239925 +00:00', '8a9981d0-98c4-447a-9709-742fe7f6d9dc', 'Star Trek: Bridge Commander', 'Space combat simulation about the new Captain of U.S.S. Dauntless, who must investigate why a star suddenly went supernova. The player must work with Captain Picard, Commander Data, and other allies to stop a new Cardassian threat.', null, 8.3, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.239959 +00:00', '2021-06-16 20:14:09.239975 +00:00', '71948ef1-0cb2-4ce5-ad20-7c10764b0e42', 'Star Cops', 'The adventures of the International Space Police Force, led by Nathan Spring, in 2027. The Star Cops are made up of officers from all over the world: the British Colin Devis, the Australian...', null, 7.4, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.244368 +00:00', '2021-06-16 20:14:09.244383 +00:00', 'e5974732-dce9-42ea-a26c-269e5047cb6d', 'Date My Porn Star', 'Three British porn addicts, Kevin, 20, Danny, 26, and Jonathan, 40, go to America to meet their favourite stars, and witness the harsh realities behind the factories of fantasy.', null, 5.9, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.245482 +00:00', '2021-06-16 20:14:09.245498 +00:00', '7a72d59b-61a5-4450-bf7c-b5fac4605cb1', 'A Star Is Hatched', 'Emily the chicken, lives in Hickville but dreams of Hollywood. Her chance comes when director J. Megga-Phone happens to drive past and gives her his card. She makes her way to Hollywood, and Megga-Phone''s office, where she discovers a whole flock of hens with the same card and a completely uncaring Megga-Phone. She returns home to faithful Clem, and a chick with foolish notions.', null, 6.4, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.240008 +00:00', '2021-06-16 20:14:09.240024 +00:00', '58ab4c74-8956-451b-a589-4a9651aee869', 'Fluffy Cumsalot, Porn Star', 'Fluffy Cumsalot, Porn Star is an extraordinary documentary about porn stars and their stage names. Featuring Ron Jeremy, Marilyn Chambers, Jenna Jameson, Seymore Butts and over 70 more of the world''s top porn stars, this film is a fascinating and revealing documentary about adult performers and the origin of their on-screen names. At 57 minutes, the film takes a very significant look at an under appreciated aspect of the porn industry - names. How did Ron Jeremy become known as ''The Hedgehog''? Fluffy Cumsalot, Porn Star examines this and goes further by asking legitimate porn stars how they came up with their current stage names and what their names would be if they had used the formula - your first pet and the name of the street that you grew up on. What results are some truly amazing and interesting stories intertwined with footage from movies , interviews and public appearances.', null, 4.6, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.240063 +00:00', '2021-06-16 20:14:09.240079 +00:00', 'd659ae8e-c32c-43ac-90a0-e71d85777724', 'Hyper Sapien: People from Another Star', 'Three aliens from the planet Taros land on Earth and are befriended by a Wyoming rancher''s son.', null, 5, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.240115 +00:00', '2021-06-16 20:14:09.240132 +00:00', '7b1c1238-6e7f-4e8c-8911-10a749dfb8ad', 'Captain Star', 'Captain Star, and his crew, Navigator Black, Atomic Engine Stoker "Limbs" Jones, and first officer Scarlette are on an uncharted planet at the ragged edge of the universe, awaiting further orders from mission control.', null, 7.6, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.240165 +00:00', '2021-06-16 20:14:09.240181 +00:00', 'c9c21254-709c-4c25-bb33-97aa1a517fb6', 'Star Reformer', null, null, 6.4, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.240214 +00:00', '2021-06-16 20:14:09.240230 +00:00', '0d79e7f3-842f-4006-aa1c-f18e4e76abbe', 'A Star for Two', 'Teenage lovers in the 1940s are separated by World War II and then later reunited in the 1980s, but encounter new complications when they try to rekindle their relationship..', null, 7.2, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.240263 +00:00', '2021-06-16 20:14:09.240279 +00:00', '0c348282-65e0-4ff9-9eb3-ddc26bf1cb96', 'Lego Star Wars: The Yoda Chronicles - Attack of the Jedi', 'The tide of the war has turned. Darth Sidious'' plot to create an army of Sith Clones has failed.', null, 7.4, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.240313 +00:00', '2021-06-16 20:14:09.240329 +00:00', '17f634cd-9581-4ba1-b40b-89ee058c3f55', 'Star Wars: Episode I - Jedi Power Battles', 'A long time ago, in a galaxy far, far away... the small, peaceful planet of Naboo is under seige from the greedy Trade Federation. Only the Jedi Knights can stand against this threat and a much greater menace, the return of the Sith.', null, 7.1, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.240362 +00:00', '2021-06-16 20:14:09.240378 +00:00', '714a1698-d568-4e0e-b339-c23c33a3444b', 'Star Garden', 'An experimental film by Stan Brakhage combining family footage with various narratives about the stars.', null, 6, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.240411 +00:00', '2021-06-16 20:14:09.240427 +00:00', '835dcbe5-2bbc-40a3-8980-eb5605f0e3bf', 'The Force Is with Them: The Legacy of ''Star Wars''', 'The Force Is with Them: The Legacy of Star Wars is a Video Documentary included in the 2004 DVD of the Star Wars Original Trilogy. It explained the impact of "Star Wars" on various directors and actors.', null, 7, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.240460 +00:00', '2021-06-16 20:14:09.240476 +00:00', '86607a8f-bc90-47fa-8261-15647186cbf5', '50 Years of Star Trek', 'The cast , crew , creators & critics discuss the impact of Star Trek from its creation by Gene Roddenberry to the present into today and the future. Showing clips from the original unaired pilot featuring Jeffery Hunter from 1965 to 9/8/1966 the 1st show aired. 50 years of dialog, the movies and what we can expect next.', null, 7, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.240510 +00:00', '2021-06-16 20:14:09.240525 +00:00', 'bf347d28-65ab-4e0c-b29a-74d68487966e', 'White Star', 'A rock music reporter and his view of the angry excited punk generation.', null, 6, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.240558 +00:00', '2021-06-16 20:14:09.240574 +00:00', 'd97fee2d-d9e0-4372-847d-b2aab8fd5d4b', 'Jenna''s American Sex Star', null, null, 5.6, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.240606 +00:00', '2021-06-16 20:14:09.240622 +00:00', '7f17916c-b4e1-4a3b-b22b-02ae49144d54', 'Legends of the Dark King: A Fist of the North Star Story', 'Focuses on the formation of an empire, specifically a hegemony, by an inheritor of the fist of the north star, Raoh. Accompanied by his two loyal comrades Souga and Reina, as well as a mysterious woman named Sakuya, Raoh will begin this journey of conquest while at the same time trying to prove his own way of thinking.', null, 6.7, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.240656 +00:00', '2021-06-16 20:14:09.240672 +00:00', 'e996369b-d49e-4fbb-8563-c17561dca515', 'Star Wars Galaxies: An Empire Divided', 'Be an alien or a human, a Rebel, an Imperial, a smuggler or a simple bartender; be what you want during the Galactic Civil War in a virtual online galaxy.', null, 6.9, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.240708 +00:00', '2021-06-16 20:14:09.240724 +00:00', '78c73283-cd39-48d8-aa59-9f573f740030', 'The Belle Star Story', 'Abused and dominated by men in her youth, Belle Starr now out-rides, out-smokes, out-shoots, and out-gambles them as she makes her way around the Old West, usually wearing male garb. One man who''s her equal is Larry Blackie with whom she has an on-again, off-again relationship which is often argumentative and sometimes violent. Together they become involved in a robbery which goes awry. Belle has to rescue Larry and though he''s grateful, he now wants to go his own way. However, he expresses the hope that someday they''ll once more cross paths and then ... who knows?', null, 5.3, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.240763 +00:00', '2021-06-16 20:14:09.240779 +00:00', 'a8f6bd5b-036a-4d79-b952-3c7b5aa3ea83', 'Star Wars: Hoshino', 'The tale of blind Jedi Master Ko Hoshino and her path to becoming one with the force.', null, 7.4, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.240812 +00:00', '2021-06-16 20:14:09.240828 +00:00', 'a06b576f-a9c3-4a26-94db-9cf85ad8f3ec', 'Star Wars: The Empire Strikes Back', 'A Star Wars game for the Atari 2600.', null, 7.9, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.240861 +00:00', '2021-06-16 20:14:09.240877 +00:00', 'f3731b08-80b1-4687-aa31-62c483eb24ef', 'Yogi Bear''s All-Star Comedy Christmas Caper', 'Dear Jellystone Visitors, Happy holidays from the Big City! Boo Boo and I left Jellystone Park to spend the most wonderful time of the year metropolitan-style, with friends Snagglepuss, Quick Draw McGraw and the gang! Luckily, I outwitted Ranger Smith with my department store Santa disguise. Our adventure led me to Judy, a girl who wants to spend more time with her workaholic dad. Who knew my love of pic-a-nic baskets would reunite them at a big city Christmas picnic in the park? Join the merrymaking, but get here before the basket is empty! The Flintstones, Huckleberry Hound, Auggie Doggie, and more friends also join us, making this Christmas caper full of our favorites. -- Yours Truly, Yogi Bear', null, 6.9, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.240913 +00:00', '2021-06-16 20:14:09.240929 +00:00', 'd00b4974-e2fd-4bb3-9a7d-10df8fa2f737', 'Britney Spears: ''Star Baby'' Scrapbook', null, null, 2.6, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.240961 +00:00', '2021-06-16 20:14:09.240977 +00:00', '6ed3a1f3-7259-4773-a44a-29932d814fdf', 'Star Maidens', 'TV series of British/German origin, and set in the "present" Earth of the 1970s. A planet from another solar system drifts into Earth''s system and is detected by some Earth scientists who investigate. The surface of this planet is no longer habitable and the residents have moved to a high-tech underground city. The society is ruled by the women, who of course, are all beautiful. Men are considered mentally inferior and are divided into two categories: the "adequately intelligent" who are selected by women to act as their personal "domestics" for household chores, and the remainder who are forced to perform menial labor under the supervision of female guards. The guards are attired nicely in visored helmets, boots, hot pants, and elbow-length gloves which are used to control the men through some sort of apparent force. Scientists from Earth (one men and one woman) find their way to the planet, and are forced to take their stated places in society. The man is chosen as a domestic, sometimes is forced to work on a city maintenance crew, and the woman is assigned a white-collar job. The aliens also visit Earth clandestinely in their tear-drop shaped ship. Some episodes bluntly address the issue of unfair discrimination based on sex.', null, 6.5, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.245531 +00:00', '2021-06-16 20:14:09.245547 +00:00', '064cc5d2-0b73-422d-92f8-1a418d583954', 'Natural Born Star', 'This is the story of your greatest dream and worst nightmare. It''s a story about visions and dreams, about sailing and wreckage. Natural Born Star is the story of Fred Robsahm.', null, 7.5, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.245580 +00:00', '2021-06-16 20:14:09.245595 +00:00', '2bb5d323-0e56-4f86-ae38-34c63fffb7bf', 'Star Wreck 3', null, null, 6, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.241013 +00:00', '2021-06-16 20:14:09.241029 +00:00', '6f8dc3c8-2221-473f-81ff-0c25ad2c01a0', 'The Broken Star', 'A deputy marshal is ordered to investigate the killing of a Mexican ranch hand by a fellow deputy, who claims self-defense. Using turn of the century forensic science and dogged determination, the deputy breaks down his partner''s alibi and discovers that the lawman had killed the rancher for eight thousand dollars in gold that had been hidden in the Mexican''s home. Now he must arrest his friend before the Mexican''s gunslinging friends can kill him before he''s tried for the crime.', null, 5.9, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.241064 +00:00', '2021-06-16 20:14:09.241080 +00:00', 'db594b91-a587-48c4-bac9-5c6be5e4cf33', 'Star Trek: Starfleet Academy', 'In this FMV space combat simulator with elements of an adventure game, you play David Forester, a young human cadet at Starfleet Academy who is going through the extensive command training system that uses several simulator scenarios of missions with a variety of ship classes. In addition, you interact with your various classmates with the mundane situations on campus. You also have some meetings with Captain Hikaru Sulu and Pavel Chekov while Captain James T. Kirk assigns the missions. Through various dialogue options and other choices, you shape your story and must prove to yourself, your crew that''s prone to infighting and Kirk that you are worthy of the captain''s chair. The true test though arrives when your Vulcan member of the bridge crew gets hurt in an explosion. The first signs of a conspiracy that wants to push the Klingons and the Federation into another bloody conflict emerge here. You must also solve the mystery of a living spaceship created by an unknown alien race that uses unique form of communication and either wants to make first contact, or attack.', null, 8.1, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.241115 +00:00', '2021-06-16 20:14:09.241131 +00:00', '355ec912-9e1d-4c4c-9a46-0d7b7fe4de75', 'Be My Star', 'A girl''s everyday life at the end of her school days, trying to find a way into society and her own life.', null, 6.8, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.241164 +00:00', '2021-06-16 20:14:09.241180 +00:00', 'a2002931-73bc-4331-8381-c62af1ac2c46', 'Second Star to the Left', 'Seasonal animation in which a hamster, a rabbit and a guinea pig embark on a journey to deliver a Christmas present lost by Santa Claus.', null, 7.3, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.241214 +00:00', '2021-06-16 20:14:09.241230 +00:00', 'a9bbc1d8-bb8a-41d2-b61a-d8ddc9b31ede', 'Amy Winehouse: Fallen Star', 'A biography on the life of Amy Winehouse.', null, 1.8, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.241263 +00:00', '2021-06-16 20:14:09.241279 +00:00', '92dcddff-a70e-497c-92dc-0da12d1d528a', 'Exile: A Star Wars Story', 'Set 4 years before the battle of Yavin after the tragedy of Order 66, Jedi Master Boemana and Padawan Makal, flee to the outer rim close to the planet of Lothal in an attempt to hide from the newly formed Galactic Empire, pioneered by Lord Sidious and apprentice Darth Vader who have wreaked havoc on the galaxy.', null, 5.8, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.241313 +00:00', '2021-06-16 20:14:09.241329 +00:00', '077bd537-3d97-42d5-8d77-19c17426fe76', 'Star Wars: X-Wing vs. TIE Fighter', null, null, 8.2, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.241362 +00:00', '2021-06-16 20:14:09.241378 +00:00', '0fcfe6c1-8b9e-444c-b458-2787af80533c', 'Star Wars: Rogue Squadron III - Rebel Strike', null, null, 8, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.241410 +00:00', '2021-06-16 20:14:09.241426 +00:00', '9e1ec2e3-336e-4b9f-a6e0-f93c2ea9ee6d', 'Star Trek: Beyond the Final Frontier', 'Forty years after the start of the Star Trek phenomenon, Paramount commissions Christie''s auction house in New York to sell over a thousand original artifacts (spaceship models, costumes, and props) used in the production of the five television series and ten feature films.', null, 7.3, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.241460 +00:00', '2021-06-16 20:14:09.241476 +00:00', 'b577d989-9e9e-4f18-a3ba-00d79d239968', 'Pup Star: Better 2Gether', 'The action-packed new season of the franchise continues with the story of Tiny, an adorable Yorkie pup who, after winning the ''Pup Star'' TV singing competition, is suddenly launched into an adventure when she''s replaced by a street Yorkie, Scrappy, and the two swap lives in a dog-filled, fish-out-of-water tale that ultimately demonstrates life truly is ''better together.''', null, 4.5, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.241514 +00:00', '2021-06-16 20:14:09.241530 +00:00', '0aad2df4-9afc-4592-8614-f37da9319ad0', 'Star Spangled Banners', 'In their late teens and early 20''s, the Banner siblings - Mitchell, Desiree and Danny - made it big as a rock group, but at the height of their fame, Desiree decided to leave the group, and everything fell apart. Now, fifteen years later, their mother has a plan to bring the group back together and heal her family. But will the siblings be able to put aside their differences and reunite, or will they remain estranged forever?', null, 5.7, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.241567 +00:00', '2021-06-16 20:14:09.241584 +00:00', '44496348-3201-45c3-848f-756d7b02b6fd', 'Puppy Star Christmas', 'A song-filled new Air Bud ''Pup Star'' movie that introduces four new pups to the family, who stow away on Santa''s sleigh and find themselves trapped at the North Pole, trying to save the world''s Christmas spirit.', null, 3.4, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.241617 +00:00', '2021-06-16 20:14:09.241633 +00:00', '489d2054-ccf2-4017-abb2-ec0bc5ec1195', 'Anything for a Pop Star', 'The pop band Slavabody Disco Disco Boys announces that it will play in Brazil. Fans of the group, teenagers and best friends Gabi, Manu and Ritinha go out of their way to let their parents let them watch the show in another city.', null, 4.7, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.241667 +00:00', '2021-06-16 20:14:09.241683 +00:00', '7c6c5f66-4322-483d-8307-655294185026', 'All About Ann: Governor Richards of the Lone Star State', 'The life story of Ann Richards, the hilarious straight-talking Governor of Texas who fought special interests for the people and ultimately lost re-election to the first ever pairing of George W Bush and Karl Rove. Celebrities, family members, and personal friends tell the behind-the-scenes battle stories of how a housewife rose to the most powerful position in a good-old-boy state.', null, 7.8, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.241717 +00:00', '2021-06-16 20:14:09.241733 +00:00', '309ff28e-808a-4547-abe7-81d683cfd244', 'Nashville Star', 'In a twist on American Idol (2002), amateur singers compete for several weeks to see which one will be selected by viewers'' votes as the next country music superstar.', null, 4, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.241766 +00:00', '2021-06-16 20:14:09.241782 +00:00', '3f48fd97-0a1e-4af2-bbd0-1dbb1ae2135e', 'Star Without Light', null, null, 6.3, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.241814 +00:00', '2021-06-16 20:14:09.241830 +00:00', '6d647d21-0443-47f2-ab0c-c1aab661c9a1', 'Star Falls', 'Star Falls follows teen Sophia who persuades a Hollywood star, Craig Brooks, and his family to live in her house while he shoots a movie in town, hoping that he''ll fall in love with her mom.', null, 4.6, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.241863 +00:00', '2021-06-16 20:14:09.241879 +00:00', 'c65bb6de-baff-409e-99be-be06f18b1068', 'The Universe''s Star', 'This is the love story between gifted singer-songwriter Woo-Joo and the angel of death Byul.', null, 7.3, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.241912 +00:00', '2021-06-16 20:14:09.241928 +00:00', '2cc4c0c3-411a-416a-90c4-44d45ee08e35', 'Lucky Star', 'An ambitious couples got in to trouble when a surrogate plan went wrong but luck comes when the baby comes to their life.', null, 5.4, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.241961 +00:00', '2021-06-16 20:14:09.241977 +00:00', '94d12e9c-612b-4d31-a868-947e37711e08', 'Star Wars Uncut: Director''s Cut', 'In 2009, Casey Pugh asked thousands of Internet users to remake "Star Wars: A New Hope" into a fan film, 15 seconds at a time. Contributors were allowed to recreate scenes from Star Wars however they wanted. Within just a few months SWU grew into a wild success. The creativity that poured into the project was unimaginable.', null, 6.7, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.242011 +00:00', '2021-06-16 20:14:09.242027 +00:00', 'f6bc0427-951a-4ab7-963b-f4f5981bed52', 'Star Trek: Borg', 'You play a Starfleet officer whose father was killed at Wolf 359 and are upset when Starfleet won''t allow you to participate in repelling the current Borg attack. Q steps in and makes you a deal-with-the-devil offer: he will take you back to the Battle of Wolf 359 to prevent your father''s death.', null, 7.3, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.242061 +00:00', '2021-06-16 20:14:09.242077 +00:00', 'ac120a7e-da82-4383-a724-41cfd811e37d', 'Star Wars: Jedi Starfighter', null, null, 7.2, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.244268 +00:00', '2021-06-16 20:14:09.244284 +00:00', '6067058b-a894-4062-b17d-88e3ebfe5617', 'A Few Moments with Eddie Cantor, Star of ''Kid Boots''', 'In one of the earliest experiments with synchronized sound, Eddie Cantor does his vaudeville act (stand-up comedy and songs) against a plain backdrop.', null, 6.5, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.245626 +00:00', '2021-06-16 20:14:09.245642 +00:00', 'e891bebc-786c-4fe8-948e-c6d4007146f9', 'Odyssey: A Star Wars Story', null, null, 6.5, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.245673 +00:00', '2021-06-16 20:14:09.245689 +00:00', '1a3c33ac-762b-442e-b84c-1d0af86a00d8', '''Star Wars'': Feel the Force', null, null, 7.1, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.242109 +00:00', '2021-06-16 20:14:09.242125 +00:00', '08c25ef9-cbd3-4368-8887-9ef884334750', 'Ultimate Trek: Star Trek''s Greatest Moments', '"The Trouble with Tribbles" . . . "The Best of Both Worlds" . . . "Trials and Tribble-ations" or "Scorpion." Which one is the greatest Star Trek episode of all time? Tonight, you decide! Take a hilarious journey through Federation space with Captains Kirk, Picard, Sisko, Janeway and the bravest crews in the galaxy. From dangerous villains to outrageous one-liners, this all-encompassing retrospective captures the greatest moments in Star Trek history. Challenging trivia questions and never-before-seen outtakes make Ultimate Trek the ultimate ride. Get ready to experience entertainment at warp speed!', null, 6.1, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.242163 +00:00', '2021-06-16 20:14:09.242179 +00:00', 'f899974f-198f-49f3-89f0-f13128bfaafb', 'Star Warp''d', null, null, 4.7, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.242212 +00:00', '2021-06-16 20:14:09.242228 +00:00', 'e3153398-ed5b-48af-9f33-239e536ed160', 'Star Trek: Armada', 'A mysterious craft from the distant future warns the 24th Century about a Borg invasion of the alpha quadrant. The Federation, Romulans, Klingons, and other races of the Alpha Quadrant team up to battle the Borg to change history, but in the process they battle each other.', null, 8, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.242261 +00:00', '2021-06-16 20:14:09.242277 +00:00', '64675410-e322-40fd-ab4d-1b53bb3f0a07', 'Star Trek Online', null, null, 7.9, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.242310 +00:00', '2021-06-16 20:14:09.242326 +00:00', '8c10ae99-80df-4dcb-929f-2f8dcf15f994', 'Star Driver', 'On a cross-shaped island in the South, a mysterious and gigantic humanoid robot known as the "Cybuddy" is discovered sealed in the underground ruins for untold ages. A group known as the "Order of the Glittering Star Cross" attempts to remove the seal by abducting a girl named Wako Agemaki, who they dubbed the "shrine maiden" and is the key to activating the robot. A boy named Takuto Tsunashi arrives with his own Cybuddy named Tauburn to rescue Wako. Thus begins a struggle to unlock the secrets of the advanced technology and prevent disaster.', null, 6, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.242360 +00:00', '2021-06-16 20:14:09.242376 +00:00', '5a52f354-0dd8-4a90-9b66-4e68aa102e1f', 'Meet Your Star', null, null, 3.3, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.242408 +00:00', '2021-06-16 20:14:09.242425 +00:00', '38c27677-21c8-4dfe-b610-f96a4bb905ed', 'Lone Star Law', '"Lone Star Law" features the men and women of the Texas Game Wardens who protect more than a quarter-million square miles of deserts, lakes, piney woods, bayous, plains and coast in the second-largest state in the U.S. Whether rushing to investigate poaching cases, save flash-flood victims, disrupt illegal smuggling rings, or rescue injured wildlife, the officers are always on the go, defending both animals and citizens. Animal Planet expands its family of wildlife law enforcement series, adding to Maine''s "North Woods Law" an offering that follows an elite patrol force in Texas.', null, 8, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.242459 +00:00', '2021-06-16 20:14:09.242475 +00:00', 'ca3a8b7d-15cd-48d4-8cef-f02b225d04cb', '9 Muses of Star Empire', '''9 Muses of Star Empire'', a year-long chronicle that follows a journey of an all girl pop group ''9 Muses'', portrays the every-day life of nine girls, relentlessly pursuing their dreams in a world of jealousy, betrayal, and scandal. ''9 Muses'' is an emerging girl group, aspiring to perform on a national stage and gain world-wide fame just like millions of others. For that, the girls have decided to set everything aside and live as one of the Muses for ''Star Empire''; the entertainment company which created and coordinated every move. What''s the price they must pay for their dreams?', null, 6.1, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.242510 +00:00', '2021-06-16 20:14:09.242526 +00:00', 'c35dc09c-8ace-46be-8941-7e50b768ec33', 'Star Wars', 'Luke Skywalker, a young farmer from the desert planet of Tattooine, must save Princess Leia from the evil Darth Vader.', null, 6.6, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.242559 +00:00', '2021-06-16 20:14:09.242575 +00:00', '07bad56a-4b46-4dd8-a594-64fac39f4fb0', 'Star Wars Tech', null, null, 7.2, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.242607 +00:00', '2021-06-16 20:14:09.242623 +00:00', '594f7080-f98a-4d82-afed-96badb082782', 'Paper Star', 'Anna Kelanen is an ex-model, who just has been released from prison. She thinks back on her life, when she was a rather successful model, and on the things that went wrong.', null, 5.8, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.242656 +00:00', '2021-06-16 20:14:09.242672 +00:00', '2e5561a2-bb7f-48d3-8249-fb668db6014a', 'Lunar: The Silver Star', 'From the village of Burg, a teenager named Alex sets out to become the fabled guardian of the goddess Althena...the Dragonmaster. Along with his girlfriend Luna, and several friends they meet along the journey, they soon discover that the happy world of Lunar is on the verge of Armageddon. As Dragonmaster, Alex could save it. As a ruthless and powerful sorceror is about to play his hand, will Alex and company succeed in their quest before all is lost? And is his girlfriend Luna involved in these world shattering events? Play along and find out.', null, 9.2, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.242707 +00:00', '2021-06-16 20:14:09.242723 +00:00', 'b5709473-9df9-4c67-b1d5-7e1980e5ba2e', 'Star Wars Episode V 1/2: The Han Solo Affair', 'Lego stop motion short that takes place in the 3 minutes after Han Solo is frozen in carbonite. A comical game of "keep away" begins.', null, 5.9, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.242756 +00:00', '2021-06-16 20:14:09.242772 +00:00', '25cc45ab-5662-484c-9602-00362770ae88', 'Star Watching Dog', 'A middle-aged divorcee (Toshiyuki Nishida) embarks on a journey across Japan with his dog Happy. Along the way, they have to overcome health issues and financial difficulties.', null, 7.3, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.242805 +00:00', '2021-06-16 20:14:09.242821 +00:00', '75475f58-c0ea-4d6d-9f78-bb44d971a21f', 'Lego Star Wars: All-Stars', 'New faces team-up with iconic heroes Young Han Solo, Chewbacca, Young Lando Calrissian, BB-8, and General Leia for adventures that span all eras of the Star Wars universe.', null, 6.5, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.242854 +00:00', '2021-06-16 20:14:09.242870 +00:00', 'c7bd11a4-30bf-4077-a618-97c3e5525427', 'The Characters of ''Star Wars''', 'The Characters of Star Wars is a Video Documentary included in the 2004 DVD release of the Star Wars Original Trilogy. It explained the Mythos of many of the "Star Wars" Characters.', null, 6.7, 'movie');
