INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.243057 +00:00', '2021-06-16 20:14:09.243073 +00:00', 'acded899-2fc1-43af-b681-7630381fbd73', 'A Star and Two Coffees', 'Carlos, a young architect in crisis with his partner, arrives in a small town in the north of Argentina to build a complex of cabins. There he meets Estela, a thirteen-year-old girl, but he...', null, 6.7, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.243106 +00:00', '2021-06-16 20:14:09.243122 +00:00', '35d4ecd5-0904-48bc-8989-dc355b86bfcd', 'When Star Wars Ruled the World', 'The Star Wars cast talks about the phenomenon of Star Wars.', null, 8.1, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.244319 +00:00', '2021-06-16 20:14:09.244335 +00:00', '0657217e-9efa-48fe-be08-6ca29bcaf042', 'Top Star', 'Tae-sik''s on he road to success when he goes from being a talent manager to a superstar himself. However, Tae-sik''s passion turns into boundless greed and he finds himself in a crisis.', null, 6.5, 'movie');
