INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.243155 +00:00', '2021-06-16 20:14:09.243171 +00:00', '3e308028-1fa1-419f-b97c-fb06b0f91f26', 'Star Night at the Cocoanut Grove', 'Hollywood''s famous Cocoanut Grove nightclub stages a Star Night-only musical revue in which many Hollywood actors attend. Staged is the operative word. Entertainers include Ted Fio Rito and his orchestra, Eduardo Durant''s Tango Band, and the Fancho & Marco Sunkist Beauties. Leo Carrillo acted as the Master of Ceremonies, and introduces a galaxy of stars from their tables. Those higher on the 1935 pecking order, Mary Pickford, Jack Oakie, Arline Judge, Bing Crosby and Gary Cooper, come to the microphone and do a bit...mostly chit-chatting bits.', null, 5.7, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.243205 +00:00', '2021-06-16 20:14:09.243222 +00:00', 'ec9497e1-1c72-4290-b485-9d36fe01037e', 'My Lucky Star', 'The son (Romero) of a department store owner enrolls the store''s sports clerk (Henie) at a university to use her as an advertisement for their fashion department. She falls for a teacher (Greene) and gets expelled.', null, 6, 'movie');
