INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.243452 +00:00', '2021-06-16 20:14:09.243468 +00:00', '0e9d88fd-d01c-48d4-a8b4-c78ca873229f', 'The Soldier''s Star', null, null, 6.9, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.243500 +00:00', '2021-06-16 20:14:09.243516 +00:00', '927602cf-ac67-4917-a2ea-7e1350fef2f6', 'A Star Is Born World Premiere', 'Included on the DVD release of "A Star is Born" (1954), this is a live television broadcast of the world premiere. Described by various participants as the biggest world premiere in memory,...', null, 5.8, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.243552 +00:00', '2021-06-16 20:14:09.243568 +00:00', '27e04b56-0d99-48d6-9600-557623985039', 'Star Trek: Enterprise - In a Time of War', 'Newly produced multi-part documentary featuring all-new interviews with the show''s cast and crew as well as behind the scenes archival   This retrospective documentary gives fans an inside look at the making of the show''s groundbreaking third season - the first season of a Star Trek series to feature a year-long story arc. Writing staff and production personnel discuss the complexities of plotting the Xindi story-arc and the development of all the major story threads that connected every single episode of the show''s third season.', null, 7.3, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.243603 +00:00', '2021-06-16 20:14:09.243619 +00:00', 'dceab335-df68-4ee5-8b8d-6fb8d9a68041', 'William Shatner''s Star Trek Memories', 'As James T. Kirk, the intrepid captain of the Starship Enterprise, William Shatner was at the forefront of the world''s most popular sci-fi series. Now, for the first time, Shatner shares his personal rememberances of the original TV series and the Star Trek phenomenon. Joining him are original crew members Leonard Nimoy, DeForest Kelley, James Doohan, George Takei, Nichelle Nichols and Walter Koenig. You''ll hear the never-before-told stories behind Star Trek. How the fans rallied to save the show after it was canceled. How Chekov''s look was styled after The Monkees'' Davy Jones. Why the ship''s chief engineer was Scottish, the origin of Vulcan hand salute, and much more. It''s the behind-the-scenes story of a classic series that lived long and prospered, hosted by the man who captained its amazing journey.', null, 6.2, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.243655 +00:00', '2021-06-16 20:14:09.243671 +00:00', 'e1a0448f-5160-4ee3-b3a6-84519fbfb53f', 'Star Wars: Episode I - Battle for Naboo', 'Lt. Gavin Skies of the Naboo Army must fight against the Trade Federation forces that have just invaded his home planet.', null, 7.3, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.243704 +00:00', '2021-06-16 20:14:09.243721 +00:00', '82d5f4b8-084d-426a-850a-d09abbab0c3a', 'Bring Back... Star Wars', 'Justin Lee Collins is on a mission to reunite the cast of the original Star Wars trilogy.', null, 7.4, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.243756 +00:00', '2021-06-16 20:14:09.243772 +00:00', '3e4554c6-0b1b-462f-9d7e-c116f7001f0c', 'Star Spangled to Death', null, null, 7.4, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.243804 +00:00', '2021-06-16 20:14:09.243820 +00:00', 'd6a7409f-87cd-49d7-8803-951a7352c2ce', 'Star Wars: Obi-Wan', 'This videogame is focused on Obi Wan Kenobi, it tells you the story beneath Chapter One: The Ghost Meneace and how it started and all Obi Wan passed trough in this chapter by playing with him. This videogame is only for Xbox', null, 6.2, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.243854 +00:00', '2021-06-16 20:14:09.243870 +00:00', 'd7654b82-00d7-405b-a83c-05804444b645', 'Star Wreck: Lost Contact', null, null, 6.2, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.243901 +00:00', '2021-06-16 20:14:09.243918 +00:00', 'a61bf4b4-f8f2-43f4-993c-29aa15d5d307', 'Star Wars: The Empire Strikes Back', null, null, 7.7, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.243950 +00:00', '2021-06-16 20:14:09.243966 +00:00', '23fbb189-59bf-4c23-a932-305fd1497298', 'Magic Star Magical Emi', 'Mai is a little girl who idolizes Emily Howell, a famous magician. She is given a magic bracelet to transform into Magical Emi when she says "Pulitto! Palalin Lilikalu Palapola Magical". She soon becomes a very successful part of her grand parents'' show "The Magicalettes" while keeping her eye on a handsome boxer.', null, 6.2, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.244000 +00:00', '2021-06-16 20:14:09.244016 +00:00', '63b7be87-aef1-4433-9ba7-5f406b0c6c4d', 'The Lucky Star', 'In the war-torn Netherlands, a local Jewish boy has vivid escapist fantasies of being in a Hollywood western where good always triumphs.', null, 6.6, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.244049 +00:00', '2021-06-16 20:14:09.244065 +00:00', 'aa78103d-9ef7-4668-aefa-aeadafc2613b', 'Billion Star Hotel', 'Every day, we''re faced with the following exercise: to give the world around us a certain cue. To smile, to take everything as a joke, to laugh out loud, or to allow ourselves to be overwhelmed by reality. To be painfully aware of the distance between us and our dreams, of the obstacles, and the fact that we are alone all the time. Some choose to escape, to build their own world, with it''s own rules, with the memories of fairy tales and dreams that really come to be. A world where three friends are brought together by the same destination. Or maybe, it all comes down to daydreaming. And feeling the empty spaces with music. It all depends on how you choose to see things. In black, in white, or in sync with the beat. Billion Star Hotel, for each viewer, a different story.', null, 6.1, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.244104 +00:00', '2021-06-16 20:14:09.244120 +00:00', '9c3de8d8-4259-4cae-bd24-7280488b64c8', 'Star Wait', 'The new Star Wars film arrived on May 16 - so why not line up on the streets 6 weeks before? Hundreds of people in Hollywood did just that. Star Wait takes a look at the lives of some of these people waiting in line in front of the famous Mann''s Chinese Theater. How do they get along with each other? How do they deal with the homeless people vying for sleeping room on the streets of Hollywood? How do they make sure no one spoils the new Star Wars movie for them? And of course, how do they go to the bathroom? Star Wait is broken up into 9 different episodes. Episodes include; who is hotter: Natalie Portman or Princess Leia? How does a Christian band get along with Star Wars fans at 2 in the morning? The day the tickets are sold, infighting among line members, and of course the final day leading up to the Hollywood 12:01am showing of "Star Wars Episode II: Attack of The Clones."', null, 6.6, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.244170 +00:00', '2021-06-16 20:14:09.244186 +00:00', '4e30b20c-5d7e-4868-9a48-3c7f644e4cba', 'Star Wars Gangsta Rap', 'Elite members of the cast of Star Wars prove that they are all natural-born homey g''s.', null, 6.9, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.250191 +00:00', '2021-06-16 20:14:09.250207 +00:00', '685476d5-5c3c-417b-ae3c-079b02f8a0ed', 'The Silver Star', 'A frontier marshal doubts his own courage when three gunmen threaten his town.', null, 6.4, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.244416 +00:00', '2021-06-16 20:14:09.244431 +00:00', 'b2ddce38-9689-4a33-8dd6-7efd2411ed2d', 'Star of India', 'Squire Pierre St. Laurent returns from wars in India to 17th-century provincial France to find his estate confiscated by governor Narbonne, for back taxes, and resold to Katrina, a Dutch Countess. Katrina offers to return Pierre''s property if he will help her get possession of the ''Star of India,'' a fabulous sapphire, held at the moment by Narbonne. The Dutch government wants it returned to its Indian worshipers, in order to keep peace. Pierre is a guest at Narbonne''s ch√¢teau during a visit from King Louis IV, who wants to acquire the sapphire for his new court-favorite, Mme. de Montespan. Pierre discovers that the "Star" is hidden in the hilt of Narbonne''s sword, He challenges Narbonne to a duel, gains possession of Narbonne''s sword, extracts the jewel and escapes the castle with Narbonne''s men in pursuit. Katrina is on a Dutch ship in the harbor and is soon joined by Pierre and his pursuers.', null, 5.6, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.244470 +00:00', '2021-06-16 20:14:09.244487 +00:00', 'c4196157-21e4-46be-a224-e048570cf29e', 'Star-Crossed', 'Join the adventures of a hopeless romantic, an aspiring actress, a salesman, a class clown, a ditsy flirt, a jealous boyfriend, a dream girl, an older sister, and a sarcastic boss. These colorful characters take a fun-filled look at life and love in this smash-hit, award-winning film.', null, 6.9, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.244520 +00:00', '2021-06-16 20:14:09.244536 +00:00', '644e85b1-88bf-4b51-8a37-1b0eb0bdef9d', 'Star Fox: Assault', 'It has been a year since the incident of Sauria and nine years since the last war against Andross''s forces. Now a new threat has emerged from the darkness in the form of the aparoid race, who are bent on galactic domination and assimilation of the Lylat System with the Star Fox team being the only thing standing in their way.', null, 7.9, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.244569 +00:00', '2021-06-16 20:14:09.244585 +00:00', 'edb1a9e6-a439-422b-8a26-f980775d0f60', 'Star Blazers 2199: Odyssey of the Celestial Ark', '2199 AD. Yamato tries to leave behind the Large Magellanic Cloud galaxy after receiving a Cosmo Reverse System at its destination, Iscandar. However, suddenly it encounters a mysterious ...', null, 7.1, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.244617 +00:00', '2021-06-16 20:14:09.244633 +00:00', 'c8316f09-81ca-4b71-a879-405e740acee5', 'Beyond the Farthest Star', 'A twist of fate brings the national spotlight to a forgotten Texas town, and a once famous preacher has an opportunity to regain his former glory or seize one last chance to restore his fractured family.', null, 7.4, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.244665 +00:00', '2021-06-16 20:14:09.244681 +00:00', 'cadefb3c-948c-4363-9f34-864cbc6d00d4', 'Saving Star Wars', 'Two Star Wars fans venture to deliver a letter to George Lucas.', null, 5.5, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.244713 +00:00', '2021-06-16 20:14:09.244729 +00:00', '2c132fb2-69a8-4ab3-aee7-399a0f607ade', 'Children of the Dog Star', 'An alien lands on Earth and is taken in by Earth children.', null, 7.2, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.244761 +00:00', '2021-06-16 20:14:09.244777 +00:00', '3427235e-8ce9-402a-8096-5981d5be32c1', 'Science of Star Wars', null, null, 6.8, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.244807 +00:00', '2021-06-16 20:14:09.244823 +00:00', '28b7b1ac-8834-45b7-a02e-528d48fe476c', 'Star Wreck IV: The Kilpailu', null, null, 6, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.244854 +00:00', '2021-06-16 20:14:09.244870 +00:00', '3ff3e54c-0653-45dd-9586-efcd16b32b07', 'Shadow Star Narutaru', null, null, 6.4, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.244901 +00:00', '2021-06-16 20:14:09.244917 +00:00', 'ff00b2a9-9e85-44af-922f-5f3504b82c15', 'Star Trek: Deep Space Nine - The Fallen', 'In the later half of Deep Space Nine''s season six, we were reintroduced to the Pah-wraiths...witness this chapter of the battle between the Pah-wraiths and the Prophets as you battle to control the Red Orbs which will open the Pah-wraiths'' temple and bring about Armageddon.', null, 7.3, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.244950 +00:00', '2021-06-16 20:14:09.244965 +00:00', '9d8bcded-9d04-45d9-96af-094b9b09dbf4', 'John Wycliffe: The Morning Star', 'John Wycliffe, the scholar and lay preacher of the 14th century who was later dubbed "The Morning Star of the Reformation", risked his life and freedom to criticize the Church for its abuses of power and its false teachings. The dramatized story of his life includes his battles with Church authorities, his relationship with the peasants and his realization that the Bible must be translated into English, so that the common man, as well as the learned, could read it.', null, 6.8, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.244999 +00:00', '2021-06-16 20:14:09.245015 +00:00', 'e83a8d14-2ebf-4aa6-87b4-4cf2eae2840d', 'Star Wreck 2: The Old Shit', null, null, 5, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.245047 +00:00', '2021-06-16 20:14:09.245062 +00:00', '9245bd15-e257-4a74-a502-07b23e26f7df', 'Grand Star', '"Grand Star", formerly known as "Ice Corp.", is a futuristic, action-adventure series based on the saga by French novelist Georges J. Arnaud. In the latter part of the 21st century, there is a cataclysmic explosion on the moon, which was being used as a nuclear waste dump and the earth is turned into a frozen mass of ice. Billions died but a few thousands have managed to rebuild their lives in railway stations like "Grand Star", where they must learn to survive in the frozen landscape home to strange near humans of unknown origin who can withstand the cold and the "renewer" who profess the return of the Sun. Starring Canadian actors Tyler Johnston (Godiva''s, Blood Ties), Kyle Labine (Freddy vs. Jason), Tammy Hui (Battlestar Galactica) and Tristan D. Lalla (Superstorm).', null, 6.1, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.245097 +00:00', '2021-06-16 20:14:09.245112 +00:00', '73725516-9067-4b3b-ad44-8c73d330b8a8', 'The Raccoons and the Lost Star', '"The Raccoons and the Lost Star" is the last totally original Raccoons .... On a far-away planet, Cyril Sneer plots his takeover of earth.', null, 8.4, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.245145 +00:00', '2021-06-16 20:14:09.245161 +00:00', '8f15d136-7d8f-4f07-9c7f-a7b9d95fe3e9', 'The Star Wagon', 'In middle age, inventor Stephen Minch is happy enough with his life, despite the fact that he has never risen to prominence even though his innovations have made others rich. His wife Martha, however, resents his lack of drive, his complacency, his willingness to live hand-to-mouth, and his ever-present and ever-annoying sidekick Hanus Wicks. Confronted by the evidence of Martha''s years-long regret over how their lives together have turned out, Stephen decides to use his newest invention to repair her unhappiness. The new invention: a time machine.', null, 8, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.245195 +00:00', '2021-06-16 20:14:09.245210 +00:00', 'f8dd9e27-8b53-4579-b585-94510d705bd3', 'Star Trek: Armada II', null, null, 8, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.245242 +00:00', '2021-06-16 20:14:09.245257 +00:00', '166338ea-9fae-4806-aefc-1fd890a44903', 'Gold Star', 'Vicki, a music school drop out, boards a train from NYC to CT to care for her first music teacher, her dying father. While reconciling her feelings toward her upbringing in his old age, she realizes the future she wanted for herself isn''t necessarily the one she needs.', null, 7.2, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.245290 +00:00', '2021-06-16 20:14:09.245306 +00:00', '51130686-3654-4524-8142-41bd6846860a', 'Star Wars: The Last Jedi', 'Two kids fight with light sabers around the house.', null, 8, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.245338 +00:00', '2021-06-16 20:14:09.245354 +00:00', '806fe399-d3c1-4d55-92b1-e8905859aa18', 'Star Men', 'Four of the world''s leading astronomers celebrate 50 years of friendship and exploration on a reunion road trip through the American Southwest.', null, 6.9, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.245386 +00:00', '2021-06-16 20:14:09.245401 +00:00', '4a98e41b-8b51-46be-b768-c7a00f3ac1d2', 'Like a Shooting Star', 'A young yakuza hitman named Goro does a job and needs to hideout away from Tokyo for a while. He hangs out with loose women and hard men and always manages to stay one step ahead of the law...', null, 7.1, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.245434 +00:00', '2021-06-16 20:14:09.245449 +00:00', 'd94787ee-8cf4-45a3-88a3-0be4a21becbe', 'Building Star Trek', 'Half a century after it first aired, Star Trek has become not only a pop-culture phenomenon, but also an inspiration for social progress, scientific and technological endeavor, and space exploration. On its 50th anniversary, "Building Star Trek" features scientists, actors, and cultural leaders, asking how did this happen ... and why?', null, 6.7, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.247429 +00:00', '2021-06-16 20:14:09.247445 +00:00', '6af8590d-4d78-45da-9561-f13a27301faf', 'Star Trek: Odyssey', 'A Star Trek fan production based on the Homer''s The Odyssey telling the story of a spaceship trying to go home after getting lost in the Andromeda Galaxy.', null, 6.1, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.250268 +00:00', '2021-06-16 20:14:09.250298 +00:00', '7524f3a2-2f59-4e61-9c73-ad34484913d2', 'Star Trek: Hidden Evil', 'It''s non-stop action/adventure as you engage alien forces and outwit your foes... lest the Federation falls victim to its ruthless archenemy.', null, 6.8, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.245720 +00:00', '2021-06-16 20:14:09.245736 +00:00', '19867a14-5e9e-481c-ab25-10f386a6faef', 'Star Trek: Judgment Rites', 'A series of missions of the Enterprise, under the command of James T. Kirk: a rematch with Ies Breddell, who has a powerful new weapon capable of destroying the Federation; evidence of advanced technology on a stone-age planet; a reunion with the powerful Trelane, this time obsessed with World War I; a distress call from a barren world; Spock''s abduction by mysterious forces as the Enterprise explores a dangerous rift in space; and terrorists seizing control of a museum with Kirk, Scotty and Checkov trapped inside. Through it all, a reclusive but advanced alien race is watching and testing the Enterprise, wondering if they should break their long silence and make contact with the Federation.', null, 8.1, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.245773 +00:00', '2021-06-16 20:14:09.245789 +00:00', '41d08f6f-5fb9-41ea-a207-6ea4146f6ac4', 'Northern Star', null, null, 6.3, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.245820 +00:00', '2021-06-16 20:14:09.245858 +00:00', '0659e0e6-504e-4482-8aa9-f7530f36cae2', 'Kara: A Star Wars Story', 'A veteran X-Wing pilot helps transport a young girl with mysterious powers and her desperate father to an underground Rebel base.', null, 6.8, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.245905 +00:00', '2021-06-16 20:14:09.245921 +00:00', '5bd6b2f9-f07d-4d6c-b8d5-a9cf649f8aa7', 'Teen Star Academy', 'The "Teen Star Academy" is an incredible school for all Teenagers who love Music, Dance and Fashion. Each year the selected students will be lead and taught by the extremely talented and very friendly teachers (John Savage, Blanca Blanco, Adriana Volpe, Youma Diakite..), who will improve their students'' skills, in order to prepare them for the "Final Challenge" of the year. At the same time, different stories of friendship, competition and strong emotions of the present and the past, interlace inside and outside the Academy, especially at the "Zelo''s Beach" run by the hilarious Nathan (Bret Roberts) with the help of the crazy assistant Jonathan Bagoro. And there''s more... Among the singing and dancing, new stories will begin; others won''t continue, and some others will begin again. Everything set in the beautiful surroundings of the French Riviera.', null, 7.3, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.245955 +00:00', '2021-06-16 20:14:09.245971 +00:00', 'b882552c-62ea-4f95-af7e-aa1d2a3df904', 'I Am a Star', 'A most successful Lithuanian artist duo of Monika and Mantas unexpectedly breaks up as Mantas decides of switching and becoming a rapper.', null, 2.9, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.246003 +00:00', '2021-06-16 20:14:09.246019 +00:00', '7a87274a-541a-405c-b148-5946f6c707d4', 'Star Wars: Racer Revenge', null, null, 7.2, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.246050 +00:00', '2021-06-16 20:14:09.246066 +00:00', '7429fb65-1436-4035-832d-3ef8fb8851fa', 'Joan Crawford: Always the Star', 'This glamorous and hugely popular actress raised herself from brutal poverty to Academy Award-winning stardom by guts, determination and hard work. During her fifty-year career, she made over eighty films. But her obsessive perfectionism led to the later caricature of coat-hanger-wielding harridan that even the adoration of fans could not counter. Still, she has endured as one of the most popular icons of the movies, an early role model to a million young women who aspired to her image of stylish magnetic power and unquestioned independence. She was born Lucille LeSueur on March 23, 1904 (or 1906) in San Antonio, Texas. Her father soon disappeared and she took the name of her stepfather, calling herself Billie Cassin. When Cassin, too, vanished, Billie did menial work to help her mother and brother survive. Ill-paid sales jobs bought dancing lessons and the clothes she needed to enter amateur contests. Then came a night-club contract as chorus girl - $25-a-week and eight routines a night. And so she made it into show-business, but the humiliations and insecurities of those early years would never entirely leave her. Spotted by an MGM scout, by 1925 she was under contract in Hollywood. She made the usual publicity appearaces and did Exhibition Dancing at night. Her vitality, charm and dancing talents earned her many admirers - including some powerful enough to advance her career, like William Haines, Paul Bern, Jackie Coogan, Sr. and Louis B. Mayer. After bit parts and a small role in the film Pretty Ladies, a studio-sponsored competition found her the name she at first hated: Joan Crawford. As Crawford''s acting skills developed, she became known for her independence and her resilience despite some less-than-successful roles. Her vaguely pretty and plump early looks were soon replaced by the svelte, hard-boiled beauty of hollow-cheeks, thick brows and overpainted mouth that would be her permanent image. Her capacity to inspire and wear with flair the creations of the dress designer Adrian was legendary. But most of all, she was known for her hard work on the set. Joan Crawford''s personal life was characterized equally by self-discipline and the determination to better herself, banishing forever her unhappy beginnings. Four husbands included actors Douglas Fairbanks, Jr, Franchot Tone, Phillip Terry and businessman Alfred Steele. Plagued by innumerable miscarriages, she adopted four children, one of whose account of Joan''s unyielding perfectionism has succeded in blurring memories of the remarkable life and career of a Hollywood immortal. Among Joan Crawford''s films from which clips are included: Sally, Irene and Mary, 1925; Our Dancing Daughters, 1928; Grand Hotel, 1932; Dancing Lady, 1933; The Gorgeous Hussy, 1936; The Women, 1939; A Woman''s Face, 1941; Mildred Pierce, 1945; Humoresque, 1946; Possessed, 1947; Sudden Fear, 1952; Johnny Guitar, 1954 Whatever Happened to Baby Jane? 1962 and Strait Jacket, 1964.', null, 2.7, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.246110 +00:00', '2021-06-16 20:14:09.246126 +00:00', 'ed2fb2c4-faea-4d1c-b1e0-a49973e21698', 'Star Wars: Starfighter', 'A long time ago, in a galaxy far, far away... the greedy Trade Federation stands poised to invade the small planet of Naboo. The only hope for the people of Naboo is a young pilot, a beautiful mercenary, a shifty mechanic and an underhanded pirate who ally to face the invading forces.', null, 7.3, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.246159 +00:00', '2021-06-16 20:14:09.246175 +00:00', '69f91e0a-f5fe-437f-a0ba-6d32a9a391f2', 'Star Trek', 'You play the crew of the U.S.S. Enterprise as they have adventures staged as the fourth season of the original series.', null, 7.7, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.246207 +00:00', '2021-06-16 20:14:09.246223 +00:00', 'dd410e88-0c6a-4954-80ac-4c004bcba229', 'All Star Family Fortunes', 'A celebrity version of Family Fortunes (1980).', null, 5.2, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.246255 +00:00', '2021-06-16 20:14:09.246271 +00:00', '5580dfe4-9803-4291-8e6b-6e7df27d7032', 'The Official Star Wars Fan Film Awards', 'The SciFi Channel presents a TV spectacular honoring the best homemade satires of the Star Wars universe from Lucasfilm''s first Offical Star Wars Fan Film Awards. Kevin Smith hosts and showcases all the award-winners, from Star Wars-themed spoofs to documentaries and mockumentaries.', null, 5.8, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.246304 +00:00', '2021-06-16 20:14:09.246320 +00:00', 'b99e4551-231e-4df9-86f1-5037c3ce6a62', 'All Star Comedy Jam: Live from South Beach', 'The all-star comedy line-up includes host D.L. Hughley and featured comics Earthquake, Lavell Crawford, Melanie Comarcho, and Arnez J. This unforgettable night of comedy was filmed in front of a live audience at South Beach''s prestigious Jackie Gleason Theater during the American Black Film Festival.', null, 6.7, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.246353 +00:00', '2021-06-16 20:14:09.246368 +00:00', '562ca232-b898-4d64-9552-c74208b740ad', 'Bette Davis - Star und Rebellin', null, null, 8.5, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.246400 +00:00', '2021-06-16 20:14:09.246415 +00:00', '75609cee-bc87-493d-8c1f-32c7e8ccc368', 'Star Wars Legends: Legacy of the Force', 'Adapted from a portion of the Star Wars novel "INVINCIBLE" by Troy Denning, STAR WARS LEGENDS: LEGACY OF THE FORCE takes you into the last moments of the final conflict between the children of Han Solo and Leia Organa Solo.', null, 7.1, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.246448 +00:00', '2021-06-16 20:14:09.246464 +00:00', '37900f59-b5f2-4f5e-92a9-7a267641a709', 'A 5 Star', 'In order to pay the university''s tuition, Maryam starts working in a hotel in which she gets accused of having stolen an expensive watch.', null, 5.5, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.246496 +00:00', '2021-06-16 20:14:09.246511 +00:00', '09f069e1-bb3d-4956-8e9d-a82d93c41bc2', 'Star Wars Droids: The Jawa Adventure', 'Having given the auspicious impression that they are finally retiring, the spunky astromech droid R2-D2 has convinced the worry-prone protocol droid C-3PO to join him in assisting an eccentric old scientist named Von Bruneus with an experimental vehicle crafted from a decommissioned and modified Mon Calamari sentry cutter called the Max. After the unanticipated incapacitation of the doctor, the Max crashes safely on the desert planet of Tatooine where the droids ironically find themselves once more at the mercy of scavenging Jawas. A precocious and curious little Jawa named Skeetie proceeds to take the droids on a wild adventure that ultimately ends with a provocative revelation.', null, 6.8, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.246546 +00:00', '2021-06-16 20:14:09.246562 +00:00', 'e0ff213f-7d62-4c02-8d28-786913d31d29', 'Star Worms II: Attack of the Pleasure Pods', 'Jessup, forced to hide his true identity, is imprisoned on a deadly and desolate planet, the Star Prison. banished to mine rabid rivers for the elusive Fire Gems, Jessup and his men must battle bands of derelict prisoners and fight the fatal fangs of the Star Worms in order to supply the Lords of the Evil Empire with the sacred source of their hedonistic hallucinogenic opiates.', null, 2.7, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.247482 +00:00', '2021-06-16 20:14:09.247499 +00:00', '277e7bf0-f59e-467b-be76-23d468810a1a', 'The Art Star and the Sudanese Twins', 'Vanessa Beecroft is obsessively determined to adopt Sudanese twin orphans. Her consuming passion drives her marriage to a breaking point and fuels her controversial art, raising troubling questions about exploitation, culture clash, and the imposition of the West on Africa.', null, 7.2, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.247532 +00:00', '2021-06-16 20:14:09.247548 +00:00', 'f393a3a6-3242-4cc5-936f-e0539247c050', 'Pop Star on Ice', null, null, 8.2, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.247582 +00:00', '2021-06-16 20:14:09.247598 +00:00', 'e8c6825b-69f5-4aac-9960-23fa2b803339', 'Star Ocean: The Last Hope', null, null, 7.8, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.246596 +00:00', '2021-06-16 20:14:09.246611 +00:00', 'e55053e5-049e-4f62-b907-7e3ffe362401', 'Pet Star', 'This series on the Animal Planet cable network is a talent show for pets. Ten pet owners have their pets perform a specific trick. Among the contestants on the first show were a roller skating macaw; a dog that plays hockey, a Vietnamese pot-bellied pig that painted pictures with a brush, and a girl who hypnotized her pet frog. Each pet/owner team is rated on a scale of 1-10 by three celebrity judges (with new judges each week). The three teams with the highest scores are finalists; the winner is chosen by a vote of the audience. The winning owner receives $2,500 and is eligible for the end-of-season finals and a chance to win $25,000.', null, 7.2, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.246648 +00:00', '2021-06-16 20:14:09.246664 +00:00', '5dd2dda0-aab4-4958-97ab-de0382beb91f', 'Star Trek: Klingon', null, null, 7.1, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.246695 +00:00', '2021-06-16 20:14:09.246711 +00:00', 'c11df3f1-8b6a-4899-82f1-67a1c326a4b4', 'All Star Revue', 'This early comedy program started off with a rotating cast of four famous comedians, each of whom would take turns hosting the show. The program format was similar to that of a Vaudeville show or stage revue, with the prestige of the hosts enabling the show to bring in equally well-known talent for individual performances. As more hosts were added to the program''s roster, the name was changed to "All Star Revue".', null, 8.2, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.246744 +00:00', '2021-06-16 20:14:09.246760 +00:00', '752fee8e-e238-4966-b885-1901b285652a', 'A Man from This Star', 'Office clerk Eero Koskinen prefers to spend his nights drinking and reminiscing the war with his friends, instead of taking care of his wife and two children. A two-week drinking spree gets him fired, and a new job is not easy to find because of his reputation. He goes to a rehab centre in the countryside for a couple of weeks, but with no permanent result. Meanwhile, his wife has to get a job and is employed by her old sweetheart, now a recently divorced successful businessman.', null, 7.5, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.246794 +00:00', '2021-06-16 20:14:09.246809 +00:00', 'db2e638f-f980-4767-b6c7-2ad0fb19232b', 'Star Wars: Masters of Ter√§s K√§si', 'Features all your favorite Star Wars characters, including Luke Skywalker, Han Solo, Princess Leia, Boba Fett and Chewbacca! 3D fighting at its best -- literally hundred of possible moves! Single and two-player modes for an all-out fighting frenzy! Spectacular 3D arenas including Cloud City, Endor and Dagobah! Two ways to fight: hand-to-hand and full weapons -- wield lightsabers, gaffi sticks, blasters and more!', null, 6.8, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.246843 +00:00', '2021-06-16 20:14:09.246859 +00:00', '04b4f5a0-843c-42e8-bbaf-405425b221f1', 'Angry Birds Star Wars', 'A retelling of the original Star Wars trilogy with Angry Birds characters.', null, 6.8, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.246891 +00:00', '2021-06-16 20:14:09.246907 +00:00', 'daa33ede-ee33-4da9-93b9-cc3819b04358', 'Star Trek: A Captain''s Log', 'This documentary is a trip through the original series. The whole movie is composed of short fragments showing the high points of original series. Between them we can listen to comments of actors. They talk how they felt during shooting, how they feel the series now and what is the meaning of series for the mankind. The original series is full of allegories and in this documentary they are all presented to us with straight words. All leading characters are presented, decribed and we found out what do they really represent. In last third the movies with original crew are presented and, ofcourse, what is the future of Star Trek. This documentary is full of quotes with which we get impression what Star Trek really is.', null, 6.5, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.246944 +00:00', '2021-06-16 20:14:09.246960 +00:00', '7d8031a8-4d65-4f02-b80f-ed867c9dec7c', '9 Star Hotel', 'Slipping through the predawn darkness over highways, through traffic and across the border, Palestinian construction workers go to work clandestinely in Israel every day. Haar''s raw, handheld photography follows workers who build their own border shanty community to enter Israel more easily, with no choice but to risk their lives simply to earn a living', null, 7.4, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.246993 +00:00', '2021-06-16 20:14:09.247009 +00:00', '38b68a7a-86bf-4e02-82f7-2ec1fd2fa993', 'Like a Star Shining in the Night', null, null, 6.9, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.247040 +00:00', '2021-06-16 20:14:09.247055 +00:00', '01f81c66-d968-4375-bbb0-65103aa214d1', 'Carrie Underwood: An All-Star Holiday Special', null, null, 8.2, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.247087 +00:00', '2021-06-16 20:14:09.247103 +00:00', '10c6ec1e-c79c-4aac-aa5e-6419b67ef2e5', 'The Science of Star Trek', 'This documentary compares and contrasts the scientific principles in Star Trek with current science. Many clips from the Star Trek movies and TV series are used to illustrate the concepts of: faster-than-light travel, time travel, anti-particle physics, medical imaging, extrasolar planets, extraterrestrial life and intelligence (SETI and the Drake equation), artificial intelligence, robotics, and matter transmission.', null, 7.4, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.247136 +00:00', '2021-06-16 20:14:09.247151 +00:00', '48495445-f04d-4d4c-9249-1faa28fc64eb', 'Star Wars: Yoda Stories', 'Under the tutelage of Master Yoda, Luke Skywalker must perform a series of tasks to learn the ways of the Force and become a powerful Jedi.', null, 6.6, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.247183 +00:00', '2021-06-16 20:14:09.247199 +00:00', 'a06b7eb3-cd92-41f4-a98c-dc0e8339e407', 'P-Star Rising', 'At age 9, Priscilla, an adorable yet precocious little girl, tells her single-father, Jesse,: "I am going to become a rapper and fulfill your dreams of succeeding in the music business." Moved by Priscilla''s passion and impressed with her natural talent and undeniable charisma, he begins to teach her all he knows about rapping. In the four years that follow there is no question that rapping has brought Priscilla closer to her estranged father, and that her success has made him proud. Before our eyes, this father-daughter duo go from a one-bedroom shelter in Harlem to a 4 bedroom apartment, from food stamps to shopping sprees, from rapping on street corners to sold out night clubs, and from sneaking under train turnstiles without the $2 fare to spare to being driven around in tinted SUV''s. It is further undeniable that Jesse has been reborn, from looking at old photos and bitterly reflecting on how he never was given the respect he deserved in the music business as a rapper himself to finding his own voice and self-respect as his daughter''s overzealous manager. But in the efforts to make her dad proud, Priscilla struggles to remain a child and finds herself trapped in a world of people twice her size and four times her age and doesn''t know who to trust. Jesse himself is caught between wanting to protect his daughter'' innocence and exploiting her raw talent to fulfill his deferred dream. All they know is that the ride has just begun.', null, 7.8, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.247236 +00:00', '2021-06-16 20:14:09.247252 +00:00', 'b557615d-adfd-44ed-9312-2a40691eb60f', 'The Untitled Star Wars Mockumentary', null, null, 7.1, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.247283 +00:00', '2021-06-16 20:14:09.247299 +00:00', '38b377b3-3f91-4c86-9509-d395222daf13', 'Star Wars: The New Republic Anthology', 'Boba Fett has been trapped for 30 years in the Great Pit of Carkoon; makes his escape and is now allies with the Rebellion.', null, 7.1, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.247331 +00:00', '2021-06-16 20:14:09.247347 +00:00', 'f2dc0ce0-1b3d-4e2d-b4f7-00711829f8b4', 'Star Stuff: The Story of Carl Sagan', 'What are the stars? In search of an answer to that seemingly simple question, Carl, a curious child, sets off on a great voyage of discovery. As one question is answered, more appear. Soon enough, where once stood but a curious boy, a great scientist will rise. "Star Stuff" is a short and sweet film inspired by the life and work of Carl Sagan, one of the most famous scientists and science communicators of the 20th century.', null, 8.6, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.247380 +00:00', '2021-06-16 20:14:09.247396 +00:00', 'f75f574c-1103-4422-8018-07543151fb87', 'Star Wars: Episode XXXVIII - 10 Years Later', 'Star Wars Episode 38 is a movie completely spoofing the original trilogy of star wars with jokes and slapstick humor in almost every scene. Follows the characters from the Original Trilogy as if they were comedians years after Episode 6. If you like parodies of Star Wars this movie is for you.', null, 5.1, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.247630 +00:00', '2021-06-16 20:14:09.247646 +00:00', 'b31be683-6382-46c8-8b00-9c1d43fba763', 'The Lone Star Trail', 'Rancher Blaze Barker returns to Dead Falls after being framed by land-grabbers and spending two years in jail. Paroled, he can''t wear a gun, but is aided by Marshal Fargo Steele. The gang ...', null, 5.8, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.247678 +00:00', '2021-06-16 20:14:09.247694 +00:00', 'ec07f763-f2a1-49b5-b137-2e31f64cb090', 'Star Trek: 25th Anniversary Enhanced', 'In the final frontier, you control Captain Kirk and the crew of the USS Enterprise in new adventures arranged as the 4th season of the original TV series. With the classic original cast voicing their characters, Kirk and the crew face Klingons, Romulans and even Harry Mudd as you explore space and face challenges that will test your wits and courage.', null, 8.2, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.247728 +00:00', '2021-06-16 20:14:09.247744 +00:00', 'ffaec4b6-477d-4247-add0-dbe2ad91b3dd', 'Star Academy', null, null, 3.6, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.247776 +00:00', '2021-06-16 20:14:09.247792 +00:00', 'b68aaea2-8645-45d2-b508-4267f16e2341', 'Star Nextdoor', 'Hye-mi is a top Hallyu star who lives next door to a middle school student So-eun. In reality they are mother and daughter, but they''ve kept it a secret from the public for fear of scandal.', null, 6.6, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.247824 +00:00', '2021-06-16 20:14:09.247840 +00:00', '527aaa26-776b-41b1-892a-d062955a49f6', 'American Beauty Star', 'American Beauty Star consists of 12 competitors from all facets of the beauty industry, battling head-to-head in a series of intense challenges, from creating high-end magazine editorial looks to the hippest and most current red carpet styles for a Hollywood premiere. In the end, only one will become the next American Beauty Star.', null, 5.4, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.248019 +00:00', '2021-06-16 20:14:09.248035 +00:00', '30c9c72e-8ef6-4c52-b3bd-7f0439848be5', 'Texaco Star Theatre', 'The Texaco Star Theatre was one of the most popular shows in the history of television. In the first year, Milton Berle was not the permanent emcee, but once he replaced the rotation, the show soared to ratings dominance (Number One in 1950-51), NBC dominated Tuesday night, and Berle became the first great star of the new medium, "Mr. Television". The basic format was modeled after a vaudeville variety hour, spotlighting Berle''s jokes, sight gags, and costumes.', null, 7.7, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.248071 +00:00', '2021-06-16 20:14:09.248087 +00:00', '56a184c5-400a-4e63-8eb3-9d888235c08f', 'A Movie Star', 'Just as the local movie theater is about to begin showing a picture, the star of the film arrives and comes to see the movie himself. On screen, the star must rescue his girl from danger. In the theater, the star finds that not all of the audience admires his acting as much as he does.', null, 5.9, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.248120 +00:00', '2021-06-16 20:14:09.248136 +00:00', '5a831afc-216f-4085-8a77-5c6f1ceb030f', 'The Yellow Star: The Persecution of the Jews in Europe - 1933-1945', 'With a great archive footage coming from 16 countries, this Oscar nominated documentary briefly presents some of the most important facts about the Nazist persecution against Jews in Europe, starting with Hitler''s rise to the power.', null, 7, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.248169 +00:00', '2021-06-16 20:14:09.248185 +00:00', 'd2829c45-e90c-4e8f-adf0-7c8e5571b5d4', 'The Star Maker', 'Danny Youngblood is a famed Hollywood director with a reputation for modeling sexy starlets into superstar actresses, and then turning his discoveries into his wives, one after another. However, Danny meets his match when he zeros in on his latest starlet/conquest, Margot Murray, who decides to turn the tables on him.', null, 6.8, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.248219 +00:00', '2021-06-16 20:14:09.248235 +00:00', '8682d018-1a63-4340-bee8-e38482125271', 'Bad Girls All Star Battle', 'Sixteen of the baddest Bad Girls return to compete against each other for a chance to win 100,000 dollars.', null, 7.4, 'movie');
