INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.248650 +00:00', '2021-06-16 20:14:09.248665 +00:00', '7f6d5e54-ee65-41ef-b4a5-bd83b6cafd56', 'Star Trek: Enterprise - Uncharted Territory', 'This 90 minute documentary features all-new interviews with the show''s cast and crew as well as behind the scenes archival content providing fans an inside look at the challenges faced during the second season of ENTERPRISE as the writing staff and creators struggled to find the right tone and creative course for the series, ultimately developing the controversial XINDI story-arc which kicks off with the season finale: THE EXPANSE.', null, 7.7, 'movie');
