INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.248746 +00:00', '2021-06-16 20:14:09.248761 +00:00', '87c64348-61a0-4e6c-99c5-a6bd8b0bcbc3', 'A Star Named Ayrton Senna', 'The Official Film of Brazil''s greatest Formula One driver, Ayrton Senna, who''s sudden death in the 1994 San Marino Grand Prix sent shock waves around the World. It cemented his reputation both within the sport, and his native Brazil, as a legend. The film looks at his life and career using archive footage and featuring revealing interviews with the man, as well as those who knew him well; friends, family and competitors. It also shows how the Ayrton Senna Foundation, set up in his honor, is working to help under privileged and street-bound children in his native Brazil using sport as an incentive to learn.', null, 8, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.248798 +00:00', '2021-06-16 20:14:09.248814 +00:00', 'd395151d-1c96-4c1b-93ad-4195eba6491b', 'Star Wars: Force Commander', 'Brenn and Dellis Tantor, brothers, are loyal imperial officers whose father was killed in a Rebel assault on their home-planet. Just before the battle of Yavin, Brenn is given command of some ground troops and Dellis joins Imperial intelligence. During the Galactic Civil War, they will discover that the Empire is not as fair and righteous as they grew up thinking.', null, 6.9, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.248847 +00:00', '2021-06-16 20:14:09.248863 +00:00', 'f6ca21a9-0a5e-4fea-9c26-7a17ed91cb40', 'Ultraman Tiga & Ultraman Dyna: Warriors of the Star of Light', 'The members of the Super GUTS force, one of whom is secretly Ultraman Dyna, are in the middle of a losing battle against an enormous monster on the surface of the moon, when suddenly a spaceship appears and saves them by zapping the beast. The crew of the ship claim to members of the world peace force that originally created the Super GUTS force, and they invite the GUTS members to enter their brainwave patterns into the ship''s battle computer so it can be a more effective fighting system. It sounds like a good idea, but could they have some other plan up their sleeves?', null, 6.1, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.248897 +00:00', '2021-06-16 20:14:09.248913 +00:00', '63518f42-52c7-494e-a48f-4ac8090aeed7', 'Star Portal', 'An alien from a race dying of a disease crashes on Earth and assumes the body of a human. She then precedes to take blood from other humans to send back to her planet. Things get complicated when she starts to feel human emotions and other aliens show up to exterminate her. Her only hope lies with a curious and helpful doctor.', null, 4.1, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.248946 +00:00', '2021-06-16 20:14:09.248962 +00:00', '273bd379-fdc8-4133-acc7-7be18ef1b699', 'Dog Star', 'A seeing-eye dog name Shiro is granted one wish by his former, now dead owner. Shiro chooses to become a human for a short time so he can find the girl who trained him as a puppy. While attempting to get to know her [as he runs along behind her and sniffs for her around town] he eventually falls in love with her.', null, 7.1, 'movie');
