INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.250379 +00:00', '2021-06-16 20:14:09.250395 +00:00', '3ff6803b-d276-42de-8ce8-2811123ad233', 'Adventures in Odyssey: Star Quest', 'Dylan and his buddy Sal learn that their favorite TV show, Star Quest, is filming in Odyssey, they''re determined to get in on the lights, camera and action. When Mr. Whittaker builds an ...', null, 7.1, 'movie');
