INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.249610 +00:00', '2021-06-16 20:14:09.249625 +00:00', '14cd3c84-01ce-426d-8315-1e161d1b305a', 'Star Wars: Star Warriors', 'Some Star Wars fans want to collect action figures... these fans want to be action figures! A tribute to the 501st Legion, a global organization of Star Wars costume enthusiasts, this insightful documentary shows how the super-fan club promotes interest in the films through charity and volunteer work at fundraisers and high-profile special events around the world.', null, 7.5, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.249658 +00:00', '2021-06-16 20:14:09.249674 +00:00', 'd569ac4e-4e9f-4dcd-af3b-8267118d4664', 'Shaquille O''Neal Presents: All-Star Comedy Jam - Live from Dallas', 'Academy Award winner and one of the Original Queens of Comedy, Mo''Nique rules the stage as host of the 3rd installment in Shaquille O''Neal''s All Star Comedy Jam concert series. Filmed in front of a live audience during the 2010 NBA All-Star Weekend in Dallas Texas, comedy queen Mo''Nique leads her court with some of the industry''s most talented and sought after comedians. No topic is off limits on this night at AEG''s Nokia Theatre stage. Seasoned comedians, Paul Mooney, Corey Holcomb, George Willborn and Michael Blackson deliver side busting, non-stop laughs in this energetic and memorable night of comedy.', null, 5.8, 'movie');
