INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.249758 +00:00', '2021-06-16 20:14:09.249774 +00:00', 'f745be30-4cce-4652-b858-372436a7ccfa', 'Shaquille O''Neal Presents: All Star Comedy Jam - Live from Las Vegas', 'Comedian and film star Mike Epps (The Hangover) takes center stage as the host of the newest installment in Shaquille O''Neal''s All Star Comedy Jam franchise. Epps called on some of stand-up comedy''s freshest talent to help him bring down the house; Lil'' Rel, Henry Welch, Deon Cole and DeRay Davis. This hilarious lineup delivers nonstop laughs in this high-energy night of comedy.', null, 5.5, 'movie');
