INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.249901 +00:00', '2021-06-16 20:14:09.249916 +00:00', '15504dc5-e5ec-445e-bc84-98f928eeae70', 'Leonard Nimoy: Star Trek Memories', 'The Star Trek star, Leonard Nimoy, tells the behind the scenes stories of the legendary television series.', null, 7.3, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.249948 +00:00', '2021-06-16 20:14:09.249964 +00:00', '2c2875d9-4cfc-4c3c-8bea-2f33fad44893', 'The Star Dreamer', 'About a visual wizard and a fantastic legacy of films which transformed and influenced the science fiction genre as we know it. The Russian filmmaker, Pavel Klusjantsev, has had an extraordinary influence on an entire genre of films. Throughout his career at the film studio in St. Petersburg, Klushantsev pioneered and invented legendary techniques for filming the planets, stars and weightnessless - long before anyone else. He went on to redefine the science fiction genre and influence the way Hollywood made their science fiction films, including the Academy Award-winning Visual Effects Master, Robert Skotak, a man who spent years trying to track Klushantsev down. This is a film about a fantastic inventor and dreamer whose destiny was intimately linked with the Space Race and the whims of the Soviet dictatorship. However, despite dying blind and penniless, Klushantsev has left an indelible mark on the history of film and inspired countless filmmakers. The Star Dreamer ensures that the name of Pavel Klushantsev lives on.', null, 8.1, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.253448 +00:00', '2021-06-16 20:14:09.253464 +00:00', '97f168bd-d10d-481b-ad38-89d252a13feb', 'Star Wars Galaxies: Jump to Lightspeed', 'Set in the Star Wars timeframe between Episode IV and Episode V, Jump to Lightspeed is the first expansion for the Massively Multiplayer Online Role-Playing game set in the Star Wars ...', null, 7.8, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.249998 +00:00', '2021-06-16 20:14:09.250014 +00:00', '76f3ace1-f126-4fc8-98ac-5d48e0352d14', 'Let There Be Light: The Odyssey of Dark Star', 'Exploring the controversial story behind John Carpenter (Halloween & The Thing) and writer Dan O Bannon''s (Alien & Return of the Living Dead) from first feature film. From its humble beginnings as a USC student film, to its modern day status as a cult masterpiece. It also offers a rare glimpse inside the creative minds of two USC film students... who would eventually go on to change the way horror films are made.', null, 6.6, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.250047 +00:00', '2021-06-16 20:14:09.250063 +00:00', '07b2a2bb-81b8-418e-89ad-b4fb359c6d9a', 'Keiko the Untold Story of the Star of Free Willy', 'Millions of Free Willy fans around the world finally learn the truth about what really happened when the whale star, Keiko, became the first and only captive orca to be released back into the wild.', null, 8.1, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.250096 +00:00', '2021-06-16 20:14:09.250111 +00:00', 'a219cfdf-3453-4100-92f9-72d3cdd805e7', 'I Am Not a Rock Star', 'Shot over 8 years, I AM NOT A ROCK STAR follows the tumultuous coming-of-age story of Juilliard trained concert pianist Marika Bournaki (age 12 to 20). Intimately exploring universal themes of dreams, sacrifice, love, family, loss and determination, the film ultimately reveals the elusive alchemy of finding one''s purpose in life.', null, 7.1, 'movie');
