INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.250522 +00:00', '2021-06-16 20:14:09.250538 +00:00', 'e71029dc-a032-41a0-bf50-940db8f54f54', 'Film Star', 'An uppity film actress who has her heads in the clouds is disturbed by the slump in her career. She decides to stage a lavish comeback by starting a film based on another woman''s dramatic life. By doing this, she is unaware that she has just opened a can of worms. And with this, her eyes are also opened to the dark secrets in her society.', null, 5.3, 'movie');
