INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.250621 +00:00', '2021-06-16 20:14:09.250637 +00:00', 'b3d223c7-18e0-428e-aed8-257c43e95992', 'Star Reporter', 'John Randolph (Warren Hull), an idealistic young newspaper owner who uses his paper as an instrument for the public good, uses a campaign against crime to successfully run grafting politicians out of town. District Attorney William Burnette (Wallis Clark), father of Barbara Burnette (Marsha Hunt) who John loves, learns that John''s father (unknown to John) is a criminal they are seeking. He refuses to prosecute him and John, not knowing the real reason, turns against Burnette and tries to run him out of office.', null, 5.8, 'movie');
