INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.251055 +00:00', '2021-06-16 20:14:09.251071 +00:00', '53627cc7-16a4-4e17-ad07-012c17023471', 'One Love: The Bob Marley All-Star Tribute', null, null, 8.3, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.251102 +00:00', '2021-06-16 20:14:09.251117 +00:00', 'dd007623-ae26-4acc-acf4-6664fa79584f', 'Star Trek: Starfleet Command III', 'Enter the universe of Star Trek: Next Generation, and fight against whatever threatens the peace of Star Fleet and their new ally, the Klingon Empire. With this new bond you must protect Unity 1 (a highly advanced space station capable of detect far and even cloaked ships) from whatever threats emerge.', null, 8, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.251151 +00:00', '2021-06-16 20:14:09.251166 +00:00', '20b75814-3ec6-4372-8117-57e354a7f3e2', 'A Star Athlete', null, null, 6.7, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.251198 +00:00', '2021-06-16 20:14:09.251213 +00:00', '9b2ed617-e297-46ae-842b-6ef9c4d901f1', 'Hibi Rock: Puke Afro and the Pop Star', 'Takuro Hibinuma had no talent for sports or aptitude for studying throughout high school and never had a girlfriend. However, he found his true calling when he began playing rock music. While in high school, he formed a rock band named Rock ''n'' Roll with his friends. After graduation, they move to Tokyo and begin playing live shows. One day, at a live house, Takuro meets a world-renowned idol singer named Saki Utagawa and his fate is irrevocably altered when she asks him to write her a song.', null, 5.6, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.251247 +00:00', '2021-06-16 20:14:09.251263 +00:00', '1d2fb7ce-8b65-4c71-87d8-bea2dfc36a75', '2011 NBA All-Star Game', 'A documented movie about the 2011 All-star game which was held in Los Angeles, California. The game was held February 20, 2011 and was broadcasted by TNT.', null, 8.6, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.252268 +00:00', '2021-06-16 20:14:09.252284 +00:00', '17bc0cc6-6d9d-4a7c-81b3-4556e1d3ac04', 'Five Star', 'Prabhu(Prasanna), Ilango(Krishna), Sundar(Karthik), Priya and Indra are the best of friends at college, swearing to never lose touch with one another later in life. They manage to get jobs in the same company but Ilango, was whisked away to his village by his dictatorial father(Vijayan) and forced into marriage with Eeswari(Kanika). He then runs away while the friends assume that he is in Bombay with his new wife. A few years later the remaining four are still friends, working in the same company and even living in one house. Prabhu meets Eeswari on the train and without knowing that she is Ilango''s wife, falls in love with her. When the truth comes out she becomes good friends with the gang while they promise to find Ilango and reunite them.', null, 5.7, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.251298 +00:00', '2021-06-16 20:14:09.251314 +00:00', 'aa00b2ae-86b4-43e9-9032-f0ea4c12697a', 'The Stories: The Making of ''Rogue One: A Star Wars Story''', 'Divided 10 segments: A Rogue Idea: A recount of John Knoll''s idea and pitch for the film, looking at the early days of production, hiring Gareth Edwards to direct, Edwards'' love for the series, and building a collection of characters. Jyn: The Rebel: A closer look at the film''s main protagonist: personality, character history and what separates her from other protagonists from the Star Wars universe, physical preparations for the shoot, and more. Cassian: The Spy: Much the same as the previous supplement in terms of introducing the character and his history, the qualities the character brings to the story, and casting Diego Luna. K-2SO: The Droid: A look at the robotic character: his "anti C-3PO personality," character design, Alan Tudyk''s motion capture performance, and the humor the actor brought to the set. Baze and Chirrut: Guardians of the Whills: The actors discuss landing and accepting the roles, the characters'' camaraderie, individual character details, faith and the force in the movie and the Star Wars universe, and the actors'' physical performances. Bodhi and Saw: The Pilot and The Revolutionary: The piece begins with Riz Ahmed''s auditions and crafting the character, the character''s fate, and making key sequences. It moves on to examine Forest Whitaker''s character and his history in the Star Wars universe, character definition and history, Whitaker''s preparations for the role, and more. The Empire: A run through of key Imperial characters, including Galen Erso, Orson Krennic, Grand Moff Tarkin, and Darth Vader and the qualities (and in Vader''s case, the presence) their actors brought to their roles. Visions of Hope: The Look of Rogue One: Designing a world that''s true and familiar to the Star Wars universe but still unique to the film. It explores set construction, small design changes, and the black stormtroopers. The Princess and The Governor: Digitally recreating two important characters. Epilogue: The Story Continues (1080p, 4:15): Images from the film''s premiere juxtaposed against fans talking up the film and the franchise. The piece ends with a selection of clips from the film.', null, 7.2, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.251350 +00:00', '2021-06-16 20:14:09.251366 +00:00', '2fe4dc4e-0938-49fe-866a-b0f2cac8d468', 'Sparkling Red Star', 'The adventure of Dongzi Pan, a boy whose father left home for the Long March in the Red Army and whose mother was killed by gangster of the evil landlord Hu.', null, 6.6, 'movie');
