INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.251493 +00:00', '2021-06-16 20:14:09.251509 +00:00', '61dcf7a8-63b4-4cca-b6ea-e3f574acf93c', 'Star Pink', 'In the year 2001 ¬Ω, the Pink Panther is a gas station attendant on a small planet. When a particularly dangerous-looking spaceship arrives, the panther panics and closes his station, which makes the green little pointy-nosed man flying the ship furious. The panther tries to elude the man and his search robot by all possible means, even evaporating himself in a molecular disassembler and reassembling himself in another. The man does the same, but the panther throws a flower into the reassembler, which turns the man into part flower.', null, 5.4, 'movie');
