INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.251639 +00:00', '2021-06-16 20:14:09.251655 +00:00', 'f4955e87-b2c5-4221-9bd1-43d289eeb9f7', 'Star Wars: Star Warriors', 'Some Star Wars fans want to collect action figures... these fans want to be action figures! A tribute to the 501st Legion, a global organization of Star Wars costume enthusiasts, this insightful documentary shows how the super-fan club promotes interest in the films through charity and volunteer work at fundraisers and high-profile special events around the world.', null, 7.4, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.251689 +00:00', '2021-06-16 20:14:09.251704 +00:00', '834f66ad-7539-4d19-9d15-abf5750aab67', 'Fall in Love Like a Star', 'A superstar musician falls in love with his manager and struggles to choose between his career and true love.', null, 5.3, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.251737 +00:00', '2021-06-16 20:14:09.251753 +00:00', '2f0b8fa3-8930-4046-bdcf-2f257899a2b9', 'The One: Making a Music Star', 'Based on the international sensation, the series will follow the lives of contestants as they attend a fully functioning music academy that turns aspiring singers into music stars through professional training. The show will follow all the drama in the music academy, as it offers vocal coaching and celebrity mentors who will turn potential into talent in a state-of-the-art training and recording facility. Each week contestants will perform live for the American audience, who will have to vote to keep their favorites in the competition. In addition, the contestants'' coaches will also serve as judges. The winner will receive a recording contract with a major record company.', null, 4, 'movie');
