INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.251882 +00:00', '2021-06-16 20:14:09.251898 +00:00', '6be27471-2dd9-4989-8307-e5e96e9c38da', 'Death Star Repairmen', 'Two Imperial Repairmen find themselves in the middle of the infamous battle between their monsterous death ship and a tiny fighter piloted by Rebel scum, Luke Skywalker. When the call to ...', null, 6.4, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.251930 +00:00', '2021-06-16 20:14:09.251945 +00:00', '41599250-0f83-42ce-b610-00e805c5e775', 'Phantasy Star II', 'Somewhere in the deep vastness of space, within the Andromeda Galaxy lies the Algol Star System floating like a dust fleck in a sunbeam. Around the parent star, Algol, whirl its three children: Palm, Mota, and Dezo. Closest to Algo is Palm, the economic and intellectual stronghold of the system. Of the three planets the middle gleamed the brightest like an emerald. This is Mota, a beautiful, beckoning jewel gripped by madness!', null, 8, 'movie');
