INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.252120 +00:00', '2021-06-16 20:14:09.252136 +00:00', '07b7923f-7238-4413-89ca-632cc2243156', 'Phantasy Star Online 2: The Animation', 'Itsuki Tachibana is a student of Seiga Academy, a co-ed boarding high school with excellent reputation, located in a suburb outside the city center. On a day of second semester, he was summoned by Rina Izumi, the most esteemed and praised chairperson, to the student council room, without knowing what awaits him.', null, 6.4, 'movie');
