INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.253396 +00:00', '2021-06-16 20:14:09.253412 +00:00', 'ab1643e7-08b9-43dc-8265-ffaba9635a4d', 'Star Trek: Shattered Universe', 'The U.S.S. Excelsior, under the command of Captain Sulu is transported to the hostile Mirror Universe where Starfleet and the Federation are the bad guys, and its up to you to find a way to get the Excelsior back to the normal universe, fighting hostile Federation ships, including the I.S.S. Enterprise along the way.', null, 7.8, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.253496 +00:00', '2021-06-16 20:14:09.253511 +00:00', '58ed2beb-aa85-438d-9156-f1767aaffeb2', 'Star Wars Galaxies: The Total Experience', null, null, 5.9, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.252368 +00:00', '2021-06-16 20:14:09.252384 +00:00', '163fa9c6-7604-4b2f-8190-0da8b8a4ba6f', 'The Star Maker', 'A penniless song writer, Larry Earl, is convinced he is going places in shown business, and convinces Mary, an assistant at an orphanage, to marry him. Fifteen months later they are still in love, but broke as Larry writes songs that won''t sell and loses one job after another one. He stops to watch a group of newsboys singing and dancing, and decides to organize them into the greatest kid act to ever hit vaudeville. Mary persuades Proctor, a big theatrical manager, to book the act, and they are a big hit. Then Larry and his publicity agent, "Speed" King, launch a big publicity stunt---a talent train in which they travel across country holding auditions for young performers. Back in New York, Carlotta Salvini, an ex-OPera singer, brings in her talented fourteen-year-old-daughter, Jane, who has an amazing voice. Larry, to get the mother out of the way, offers Carlotta a forty-week vaudeville tour, and then goes to work to make a star out of Jane, by building Braodway''s first all-kiddie musical revue around her. Opening night has "School Days" as the first act and the show and Jane are a big hit...until the Gerry Society, organized to protect working children, reminds Larry there is a law against children working after 10 p m., and the show closes. Larry''s future appears dim at best.', null, 6, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.252418 +00:00', '2021-06-16 20:14:09.252434 +00:00', 'a6fed222-b60c-49ff-bcd6-30e9472bc4c4', 'Star Trek: The Next Generation Interactive Technical Manual', null, null, 7.6, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.252465 +00:00', '2021-06-16 20:14:09.252481 +00:00', 'cc4a05f1-1900-402c-8f69-a97ce2e33f6f', 'The Car That Became a Star', 'At a 1965 international auto show in New York City, the key attraction is not a new car but a 35 year old late 1930s-vintage brilliant yellow colored Phantom II Rolls-Royce limousine. Its claim to fame is that it is the star of the MGM feature film The Yellow Rolls-Royce (1964). For filming, the automobile traveled from London to northern Italy (Pisa and Florence) to Austria to Yugoslavia, along the way encountering its several co-stars including Rex Harrison and Jeanne Moreau in London, Shirley MacLaine, George C. Scott, Art Carney and Alain Delon in Italy, and Ingrid Bergman and Omar Sharif in Austria and Yugoslavia. The limo also encountered many fans interested both in the filming and the vehicle itself. During filming, the limo was well taken care of by a large maintenance crew. In its post filming life, the limousine has even inspired a fashionable clothing line by designer Joan Leslie in, of course, the famous yellow motif.', null, 5.4, 'movie');
