INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.252610 +00:00', '2021-06-16 20:14:09.252626 +00:00', 'cd19b384-babd-4b0c-ba0a-5c272bcf0238', 'Star Wars: The Lesser Evil', 'A Jedi Master and his Padawan, with the help of a bounty hunter, go after a Sith Lord.', null, 6.5, 'movie');
