INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.252658 +00:00', '2021-06-16 20:14:09.252674 +00:00', '22cd1a60-c386-462f-b5a3-e421b354226f', 'All-Star Academy', 'Together, Alex Guarnaschelli, Bobby Flay, Michael Symon and Curtis Stone make up one of the fiercest foursomes in culinary competitions. In this series, they will battle it out in the kitchen, as mentor versus mentor with teams of shining home cooks.', null, 7, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.252709 +00:00', '2021-06-16 20:14:09.252724 +00:00', '9da2813c-cb57-4c7d-9a8e-5081ce5adb28', 'Star Wars Begins: A Filmumentary', 'Filmmaker Jamie Benning has finally finished his trilogy of documentary-commentaries. This final chapter concentrates on the first Star Wars film. Like his two previous documentaries, Building Empire (2006) and Returning to Jedi (2007), Star Wars Begins is an unofficial look at the creation of the classic movie and features deleted scenes, alternate takes and different angles, bloopers, original on set audio recordings and a huge amount of commentary from cast and crew, culled from every corner of the galaxy.', null, 8.2, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.252758 +00:00', '2021-06-16 20:14:09.252774 +00:00', '94ca979d-8a5f-433d-93f1-076fdb838eed', 'Star Trek: Captain Pike', 'Tells a pre-Kirk story about what happened on Rigel VII prior to The Cage episode of the original Star Trek series. This is the story of Captain Pike when he first takes command of the Enterprise and his first mission aboard her.', null, 2.8, 'movie');
