INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.253049 +00:00', '2021-06-16 20:14:09.253064 +00:00', '5f1a4219-b533-489f-8af2-0d2692504857', 'An All-Star Toast to the Improv', 'To celebrate the "birthday" of the famous Improv comedy club, 6 famous comedians get up on stage and do their thing. However, to make things interesting, while each one does his particular routine, the other 5 comics sit at the back of the stage and heckle the performer. This video is especially notable for Martin Mull issuing a zinger at Robin Williams that shuts-up the otherwise motor-mouthed comic for at least 5 seconds.', null, 7.2, 'movie');
