INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.253636 +00:00', '2021-06-16 20:14:09.253652 +00:00', '5b933497-27e2-43a6-b1e4-94468e11c4c1', 'Jingle & Bell''s Christmas Star', 'In "Jingle & Bell," Jingle the Husky Pup and his buddy Andrew meet some new friends. A girl Andrew''s age, Sofia, and her Husky pup, Bell, have moved from sunny Palm City to Pineville weeks before Christmas. With no friends yet and not knowing what to expect, Sofia and Bell''s world is upside down and it looks like it might be the worst Christmas ever. But with a little help from Jingle and Andrew, Sofia and Bell will soon discover that Christmas joy isn''t about where you are -- it''s about who you are with!', null, 7.5, 'movie');
