INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.253788 +00:00', '2021-06-16 20:14:09.253804 +00:00', '0c93f106-e7e6-48c5-97bc-964d3fefc8c4', 'Star Wars: Shortened!', 'The George Lucas Apreciation Society (GLAS) share their passion for the Star Wars saga in this hilarious, shortened version. For the first time in British TV history, they present all six movies in just under 20 minutes!', null, 7.8, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.253836 +00:00', '2021-06-16 20:14:09.253852 +00:00', '2f4533f6-e891-42a8-9373-469d43d238b3', 'Inside Star Trek: The Real Story', 'Who directed the pilot for the original Star Trek series? Where was it filmed? Who really built the Enterprise? You may own The Star Trek Encyclopedia, and you may have seen every episode, but you still don''t have all the answers! For the first time, the men and women who worked behind the scenes on the most popular science fiction telelvision series ever created invite you to go boldly where no fan has gone before. In-depth interviews will introduce you to the writers, directors, producers, technicians and artists who breathed life into the original Star Trek series. You''ll discover their greatest joys, their deepest sorrows and everything else you ever wanted to know about the greatest show in the galaxy. There are no actors and no special effects. Just the truth.', null, 6.8, 'movie');
