INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.253936 +00:00', '2021-06-16 20:14:09.253952 +00:00', 'c42204d3-30ed-442e-a0ea-5278a1946d5f', 'Working Class Rock Star', 'The music industry is changing, record sales are down, artists are making less money, and mediocrity holds sway. Yet there are more bands than ever before working for years just to receive even the tiniest drop of success. Following the lives and careers of Tub Ring, Bloodshoteye, and 3 Mile Scream, with supporting interviews from major players in the heavy music scene, this documentary sheds light on why some bands never make it and why the ones that break realize only too soon that life on a label is only the beginning of their troubles.', null, 7, 'movie');
