INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.254755 +00:00', '2021-06-16 20:14:09.254771 +00:00', '2f3155b9-127d-4fc8-adfd-a1745c9b5858', 'Rail of the Star', 'A young Japanese actress remembers her war childhood in Korea. Her father goes to fight, her baby sister Miko dies of typhoid, her beloved Korean maid Ohana is fired due to a mistake which could cost Chiko her life... By and by Chiko realizes that the country is being ruled by the Japanese and the Koreans are persecuted. When the war ends, the Koreans chase the Japanese rule and the roles change. Now Chiko''s family is unwanted. But then the Russians come and this is the end. They have to burn all the pictures to avoid all suspicions... even Miko''s picture. But when the Russians come to their house, they decide to flee over the 38th Parallel towards freedom. A group of men, women, children struggles along the mountains, led by the light of the Northern Star. Along the way they meet a Korean man, who is willing to help them to escape the Russian soldiers although his family was killed by the Japanese.', null, 7.6, 'movie');
