INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.254948 +00:00', '2021-06-16 20:14:09.254963 +00:00', 'a6187fa4-56e9-4fb4-8fba-ca9b27ace656', 'Star Trek Secret Voyage: Whose Birth These Triumphs Are', 'Secret Voyage takes place after the completion of the U.S.S. Enterprise''s 5 year mission under legendary Captain James T. Kirk and before the events portrayed in "Star Trek: The Motion Picture". The story begins with Captain Calvin Mercer being called into the office of Admiral Hernadez office and asked to take on a secret mission before he finds out what it is. Bored with his ground assignments Mercer accepts. The mission that he chose to accept involves taking the refurbished Enterprise to the edge of known space and brokering a treaty with an alien race that has developed a new fuel that promises to revolutionize space travel. What seems like a straight forward mission involving first contact with a strange new world and new civilization quickly turns into something much more complicated with sinister overtones and hints of betrayal from within Star Fleet, or...someone else.', null, 5.9, 'movie');
