INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.257409 +00:00', '2021-06-16 20:14:09.257425 +00:00', '2b16f7be-b5b7-4851-9952-2ec310446690', 'Star Trek: Inside the Roddenberry Vault', 'Fifty years after the original Star Trek first arrived on television, is there anything about Gene Roddenberry''s space opera that hasn''t been uncovered? Plenty! On December 13, 2016 fans can experience Star Trek: The Original Series - The Roddenberry Vault, a newly produced multi-part documentary featuring footage from the cutting room floor, long preserved in film canisters by the Roddenberry Estate. The origins of the classic series are explored with new interviews featuring cast and production personnel combined with newly-found deleted scenes, alternate angles, outtakes, behind the scenes moments, and original visual effects elements to tell the definitive story on the making and enduring legacy of Gene Roddenberry''s creation.', null, 7.7, 'movie');
