INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.265739 +00:00', '2021-06-16 20:14:09.265755 +00:00', '738c94b1-3532-4577-bdde-6e305a000862', 'The North Star', 'The North Star is the story of Benjamin "Big Ben" Jones and Moses Hopkins, two slaves who escaped from a Virginia plantation and made their way to freedom in Buckingham, Pennsylvania in 1849. Big Ben''s 6 foot 10 inch size and a record bounty for his safe return make him the focus of every slave hunter on the east coast. Their journey exposes them to danger and cruelty; however it also exposes them to the unexpected kindness of the people involved in the Underground Railroad. These experiences will change Ben and Moses forever. Upon reaching the relative safety of Mt. Gilead Church on Buckingham Mountain, Ben and Moses get to experience life as free men and cross paths with historical figures such as Frederick Douglass, Harriet Tubman, Joshua and Jonathan Fell. Their freedom also allows them to experience heroism, romance and treachery.', null, 5.5, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.265789 +00:00', '2021-06-16 20:14:09.265805 +00:00', 'a72e0406-8b09-4f7a-9d2b-cd261c2729f4', 'Lone Star Justice', 'Tyler, Texas might be a town of just 100,000 people, but the violent crime rate is way higher than the national average. Three of the country''s top law enforcers - JB Smith, Joe Rasco, and ...', null, 8.2, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.265837 +00:00', '2021-06-16 20:14:09.265853 +00:00', 'd553bc7b-02ce-47fd-bb30-03fc396ee3a6', 'Disney Star Darlings', 'As far back as anyone can remember, Starlings have granted wishes for Earthlings. But when an evil force suddenly threatens Starland, twelve Star-Charmed girls are sent on the most magical adventures of their lives...as THE STAR DARLINGS.', null, 6.4, 'movie');
