INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.266849 +00:00', '2021-06-16 20:14:09.266865 +00:00', '429ecacb-d715-44bc-a3ff-2159468d99a9', 'Ocean Star', 'City boys Trent and Dylan are packed off by their mother to live with father in a small town where life threatens to be unbelievably dull. Things are even worse than they imagined - the local kids are fiercer than the unfamiliar wildlife. Trent meets an old pearl diver who tells him the mystery of the Ocean Star, a priceless cluster of pearls he claims to have lost when his pearl boat was sunk in a cyclone 40 years ago. Trent eventually wins over the local kids and together they embark on a quest that takes them through the outback, a quest that will turn out to be more dangerous and exciting than they ever imagined.', null, 8.1, 'movie');
