INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.267604 +00:00', '2021-06-16 20:14:09.267620 +00:00', '45e56b4b-ca69-4694-b5ab-71ac80ef12b4', 'Atlantis: Secret Star Mappers of a Lost World', 'Go beyond the lost human history! A profile and examination of the recent findings of a highly advanced human settlement submerged at the end of the Ice Age when the sea level rose. The story of Atlantis has its roots in actual historical events!', null, 5.7, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.267653 +00:00', '2021-06-16 20:14:09.267668 +00:00', 'a4874497-1fcb-4590-8ce7-b677922637e0', 'Star Appeal', 'Chinese activist filmmaker Cui Zi''en crafts the first all gay Chinese science fiction film with this fantastical tale of a lonely extraterrestrial who learns a tender lesson in earthly love after being taken in by a curious bisexual. When Xiao Bo first saw the curious alien, he was alone and naked on a long stretch of highway. He claimed to be from Mars, so Xiao Bo brought him home in order to teach him a thing or two about life on Earth. Dubbed "ET" by his human hosts, the curious alien soon reveals that he has been sent to this planet in order to learn as much as possible about physical interaction. Bisexual Xiao Bo has both a girlfriend and a boyfriend, neither of whom are particularly thrilled that Xiao Bo has brought home a new lover. Later, when Xiao Bo''s girlfriend attempts to have a child with "ET," the alien falls into a deep coma. Now the way to revive "ET" is for Xiao Bo to utter the words "I love you." Once that happens, Xiao Bo resolves to teach his extraterrestrial friend the true meaning of Earthly Love before "ET" travels back to his home planet to reveal his passionate findings.', null, 4.1, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.267703 +00:00', '2021-06-16 20:14:09.267720 +00:00', '1dcfed00-a0a1-4042-9811-66d7eb5d94bb', 'Star Wars: Launch Bay - Meet the Makers', 'Presented as part of the STAR WARS: LAUNCH BAY experience at Disneyland and Disney''s Hollywood Studios, "Meet the Makers" is a featurette exploring the past, present and future of the STAR WARS franchise, including interviews with the new generation of storytellers behind the Saga.', null, 6.4, 'movie');
