INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.268036 +00:00', '2021-06-16 20:14:09.268051 +00:00', '765659fe-df28-4bba-a923-d02d809a4c73', 'Soul Star', 'Soulstar is a 3D shoot-''em up that combines several different types of gameplay into one game. Some levels in this game are on a fixed path, similar to Space Harrier or Star Fox. Other levels allow your space craft to hover freely around a 3D environment, and in other levels your craft transforms into a walker robot for close-up attacks. In Soulstar you are a warrior pilot known as Bryk Hammelt. It is your mission to prevent an alien aggressor known as the Myrkoids from draining the Soulstar system of its energy resources.', null, 6.6, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.268085 +00:00', '2021-06-16 20:14:09.268101 +00:00', 'fe12e428-be67-4bb9-9629-4ab1385dc8be', 'Crescent Star', 'In 1944, the Germans began rounding up the Jews of Rhodes. The Turkish Consul General, Selahattin Ulkumen, interceded on behalf of those Jewish who were Turkish nationals. By his efforts, 42 Jewish families were set free from the deportation to Auschwitz-Birkenau. In reprisal, German planes bombed the consulate building and Ulkumen''s house, killing his staff and pregnant wife. His sacrifice made consul Selahattin Ulkumen the first non-Christian to be declared a Righteous Gentile by Yad Vashem, Israel''s Holocaust memorial.', null, 7.9, 'movie');
