INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.268377 +00:00', '2021-06-16 20:14:09.268392 +00:00', '0f077655-86d0-480b-ba37-a74bcbd786d6', 'Antonio Carlos Jobim: An All-Star Tribute', 'Direct from Brazil in his last recorded performance, Antonio Carlos Jobim (1927-1994) is joined by an international delegation of jazz giants to recreate his classic melodies in a beautiful, concert-length "Thank You." With over four hundred songs to his credit, including the unforgettable "Girl From Ipanema," Jobim virtually singlehandedly brought the world the Bossa Nova. Adapting the percussive excitement of the Samba to the intimacy of the guitar while echoing the melodies and harmonies of Cool Jazz, Jobim''s new sound quickly became a staple ingredient in the jazz cookbook, and in 1991 Jobim was inducted into the Songwriter''s Hall of Fame.', null, 7.6, 'movie');
