INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.270262 +00:00', '2021-06-16 20:14:09.270278 +00:00', 'd154ff42-ee7f-4d01-972c-02ac11b3fb8f', 'The Butcher, the Star and the Orphan', null, null, 7.3, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.270309 +00:00', '2021-06-16 20:14:09.270324 +00:00', '2680437f-dd09-49c2-a72c-06139a1c89bb', 'Star of the Family', 'Fire Captain Buddy Krebs'' 16-year-old daughter Jennie Lee begins getting show-business offers because of her singing talents in the country/pop genre. This scares Buddy because he does not want his daughter to grow up too fast. Adding to his troubles, are (1) his wife runs off with a bellhop, (2) his 17-year-old son has muscle instead of brains in his head, (3) his crew down at the firehouse are "strange": Feldmand tells his mother he is a doctor instead of a fireman, Rosetti has only sex on the brain and Max, a Hispanic, speaks fractured English. Finally, his daughter signs with a manager named Moose; the name fits the description of the woman.', null, 7.2, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.270361 +00:00', '2021-06-16 20:14:09.270377 +00:00', 'e9bba41c-d091-4d4f-890f-ae4e22dde857', 'Lone Star Raiders', 'Dust storms and drought make herding horses a tough job for the boys. When the new owner of the ranch, Lydia Phelps, shows up, the ranch is in dire financial straits. The Martin Ranch has ...', null, 8.2, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.270409 +00:00', '2021-06-16 20:14:09.270425 +00:00', '34346467-9a98-4079-83b0-81822f1c98b3', 'The Falling Star', null, null, 5.8, 'movie');
INSERT INTO content.film_work (created, modified, id, title, description, creation_date, rating, type) VALUES ('2021-06-16 20:14:09.270456 +00:00', '2021-06-16 20:14:09.270472 +00:00', '479f20b0-58d1-4f16-8944-9b82f5b1f22a', 'The Soap-Suds Star', 'Some of the vaudeville manager''s "star acts" had failed to make good, others were still detained abroad. The manager called his press agent in, scolded him and ordered him to secure a vaudeville team, adding that "they must be extremely funny and extremely cheap." Within a short time the agent returned and proudly announced he had found "an absolute novelty, and a joint salary of $15." "I dodged all the agencies," he explained, "and down on one of the side streets I ran across an old-time ham actor. I followed him. He went into a laundry and tried to get his duds out without paying for them. Well, the woman who ran the joint was a regular comedy queen. She didn''t say much, but she certainly was full of ''pep.'' She nearly wrecked the laundry with that actor, and I never laughed so much in my life. When I offered them an engagement the man balked, but the woman accepted for both of them, saying he could work out his laundry bill anyhow." The manager tried the act out, and it made a big hit. The morning papers gave much space to the "Soap Suds Star," Sophie, the laundress. Much to his dismay, however, the press agent found the manager in an extremely bad humor. "It''s all your fault," he said bitterly, "You get me to hire amateurs, and now they are going to be married, and quit vaudeville for the classics." "I think it a dandy idea," said the agent. "Sophie as Juliet would coin money for any manager. Why not try them out in the balcony scene" The manager, impressed, retained his "Soap Suds Star," and his leading man. Sophie s bad temper, however, spoiled her artistic career. She was on the job as Juliet, all right, but Romeo nearly missed the performance, and when he did appear he wore his street clothes, explaining with an alcoholic smile that he had been out with the boys and really had no time to dress. Sophie left her art to chastise him, but after a lively chase he escaped by leaping into the river, and the one-time actress returned to her laundry, believing she was a widow. But her husband came back and Sophie forgave him. Then, finding that his clothes had been well sprinkled in the river, she ironed him out, and gave him a life position in the laundry.', null, 5.3, 'movie');
